(77, 'widget_text', 'a:5:{i:2;a:4:{s:5:\"title\";s:15:\"About This Site\";s:4:\"text\";s:85:\"This may be a good place to introduce yourself and your site or include some credits.\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:3;a:4:{s:5:\"title\";s:7:\"Find US\";s:4:\"text\";s:159:\"<strong>Address</strong>\n123 Main Street\nLondon EC1 4UK\n\n<strong>Hours</strong>\nMonday&ndash;Friday: 09:00&ndash;17:00\nSaturday &amp; Sunday: 11:00&ndash;15:00\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:4;a:4:{s:5:\"title\";s:8:\"About Us\";s:4:\"text\";s:232:\"Guildford U3A Photography Group is open to all members of Guildford U3A and aims to meet once a month either via Zoom meeting or when permitted in person. We also have regular socially distanced photoshoots at interesting locations.\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:5;a:4:{s:5:\"title\";s:7:\"Join Us\";s:4:\"text\";s:353:\"If you live in the Guildford area and would like to explore joining the group, please email our <a title=\"creates an email message\" href=\"mailto:members@u3aguildfordphoto.org.uk\">membership secretary</a>. You also need to be a member of <a title=\"opens a new window\" href=\"http://www.guildfordu3a.org.uk\" target=\"_blank\" rel=\"noopener\">Guildford U3A</a>\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}s:12:\"_multiwidget\";i:1;}', 'yes'),
