i Urabe)</a>, <a href=\"https://profiles.wordpress.org/torres126/\">torres126</a>, <a href=\"https://profiles.wordpress.org/zodiac1978/\">Torsten Landsiedel</a>, <a href=\"https://profiles.wordpress.org/itowhid06/\">Towhidul I Chowdhury</a>, <a href=\"https://profiles.wordpress.org/tray/\">tracy apps</a>, <a href=\"https://profiles.wordpress.org/treibstoff/\">treibstoff</a>, <a href=\"https://profiles.wordpress.org/trisha_cornelius/\">Trisha Cornelius</a>, <a href=\"https://profiles.wordpress.org/dinhtungdu/\">Tung Du</a>, <a href=\"https://profiles.wordpress.org/tzafrir/\">tzafrir</a>, <a href=\"https://profiles.wordpress.org/desaiuditd/\">Udit Desai</a>, <a href=\"https://profiles.wordpress.org/grapplerulrich/\">Ulrich</a>, <a href=\"https://profiles.wordpress.org/uxkai/\">uxkai</a>, <a href=\"https://profiles.wordpress.org/valentinbora/\">Valentin Bora</a>, <a href=\"https://profiles.wordpress.org/contact-banker/\">Varun Sharma</a>, <a href=\"https://profiles.wordpress.org/vcanales/\">vcanales</a>, <a href=\"https://profiles.wordpress.org/ravivaddweb/\">vidhiaddweb</a>, <a href=\"https://profiles.wordpress.org/vinayakanivase/\">Vinayak Anivase</a>, <a href=\"https://profiles.wordpress.org/vinita29/\">Vinita Tandulkar</a>, <a href=\"https://profiles.wordpress.org/usestrict/\">Vinny</a>, <a href=\"https://profiles.wordpress.org/virgodesign/\">virgodesign</a>, <a href=\"https://profiles.wordpress.org/webmandesign/\">WebMan Design &#124; Oliver Juhas</a>, <a href=\"https://profiles.wordpress.org/webmigrates/\">Webmigrates Technologies</a>, <a href=\"https://profiles.wordpress.org/westonruter/\">Weston Ruter</a>, <a href=\"https://profiles.wordpress.org/earnjam/\">William Earnhardt</a>, <a href=\"https://profiles.wordpress.org/williampatton/\">williampatton</a>, <a href=\"https://profiles.wordpress.org/planningwrite/\">Winstina Hughes</a>, <a href=\"https://profiles.wordpress.org/wittich/\">wittich</a>, <a href=\"https://profiles.wordpress.org/worldweb/\">worldweb</a>, <a href=\"https://profiles.wordpress.org/y_kolev/\">Y_Kolev</a>, <a href=\"https://profiles.wordpress.org/yansern/\">Yan Sern</a>, <a href=\"https://profiles.wordpress.org/yoavf/\">Yoav Farhi</a>, <a href=\"https://profiles.wordpress.org/yscik/\">yscik</a>, <a href=\"https://profiles.wordpress.org/fierevere/\">Yui</a>, <a href=\"https://profiles.wordpress.org/yvettesonneveld/\">Yvette Sonneveld</a>, and <a href=\"https://profiles.wordpress.org/zebulan/\">Zebulan Stanphill</a>.\n\n\n\n<p></p>\n\n\n\n<p>In addition, many thanks to all of the community volunteers who contribute in the <a href=\"https://wordpress.org/support/\">support forums</a>. They answer questions from people across the world, whether they are using WordPress for the first time, or theyve been around since the first release all the way back in 2003. These releases are as successful as they are because of their efforts!</p>\n\n\n\n<p>Finally, thanks to all the community translators who helped make WordPress 5.6. available in 38 languages at the time of release. Our community translators are hard at work ensuring more languages are on their way (70 are already at 90%). If contributing to WordPress appeals to you, its easy to learn more. Check out <a href=\"https://make.wordpress.org/\">Make WordPress</a> or the <a href=\"https://make.wordpress.org/core/\">core development blog</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 08 Dec 2020 23:45:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Josepha\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"BuddyPress: BuddyPress 2020 Survey results\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=315969\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://buddypress.org/2020/12/buddypress-2020-survey-results/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:44558:\"<p>The BuddyPress 2020 survey was published the same day we released <a href=\"https://buddypress.org/2020/05/buddypress-6-0-0/\">BuddyPress 6.0.0 &#8220;iovine&#8217;s&#8221;</a> (May 13, 2020). Now that we are about to release our next major release (<a href=\"https://buddypress.org/2020/12/buddypress-7-0-0-rc2/\">7.0.0 will be delivered in the coming days</a>), it is time to share with you the survey results.</p>\n\n\n\n<p>First, many thanks to all the respondents who participated to this survey <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f60d.png\" alt=\"\" class=\"wp-smiley\" />. Doing so you contributed to give the BuddyPress Core Team informations about how the plugin is used, could be used and how its usage is evolving. Some of the questions we asked are directions we&#8217;re considering for the plugin (eg: <a href=\"https://buddypress.org/wp-admin/post.php?post=315969&action=edit#q-9\">Q9</a>, <a href=\"https://buddypress.org/wp-admin/post.php?post=315969&action=edit#q-10\">Q10</a>, <a href=\"https://buddypress.org/wp-admin/post.php?post=315969&action=edit#q-17\">Q17</a>), so your inputs are very important to us.</p>\n\n\n\n<p>As no questions were required, it&#8217;s difficult to be 100% accurate about how many people took the survey. So we were at least (we also took the survey <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f609.png\" alt=\"\" class=\"wp-smiley\" />) <strong>483</strong> from <a href=\"https://buddypress.org/feed/#survey-map\">all over the world</a> as it&#8217;s the highest number a question was replied to.</p>\n\n\n\n<p>Most of the questions were leaving participants the choice to select more than one reply, this is why if you sum up the percentage results you&#8217;ll often find more than 100% <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f601.png\" alt=\"\" class=\"wp-smiley\" />.</p>\n\n\n\n<p>When we had data about a previous survey we made in 2018, we compared the 2020 results with them and calculated the differences between both years percentages. We thought it could be interesting to see how some results are evolving.</p>\n\n\n\n<span id=\"more-315969\"></span>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-1\"><em>1. How are you using BuddyPress?</em></h2>\n\n\n\n<p>Number of respondents: <strong>483</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Years &amp; evolution</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td rowspan=\"3\">I use BuddyPress on my own site</td>\n                <td>2020</td>\n                <td>72.7%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>74.2%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-1.6%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">I build BuddyPress sites for others</td>\n                <td>2020</td>\n                <td>35.2%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>32.4%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>2.8%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\"><strong>I develop BuddyPress themes</strong></td>\n                <td>2020</td>\n                <td>13.3%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>9.7%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><strong><span class=\"has-inline-color\">3.6%</span></strong></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\"><strong>I develop BuddyPress plugins</strong></td>\n                <td>2020</td>\n                <td>15.1%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>13.0%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color\"><strong>2.1%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">I host BuddyPress sites</td>\n                <td>2020</td>\n                <td>15.5%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>14.8%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>0.7%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Other</td>\n                <td>2020</td>\n                <td>9.1%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>4.6%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>4.5%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p><strong>NB</strong>: between 2018 &amp; 2020 the &#8220;<em>I build BuddyPress sites, themes, and plugins.</em>&#8221; choice disappeared.</p>\n\n\n\n<p>It&#8217;s interesting to see BuddyPress plugin and theme developers replied more  to this survey. Another explanation could be there are possibly more people extending or designing for BuddyPress <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f64c.png\" alt=\"\" class=\"wp-smiley\" />.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-2\"><em>2. What types of BuddyPress sites have you built?</em></h2>\n\n\n\n<p>Number of respondents: <strong>409</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Year</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td>Academic</td>\n                <td>2020</td>\n                <td>33.5%</td>\n            </tr>\n            <tr>\n                <td>Artistic</td>\n                <td>2020</td>\n                <td>18.3%</td>\n            </tr>\n            <tr>\n                <td>Gaming</td>\n                <td>2020</td>\n                <td>14.2%</td>\n            </tr>\n            <tr>\n                <td>Generic</td>\n                <td>2020</td>\n                <td>30.3%</td>\n            </tr>\n            <tr>\n                <td>Religious</td>\n                <td>2020</td>\n                <td>10.5%</td>\n            </tr>\n            <tr>\n                <td>Scientific</td>\n                <td>2020</td>\n                <td>14.4%</td>\n            </tr>\n            <tr>\n                <td>Sports</td>\n                <td>2020</td>\n                <td>10.5%</td>\n            </tr>\n            <tr>\n                <td>Other</td>\n                <td>2020</td>\n                <td>33.5%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p><strong>NB</strong>: data from 2018 is missing.</p>\n\n\n\n<p>The &#8220;Other&#8221; reply was often chosen. When looking deeply into these replies, we discovered some interesting types, eg: Health / Medical / Therapist communities, Recipe sharing sites, Intranet &amp; Business networks, Non-profit / charity / solidarity / ecological communities, Social Marketplaces, Dating platforms, Local municipality information center / local life / Administration sites and some specific communities like private or restricted ones.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-3\"><em>3. How do you host your production sites using BuddyPress?</em></h2>\n\n\n\n<p>Number of respondents: <strong>414</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Years &amp; evolution</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td rowspan=\"3\">Shared Hosting</td>\n                <td>2020</td>\n                <td>44.9%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>52.5%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-7.6%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Virtual Private Server</td>\n                <td>2020</td>\n                <td>30.0%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>30.0%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>-0.1%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Dedicated Server</td>\n                <td>2020</td>\n                <td>22.2%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>18.0%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>4.2%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\"><strong>Managed WordPress Hosting</strong></td>\n                <td>2020</td>\n                <td>23.4%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>15.1%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color\"><strong>8.3%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Cloud-based Services</td>\n                <td>2020</td>\n                <td>18.4%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>12.8%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>5.6%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Other</td>\n                <td>2020</td>\n                <td>6.0%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>3.4%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>2.6%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p>Looks like Managed WordPress Hosting plans are increasing <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f914.png\" alt=\"\" class=\"wp-smiley\" /></p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-4\"><em>4. How do you set up BuddyPress in your WordPress installations?</em></h2>\n\n\n\n<p>Number of respondents: <strong>427</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Years &amp; evolution</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td rowspan=\"3\">WP in domain root</td>\n                <td>2020</td>\n                <td>68.4%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>74.8%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-6.4%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">WP in physical subdirectory folder</td>\n                <td>2020</td>\n                <td>19.7%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>15.6%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>4.1%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">WP in physical subdomain</td>\n                <td>2020</td>\n                <td>15.0%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>9.0%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>5.9%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\"><strong>WP Multisite in domain root &#8211; BP Network-activated</strong></td>\n                <td>2020</td>\n                <td>20.4%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>11.5%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color\"><strong>8.9%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">WP Multisite in subsite (subdirectory) &#8211; BP Network-activated</td>\n                <td>2020</td>\n                <td>11.0%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>4.7%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>6.3%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">WP Multisite in subsite (subdomain) &#8211; BP Network activated</td>\n                <td>2020</td>\n                <td>11.7%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>4.7%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>7.0%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">WP Multisite in domain root &#8211; BP activated only on the main network site</td>\n                <td>2020</td>\n                <td>9.6%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>3.3%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>6.3%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">WP Multisite in subsite (subdirectory) &#8211; BP activated on a subsite of the network</td>\n                <td>2020</td>\n                <td>9.8%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>4.7%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>5.2%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">WP Multisite in subsite (subdomain) &#8211; BP activated on a subsite of the network</td>\n                <td>2020</td>\n                <td>9.4%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>4.7%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>4.7%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">WP Multisite in domain root &#8211; the constant BP_ENABLE_MULTIBLOG is defined in your wp-config.php file to spread BuddyPress on all sites of the network</td>\n                <td>2020</td>\n                <td>12.4%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>4.7%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>7.8%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p><strong>NB</strong>: between 2018 &amp; 2020 the &#8220;WP Multisite with BuddyPress Multi-Network&#8221; choice disappeared.</p>\n\n\n\n<p>Multisite configurations are slightly increasing while regular WordPress configurations are a bit less used.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-5\"><em>5. What BuddyPress components/features are always or almost always activated in your site/s?</em></h2>\n\n\n\n<p>Number of respondents: <strong>428</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Years &amp; evolution</th>\n                <th>Everytime</th>\n                <th>Sometimes</th>\n                <th>Never</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td rowspan=\"3\">Account Settings</td>\n                <td>2020</td>\n                <td>74.5%</td>\n                <td>11.9%</td>\n                <td>4.2%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>91.8%</td>\n                <td>6.5%</td>\n                <td>1.7%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-17.3%</strong></span></td>\n                <td>5.4%</td>\n                <td>2.5%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Activity Streams</td>\n                <td>2020</td>\n                <td>64.3%</td>\n                <td>17.5%</td>\n                <td>6.3%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>75.0%</td>\n                <td>20.9%</td>\n                <td>4.1%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-10.7%</strong></span></td>\n                <td>-3.4%</td>\n                <td>2.2%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Extended Profiles</td>\n                <td>2020</td>\n                <td>70.1%</td>\n                <td>16.4%</td>\n                <td>4.2%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>86.6%</td>\n                <td>12.1%</td>\n                <td>1.4%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-16.5%</strong></span></td>\n                <td>4.3%</td>\n                <td>2.8%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\"><strong>Friend Connections</strong></td>\n                <td>2020</td>\n                <td>73.4%</td>\n                <td>22.2%</td>\n                <td>11.4%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>62.9%</td>\n                <td>26.5%</td>\n                <td>10.6%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color\"><strong>10.5%</strong></span></td>\n                <td>-4.3%</td>\n                <td>0.8%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Private Messaging</td>\n                <td>2020</td>\n                <td>55.1%</td>\n                <td>22.9%</td>\n                <td>8.6%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>67.6%</td>\n                <td>25.4%</td>\n                <td>7.0%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-12.5%</strong></span></td>\n                <td>-2.5%</td>\n                <td>1.7%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Site Tracking</td>\n                <td>2020</td>\n                <td>37.6%</td>\n                <td>24.8%</td>\n                <td>20.1%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>56.3%</td>\n                <td>25.4%</td>\n                <td>18.3%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-18.7%</strong></span></td>\n                <td>-0.6%</td>\n                <td>1.8%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">User Groups</td>\n                <td>2020</td>\n                <td>55.4%</td>\n                <td>23.8%</td>\n                <td>8.9%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>64.1%</td>\n                <td>26.0%</td>\n                <td>10.0%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-8.7%</strong></span></td>\n                <td>-2.1%</td>\n                <td>-1.1%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p>I must say I was a bit surprised by the fact the Friends component was the only one which usage increased between 2018 and 2020 <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f633.png\" alt=\"\" class=\"wp-smiley\" />.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-6\"><em>6. What theme/s have you activated for your site/s using BuddyPress?</em></h2>\n\n\n\n<p>Number of respondents: <strong>398</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Years &amp; evolution</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td rowspan=\"3\"><strong>Free WP theme</strong></td>\n                <td>2020</td>\n                <td>37.7%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>22.5%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color\"><strong>15.2%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Free WP theme with custom BP CSS and/or template modifications</td>\n                <td>2020</td>\n                <td>18.8%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>14.1%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>4.8%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Free WP theme and I add custom BP CSS and/or template modifications</td>\n                <td>2020</td>\n                <td>22.9%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>14.1%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>8.8%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Commercial WP theme</td>\n                <td>2020</td>\n                <td>35.9%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>32.2%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>3.7%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Commercial WP theme with custom BP CSS and/or template modifications</td>\n                <td>2020</td>\n                <td>32.2%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>38.6%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-6.4%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">I create a brand-new WP theme and write my own custom BP CSS and template modifications using BP theme compat</td>\n                <td>2020</td>\n                <td>22.1%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>19.8%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>2.3%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p>Free WordPress themes without any customizations got the highest result: this proves using BuddyPress out of the box can be enough to power a great looking community site.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-7\"><em>7. Which BuddyPress Template Pack is your theme supporting in your production sites?</em></h2>\n\n\n\n<p>Number of respondents: <strong>384</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Year</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td><strong>BP Nouveau Templates (introduced in BP 3.0.0)</strong></td>\n                <td>2020</td>\n                <td><span class=\"has-inline-color\"><strong>63.3%</strong></span></td>\n            </tr>\n            <tr>\n                <td>BP Legacy Templates (introduced in BP 1.7.0)</td>\n                <td>2020</td>\n                <td>28.1%</td>\n            </tr>\n            <tr>\n                <td>BP Standalone theme like the bp-default theme (introduced in BP 1.2.0)</td>\n                <td>2020</td>\n                <td>13.5%</td>\n            </tr>\n            <tr>\n                <td>I dont know</td>\n                <td>2020</td>\n                <td>25.8%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p><strong>NB</strong>: this question wasn&#8217;t asked in 2018</p>\n\n\n\n<p>1 respondent out of 4 don&#8217;t know what Template Pack is active on their website. As the BP Nouveau Template pack is used by default, there&#8217;s a good chance it&#8217;s the one these people are using. FYI: If you want to switch between available Template Packs, you can go into your WordPress Dashboard and activate the BuddyPress Options tab of the Settings &gt; BuddyPress administration page to do so.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-8\"><em>8. Which BuddyPress template files do you customize for your own or third-party themes?</em></h2>\n\n\n\n<p>Number of respondents: <strong>377</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Year</th>\n                <th>Never</th>\n                <th>Sometimes</th>\n                <th>Everytime</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td>Activity templates</td>\n                <td>2020</td>\n                <td>36.6%</td>\n                <td>31.6%</td>\n                <td>22.5%</td>\n            </tr>\n            <tr>\n                <td>Blogs templates</td>\n                <td>2020</td>\n                <td>38.5%</td>\n                <td>29.7%</td>\n                <td>19.6%</td>\n            </tr>\n            <tr>\n                <td>Group templates</td>\n                <td>2020</td>\n                <td>32.9%</td>\n                <td>31.0%</td>\n                <td>21.8%</td>\n            </tr>\n            <tr>\n                <td><strong>Member templates</strong></td>\n                <td>2020</td>\n                <td>26.8%</td>\n                <td>31.0%</td>\n                <td><span class=\"has-inline-color\"><strong>30.0%</strong></span></td>\n            </tr>\n            <tr>\n                <td><strong>Stylesheet files</strong></td>\n                <td>2020</td>\n                <td>29.4%</td>\n                <td>26.0%</td>\n                <td><span class=\"has-inline-color\"><strong>29.4%</strong></span></td>\n            </tr>\n            <tr>\n                <td>JavaScript files</td>\n                <td>2020</td>\n                <td>39.5%</td>\n                <td>28.4%</td>\n                <td>15.4%</td>\n            </tr>\n            <tr>\n                <td>BuddyPress Email templates</td>\n                <td>2020</td>\n                <td>32.6%</td>\n                <td>30.0%</td>\n                <td>25.2%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p><strong>NB</strong>: this question wasn&#8217;t asked in 2018.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-9\"><em>9. What do you prefer: using a BP Template Pack that lets you use most WordPress themes or use a BuddyPress specific theme ?</em></h2>\n\n\n\n<p>Number of respondents: <strong>375</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Year</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td><strong>BP Template Pack</strong></td>\n                <td>2020</td>\n                <td><span class=\"has-inline-color\"><strong>58.1%</strong></span></td>\n            </tr>\n            <tr>\n                <td>BuddyPress specific theme</td>\n                <td>2020</td>\n                <td>41.9%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p><strong>NB</strong>: this question wasn&#8217;t asked in 2018.</p>\n\n\n\n<p>Building a great BuddyPress theme as a replacement to our good old BP Default theme is something we are considering a lot. It&#8217;s important for us to remember that a lot of you like the fact BuddyPress doesn&#8217;t require a specific theme to run and needs to look as nice as possible inside your active WordPress theme.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-10\"><em><em>10. Would you test/use a new theme made by the BuddyPress team?</em></em></h2>\n\n\n\n<p>Number of respondents: <strong>377</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Year</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td><strong>Yes</strong></td>\n                <td>2020</td>\n                <td><span class=\"has-inline-color\"><strong>57.2%</strong></span></td>\n            </tr>\n            <tr>\n                <td>No</td>\n                <td>2020</td>\n                <td>11.4%</td>\n            </tr>\n            <tr>\n                <td>Maybe</td>\n                <td>2020</td>\n                <td>31.4%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p><strong>NB</strong>: this question wasn&#8217;t asked in 2018</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-11\"><em><em><em>11. What features would you look for in a new BuddyPress theme?</em></em></em></h2>\n\n\n\n<p>Number of respondents: <strong>380</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Year</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td><strong>More BuddyPress customization options</strong></td>\n                <td>2020</td>\n                <td><span class=\"has-inline-color\"><strong>85.5%</strong></span></td>\n            </tr>\n            <tr>\n                <td>Compatible with bbPress</td>\n                <td>2020</td>\n                <td>51.1%</td>\n            </tr>\n            <tr>\n                <td>Compatible with WooCommerce</td>\n                <td>2020</td>\n                <td>44.7%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p><strong>NB</strong>: this question wasn&#8217;t asked in 2018</p>\n\n\n\n<p>Got it! FYI: BP Nouveau has a specific panel into your customizer you should check. One of the comments you made was asking for a way to reorder the Member navigation, BP Nouveau has a section for it <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f448.png\" alt=\"\" class=\"wp-smiley\" />.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-12\"><em><em><em>12. When do you test your sites, themes, and/or plugins with BuddyPress releases?</em></em></em></h2>\n\n\n\n<p>Number of respondents: <strong>396</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Years &amp; evolution</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td rowspan=\"3\">Trunk</td>\n                <td>2020</td>\n                <td>15.9%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>11.7%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>4.2%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\"><strong>BP Beta 1</strong></td>\n                <td>2020</td>\n                <td>14.9%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>10.0%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color\"><strong>4,9%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\"><strong>BP Release Candidate 1</strong></td>\n                <td>2020</td>\n                <td>11.4%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>7.5%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color\"><strong>3.9%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">BP Stable Release</td>\n                <td>2020</td>\n                <td>43.2%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>55.9%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>-12.7%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\"><strong>A month after stable release</strong></td>\n                <td>2020</td>\n                <td>29.0%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>19.6%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>9.5%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Never</td>\n                <td>2020</td>\n                <td>19.2%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>15.0%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>4.2%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Other</td>\n                <td>2020</td>\n                <td>8.1%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>4.3%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>3.8%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p>The results the Beta and RC pre-release got is encouraging. We really need to have more beta-testers to avoid bad surprises when you upgrade BuddyPress. We&#8217;ve tried to ease the way you can test BuddyPress with the BP Beta Tester plugin, but I guess we still need to work on ways to help you help us <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f469-1f3fb-200d-1f4bb.png\" alt=\"\" class=\"wp-smiley\" />.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-13\"><em><em><em>13. If you do beta test BuddyPress, what method do you use?</em></em></em></h2>\n\n\n\n<p>Number of respondents: <strong>236</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Year</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td>I use the SVN repo \n(<code>svn co https://buddypress.svn.wordpress.org/trunk/</code>)</td>\n                <td>2020</td>\n                <td>31.8%</td>\n            </tr>\n            <tr>\n                <td>I use the read-only Github mirror\n(<code>git clone git://buddypress.git.wordpress.org/</code>)</td>\n                <td>2020</td>\n                <td>46.2%</td>\n            </tr>\n            <tr>\n                <td><strong>I use the <a href=\"https://wordpress.org/plugins/bp-beta-tester/\">BP Beta Tester plugin</a></strong></td>\n                <td>2020</td>\n                <td><span class=\"has-inline-color\"><strong>51.3%</strong></span></td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p><strong>NB</strong>: this question wasn&#8217;t asked in 2018</p>\n\n\n\n<p>Looks like the BP Beta Tester plugin is the most used tool to beta test BuddyPress. This seems great! But the results might be a bit over rated. When looking deeply into it, some of you replied they were <strong>never</strong> beta-testing BuddyPress while using the BP Beta Tester plugin <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f928.png\" alt=\"\" class=\"wp-smiley\" />. The goal of the BP Beta Tester plugin is to ease the beta/RC testing&#8230;</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-14\"><em><em><em>14. If you installed bbPress, how did you set it up with your BuddyPress site/s?</em></em></em></h2>\n\n\n\n<p>Number of respondents: <strong>311</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Years &amp; evolution</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td rowspan=\"3\">Sitewide forums only</td>\n                <td>2020</td>\n                <td>34.7%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>28.3%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color\"><strong>6.4%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Group forums only</td>\n                <td>2020</td>\n                <td>29.3%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>29.3%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>0%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\"><strong>Sitewide and Group forums</strong></td>\n                <td>2020</td>\n                <td>55.0%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>57.6%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-2.6%</strong></span></td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-15\"><em><em><em>15. How do you keep updated with the latest in BuddyPress development?</em></em></em></h2>\n\n\n\n<p>Number of respondents: <strong>355</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Years &amp; evolution</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td rowspan=\"3\"><strong>Subscribed to <a href=\"https://bpdevel.wordpress.com\">bpdevel.wordpress.com</a></strong></td>\n                <td>2020</td>\n                <td>27.6%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>23.3%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color\"><strong>4.3%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\"><strong>Viewed changelog for each release in <a href=\"https://codex.buddypress.org/releases/\">codex.buddypress.org/releases</a></strong></td>\n                <td>2020</td>\n                <td>47.0%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>49.6%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td><span class=\"has-inline-color has-luminous-vivid-orange-color\"><strong>-2.6%</strong></span></td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Checking <a href=\"https://buddypress.trac.wordpress.org\">buddypress.trac.wordpress.org</a> regularly</td>\n                <td>2020</td>\n                <td>25.6%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>22.5%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>3.1%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Twitter: <a href=\"https://twitter.com/buddypress\">@buddypress</a>, <a href=\"https://twitter.com/buddypressdev\">@buddypressdev</a>, and/or <a href=\"https://twitter.com/bptrac\">@bptrac</a></td>\n                <td>2020</td>\n                <td>23.1%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>19.5%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>3.6%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Slack: <a href=\"https://wordpress.slack.com/messages/buddypress\">#buddypress</a>, <a href=\"https://wordpress.slack.com/messages/buddypress-commits\">#buddypress-commits</a>, <a href=\"https://wordpress.slack.com/messages/buddypress-firehose\">#buddypress-firehose</a> and/or <a href=\"https://wordpress.slack.com/messages/buddypress-newtickets\">#buddypress-newtickets</a></td>\n                <td>2020</td>\n                <td>15.5%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>12.2%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>3.3%</td>\n            </tr>\n            <tr>\n                <td rowspan=\"3\">Other</td>\n                <td>2020</td>\n                <td>16.1%</td>\n            </tr>\n            <tr>\n                <td>2018</td>\n                <td>11.8%</td>\n            </tr>\n            <tr>\n                <td>2018 to 2020</td>\n                <td>4.2%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p><strong>NB</strong>: between 2018 &amp; 2020 the &#8220;Checking buddypress.org/support regularly.&#8221; choice disappeared.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-16\"><em><em><em>16. Case Studies: We&#8217;d like to feature how you are using BuddyPress in your current sites at BuddyPress.org. If youre interested in sharing your BP story, please leave your name, email address, and your BP site URL.</em></em></em></h2>\n\n\n\n<p>Number of respondents: <strong>40</strong>.</p>\n\n\n\n<p>Many thanks to the 40 participants who shared their names, emails, and sites URL. We&#8217;ll try to contact you to share about your use cases on this website. It&#8217;s great to see how you&#8217;re using BuddyPress <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f4aa.png\" alt=\"\" class=\"wp-smiley\" />.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"q-17\"><em><em><em>17. BuddyPress is a large plugin with optional components (3MB zipped). There&#8217;s a proposal to reconstitute BuddyPress as core + members only and improved upon with new functionalities and API&#8217;s among others for new BP plugins to hook into. The current optional components like groups, friends, private messaging, etc. can be migrated into separate plugins which can be activated as needed. What do you think?</em></em></em></h2>\n\n\n\n<p>Number of respondents: <strong>407</strong>.</p>\n\n\n\n\n    <table class=\"has-fixed-layout\">\n        <thead>\n            <tr>\n                <th>Possible replies</th>\n                <th>Year</th>\n                <th>Results</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td><strong>Keep BuddyPress as is: core + members and optional components</strong></td>\n                <td>2020</td>\n                <td><span class=\"has-inline-color\"><strong>43.2%</strong></span></td>\n            </tr>\n            <tr>\n                <td>Break down BuddyPress: BuddyPress = core + members, optional components as BP plugins</td>\n                <td>2020</td>\n                <td>35.6%</td>\n            </tr>\n            <tr>\n                <td>I don&#8217;t know</td>\n                <td>2020</td>\n                <td>21.1%</td>\n            </tr>\n        </tbody>\n    </table>\n\n\n\n\n<p><strong>NB</strong>: this question wasn&#8217;t asked in 2018</p>\n\n\n\n<p>Ok. Thanks a lot for your replies, using optional components as separate add-ons is not something you are ready for <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f607.png\" alt=\"\" class=\"wp-smiley\" />.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"survey-map\">BuddyPress is used from all over the world!</h2>\n\n\n\n<div class=\"wp-block-image\"><a href=\"https://docs.google.com/spreadsheets/d/e/2PACX-1vT067Mc1bnQPTdiwZzzZj7Kn1Y2V22aJxJnvy13rN2DXg27awoA_GXPJvX0uv2He8udDL_bLjCeUv7M/pubhtml?gid=1888221811&single=true\"><img width=\"1024\" height=\"639\" src=\"https://buddypress.org/wp-content/uploads/1/2020/12/survey-participants-1024x639.png\" alt=\"\" class=\"wp-image-316008\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 08 Dec 2020 16:45:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mathieu Viet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: Easy WP SMTP 1.4.3 Patches Sensitive Data Disclosure Vulnerability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108630\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:197:\"https://wptavern.com/easy-wp-smtp-1-4-3-patches-sensitive-data-disclosure-vulnerability?utm_source=rss&utm_medium=rss&utm_campaign=easy-wp-smtp-1-4-3-patches-sensitive-data-disclosure-vulnerability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3019:\"<p><a href=\"https://wordpress.org/plugins/easy-wp-smtp/\">Easy WP SMTP</a> has patched a vulnerability that allows attackers to capture the password reset link from the plugin&rsquo;s debug log file and gain unauthorized access to the site. The plugin is used by more than 500,000 WordPress sites to configure and send all outgoing emails via a SMTP server so they are less likely to end up in recipients&rsquo; junk/spam folders. </p>\n\n\n\n<p><a href=\"https://wpscan.com/vulnerability/10494\">WPScan</a> categorized the vulnerability as a &ldquo;sensitive data disclosure:&rdquo;</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>The plugin has an optional debug log file generated with a random name, located in the plugin folder and which contains all email messages sent. However, this folder does not have any index page, allowing access to log file on servers with the directory listing enabled or misconfigured. This could allow attackers to gain unauthorised access to the blog by reseting the admin password by getting the reset link from the log.</p></blockquote>\n\n\n\n<p>Easy WP SMTP version  1.4.3 contains the fix, adding an empty &ldquo;index.html&rdquo; file to the plugin&rsquo;s folder to prevent anyone from browsing the files (even if the Option -Indexes is missing on that server). Users are advised to update immediately, as the vulnerability has already been exploited in the wild. Several users took to the plugin&rsquo;s support forums to <a href=\"https://wordpress.org/support/topic/security-issue-with-debug-log/\">report</a> attempts on their sites.</p>\n\n\n\n<p>Jerome Bruandet, a security researcher from NinTechNet, reported the vulnerability and published a <a href=\"https://blog.nintechnet.com/wordpress-easy-wp-smtp-plugin-fixed-zero-day-vulnerability/\">post</a> explaining how an attacker might access the debug log where the plugin writes all the email messages sent by the site. Using author archive scans, the hacker can find a username and then send a password reset email that gets intercepted via the Easy WP SMTP debug log file:</p>\n\n\n\n<div class=\"wp-block-image\"><img />Easy WP SMTP log file &ndash; source: <a href=\"https://blog.nintechnet.com/wordpress-easy-wp-smtp-plugin-fixed-zero-day-vulnerability/\">NinTechNet</a></div>\n\n\n\n<p>At the time of publishing, approximately 51.8% of users are on 1.4.x versions of the plugin. Without a more specific breakdown, it&rsquo;s not clear how many users have updated to the patched 1.4.3 version. Approximately <a href=\"https://wordpress.org/plugins/easy-wp-smtp/advanced/\">59,000 sites</a> have downloaded the plugin today, leaving many installations still vulnerable.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>This is another case where automatic background updates on plugins can quietly save the day. Users who have auto-updates enabled for plugins have already received the fix. Administrators for older installations of WordPress or sites where auto-updates have been disabled will need to update manually as soon as possible.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 07 Dec 2020 20:56:37 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"WordPress.org blog: State of the Word 2020\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9296\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wordpress.org/news/2020/12/state-of-the-word-2020/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3070:\"<p>State of the Word is an annual keynote address delivered by the project co-founder, Matt Mullenweg. This year&#8217;s keynote will be streamed on <a href=\"https://www.facebook.com/WordPress/\">Facebook</a>, <a href=\"https://www.youtube.com/wordpress\">YouTube</a>, and <a href=\"https://twitter.com/wordpress\">Twitter</a> on <a href=\"https://www.timeanddate.com/countdown/generic?iso=20201217T08&p0=224&msg=State+of+the+Word+2020&font=slab&csz=1\">Thursday, Dec 17th, 2020&nbsp; at 1600 UTC</a>.</p>\n\n\n\n<img width=\"632\" height=\"355\" src=\"https://i2.wp.com/wordpress.org/news/files/2020/12/State-of-the-Word-cover.png?resize=632%2C355&ssl=1\" alt=\"\" class=\"wp-image-9316\" />\n\n\n\n<h3>Have a question?</h3>\n\n\n\n<p>A Question and Answer period with pre-recorded videos will follow State of the Word. To take part, record a video of you asking your question to Matt on your computer or phone (landscape format, please). Don&#8217;t forget to include your name and how you use WordPress! Try to keep your video to under a minute so Matt can answer as many questions as possible.</p>\n\n\n\n<p>To submit your question, upload it as an unlisted video (<a href=\"https://support.google.com/youtube/answer/157177\">YouTube works great for this</a>) and send a link to <a href=\"mailto:ask-matt@wordcamp.org\">ask-matt@wordcamp.org</a>. <strong>Deadline is Friday, Dec 11th, 2020!</strong></p>\n\n\n\n<h3>New to State of the Word?</h3>\n\n\n\n<p>If this is your first time hearing of this talk, youre in luck! Check out previous recordings below.</p>\n\n\n\n<ul><li><a href=\"https://wordpress.tv/2019/11/03/2019-state-of-the-word/\">State of the Word 2019 &#8211; WordCamp US, St. Louis</a></li><li><a href=\"https://wordpress.tv/2018/12/27/state-of-the-word-2018/\">State of the Word 2018 &#8211; WordCamp US, Nashville</a></li><li><a href=\"https://wordpress.tv/tag/state-of-the-word/\">All recordings</a></li></ul>\n\n\n\n<h3>Sign up here to receive an email reminder, so you dont miss the State of the Word broadcast!</h3>\n\n\n\n	<div class=\"wp-block-jetpack-mailchimp\">\n		<div class=\"components-placeholder\">\n			<form>\n				<p>\n					<input title=\"Enter your email\" type=\"email\" name=\"email\" />\n				</p>\n												\n<div class=\"wp-block-jetpack-button\"><button class=\"wp-block-button__link\" id=\"mailchimp-button-block-1\" type=\"submit\">Join the email list</button></div>\n				<p id=\"wp-block-jetpack-mailchimp_consent-text\">\n					<em><em>Youll only receive State of the Word updates, and this list (and your information) will be deleted thereafter.</em></em>				</p>\n\n				\n			</form>\n			\n				<div class=\"wp-block-jetpack-mailchimp_notification wp-block-jetpack-mailchimp_processing\">\n					Processing				</div>\n				<div class=\"wp-block-jetpack-mailchimp_notification wp-block-jetpack-mailchimp_success\">\n					Success! You&#039;re on the list.				</div>\n				<div class=\"wp-block-jetpack-mailchimp_notification wp-block-jetpack-mailchimp_error\">\n					Whoops! There was an error and we couldn&#039;t process your subscription. Please reload the page and try again.				</div>\n\n					</div>\n	</div>\n	\n\n\n<p></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 04 Dec 2020 22:55:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Josepha\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"BuddyPress: BuddyPress 7.0.0 Release Candidate 2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=315858\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"https://buddypress.org/2020/12/buddypress-7-0-0-rc2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3608:\"<p>Hello,</p>\n\n\n\n<p>The second<a href=\"https://downloads.wordpress.org/plugin/buddypress.7.0.0-RC2.zip\">release candidate for BuddyPress 7.0.0</a>is now ready for an ultimate round of testing <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f642.png\" alt=\"\" class=\"wp-smiley\" /></p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2>What happened Since the&nbsp;<a href=\"https://buddypress.org/2020/11/buddypress-7-0-0-release-candidate/\">first release candidate</a>?</h2>\n\n\n\n<p>We&#8217;ve been working on getting the BP Nouveau Template Pack looks great into the next WordPress default theme &#8220;<a href=\"https://make.wordpress.org/core/2020/09/23/introducing-twenty-twenty-one/\">Twenty Twenty-One</a>&#8220;. We believe BP Nouveau is now ready to enjoy this awesome theme whether you use its regular or dark mode.</p>\n\n\n\n<div class=\"wp-block-image\"><a href=\"https://buddypress.org/wp-content/uploads/1/2020/12/bp-nouveau-2021.png\"><img width=\"1000\" height=\"479\" src=\"https://buddypress.org/wp-content/uploads/1/2020/12/bp-nouveau-2021.png\" alt=\"\" class=\"wp-image-315860\" /></a><em>Screen capture of the Members directory</em> (dark mode)</div>\n\n\n\n<p>BuddPress 7.0.0 is&nbsp;still slated for release&nbsp;on&nbsp;<strong>Wednesday, December 9</strong>, and if you havent tried 7.0.0 yet,&nbsp;<strong>its probably your last chance to do so!</strong></p>\n\n\n\n<p>Let&#8217;s test <a href=\"https://downloads.wordpress.org/plugin/buddypress.7.0.0-RC2.zip\">BuddyPress 7.0.0-RC2</a> with <a href=\"https://make.wordpress.org/core/2020/12/03/wordpress-5-6-rc-3/\">WordPress 5.6-RC3</a> to be sure both will be great as soon as they will be released! It&#8217;s also important to do so if you want to help us check BP Nouveau&#8217;s integration with Twenty Twenty-One is as nice as we think <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f609.png\" alt=\"\" class=\"wp-smiley\" /></p>\n\n\n\n<p>You can test the<a href=\"https://downloads.wordpress.org/plugin/buddypress.7.0.0-RC2.zip\">7.0.0-RC2</a>pre-release in 4 ways :</p>\n\n\n\n<ul><li>Try the<a href=\"https://wordpress.org/plugins/bp-beta-tester/\">BP Beta Tester</a>plugin.</li><li><a href=\"https://downloads.wordpress.org/plugin/buddypress.7.0.0-RC2.zip\">Download the release candidate here (zip file)</a>.</li><li>Check out our SVN repository:<code>svn co https://buddypress.svn.wordpress.org/trunk/</code></li><li>Clone our read-only Git repository:<code>git clone git://buddypress.git.wordpress.org/</code></li></ul>\n\n\n\n<p>A detailed changelog will be part of our official release note, but&nbsp;you can get a quick overview by reading the post about the&nbsp;<a href=\"https://buddypress.org/2020/10/buddypress-7-0-0-beta1/\">7.0.0 Beta1</a>&nbsp;release.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2>Polyglots contributors, let&#8217;s target 100% of translated strings.</h2>\n\n\n\n<p>Since previous release candidate we&#8217;ve reached the&nbsp;<a href=\"https://make.wordpress.org/polyglots/handbook/glossary/#string-freeze\">string freeze</a>&nbsp;point of the 7.0.0 release schedule, so this one (RC2) does not introduce new strings to translate. Let&#8217;s use the days we have left to try to make BuddyPress fully available into your locale as soon as it is released. Thanks in advance for your help.</p>\n\n\n\n<p>As usual,<strong>if you think youve found a bug</strong>, please let us know reporting it on<a href=\"https://buddypress.org/support/topic/buddypress-7-0-0-release-candidate-2/\">this support topic</a>and/oron<a href=\"https://buddypress.trac.wordpress.org/\">our development tracker</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 04 Dec 2020 22:22:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mathieu Viet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:116:\"WPTavern: State of CSS 2020 Survey Results: Tailwind CSS Wins Most Adopted Technology, Utility-First CSS on the Rise\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108561\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:273:\"https://wptavern.com/state-of-css-2020-survey-results-tailwind-css-wins-most-adopted-technology-utility-first-css-on-the-rise?utm_source=rss&utm_medium=rss&utm_campaign=state-of-css-2020-survey-results-tailwind-css-wins-most-adopted-technology-utility-first-css-on-the-rise\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3346:\"<p>The <a href=\"https://2020.stateofcss.com/en-US/\">State of CSS 2020</a> survey results have just been published, with a summary of the tools, methodologies, frameworks, and libraries that are currently favored by CSS professionals. It includes data from 11,492 respondents in 102 countries, after the questions were translated for the first time into a dozen different languages.</p>\n\n\n\n<p>In the layout category, CSS Grid logged a 34% increase over the prior year in respondents who report having used it to position elements on the screen. It won an award for &ldquo;Most Adopted Feature,&rdquo; which is assigned to the feature with the largest year-over-year &rdquo;have used&rdquo; progression. Only 6% of respondents said they have used Subgrid, which is included in Level 2 of the CSS Grid Layout specification. </p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>CSS Flexible Box Layout has been used by 97.5% of respondents, a ~3% increase over the previous year. Multi-column Layout saw a moderate increase in usage and a small decrease in awareness. CSS Grid experienced the most growth by far in this category.</p>\n\n\n\n<p>The technologies section is one of the most interesting parts of the survey, as the CSS ecosystem is constantly changing. The results include a scatter plot graph showing the relationship between each technology&rsquo;s satisfaction ratio and its user count. Technologies in the &ldquo;avoid&rdquo; and &ldquo;analyze&rdquo; groupings are likely to decline in usage soon (or have already fallen out of favor). </p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Tailwind CSS is once again the front-runner among CSS frameworks, followed by Bulma, which seems to be slowly waning in popularity. Tailwind CSS won the award for &ldquo;Most Adopted Technology,&rdquo; given to the technology with the largest year-over-year &ldquo;would use again&rdquo; progression, with a +17.8% progression over 2019. PureCSS, Ant Design, and Materialize CSS also recorded gains in their rankings from the previous year. </p>\n\n\n\n<p>A larger trend emerging is utility-first CSS frameworks and tools gaining momentum among professionals. The utility-first approach, which eschews traditional semantic class naming in favor of more functional class names, <a href=\"http://www.zeldman.com/2017/01/03/kiss-my-classname/\">has its ardent critics</a>.  It is somewhat of an eyesore reminiscent of inline styles, and essentially drops the &ldquo;cascading&rdquo; aspect of CSS. Nevertheless, its proponents appreciate being able to look at the HTML and see at a glance which styles are applied, as well as the enforced consistency it offers.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>If you are interested in some of the finer details on which properties and positioning features professionals are using, shapes, graphics, and interactions, check out the <a href=\"https://2020.stateofcss.com/en-US/\">full report</a>. Each section has recommended resources for learning more about popular and emerging technologies and techniques, including industry podcasts and blogs that professionals are currently enjoying.</p>\n\n\n\n<p>The <a href=\"https://stateofjs.com/\">State of JavaScript</a> survey is also now open, which offers a similar treasure trove of data on the JavaScript ecosystem once the results are published. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 04 Dec 2020 21:30:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"WPTavern: WordPress Community Team Discusses Return to In-Person Events\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108398\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:187:\"https://wptavern.com/wordpress-community-team-discusses-return-to-in-person-events?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-community-team-discusses-return-to-in-person-events\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6803:\"<p>Although the promise of effective COVID-19 vaccines is shining a light at the end of a long tunnel, the world remains firmly in the virus&rsquo; grip until distribution can ramp up to cover at-risk groups as well as the general populace.</p>\n\n\n\n<p>As pandemic-weary communities muster the discipline to ride out the next few months under continued restrictions, a new discussion popped up on WordPress.org regarding the <a href=\"https://make.wordpress.org/community/2020/12/01/discussion-how-can-the-wordpress-community-return-to-hosting-safe-in-person-events/\">return to in-person events</a>. WordPress has canceled all in-person events through the end of the year and 2021 flagship events have already been designated as online-only. Community organizer Angela Jin cited recent successful vaccine trials as a prompt for discussing how WordPress can safely resume in-person events: </p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>There has been promising news around some successful trials for vaccines recently! As such, it seems worthwhile to discuss how the WordPress community can return to hosting safe, in-person events.&nbsp;</p><p>Any in-person event would certainly be subject to local laws and any restrictions on gatherings, as they&rsquo;ve always been. Beyond what local health authorities require, the Global Community Team may need to to help organizers identify what additional precautions are necessary to ensure in-person events are safe for participants.&nbsp;</p></blockquote>\n\n\n\n<p>Jin offered several examples of &ldquo;additional precautions&rdquo; to ensure events are safe, such as mandatory masks, social distancing, outdoor events, limits on the number of attendees, and no food or drink service. </p>\n\n\n\n<p>Although countries like Australia, Taiwan, and New Zealand, seem to have adequately contained the virus, the U.S., Europe, India, and Russia have cases spiraling out of control. The discussion seems oddly timed, as this week the U.S., which is leading the world in deaths, has seen daily deaths climb to <a href=\"https://www.npr.org/sections/coronavirus-live-updates/2020/12/02/941902471/u-s-hits-100-000-covid-19-hospitalizations-breaks-daily-death-record\">2,804</a>, surpassing the previous record of 2,607 reported on April 15, during the first wave of the pandemic.</p>\n\n\n\n<p>Several of those commenting mentioned that the discussion opener neglects a critical detail about whether or not in-person events would resume before vaccines are widely distributed.</p>\n\n\n\n<p>&ldquo;I&rsquo;m surprised I don&rsquo;t see mention of the vaccine being a requirement,&rdquo; Mika Epstein said. &ldquo;I could assume so, but the risk of COVID is human life.</p>\n\n\n\n<p>&ldquo;That means that unless WordPress (or any public event) has a way to ensure that no one will contract (and die) of COVID, then they have no business having any event, indoor or outdoor.</p>\n\n\n\n<p>&ldquo;Not every country is handling things equally well, and just in the US alone, there are many places where the law says &lsquo;do not have events&rsquo; but the local authorities refuse to intercede, which resulted in 80% of the people attending an outdoor party not too far from me all testing positive.&rdquo; </p>\n\n\n\n<p>WordPress is a global community and reliance on local laws may still put event attendees at risk in communities that have been subject to a failure of leadership in protecting citizens.</p>\n\n\n\n<p>Cami Kaos, an eight-year WordPress community organizer, echoed these thoughts, saying, &ldquo;The one thing we need to have in place in order to make a safe re-entry into in person events is to have wide spread access to an effective vaccine.&rdquo; She commented on the difficulties of trying to ensure attendees don&rsquo;t inadvertently put each other at risk:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>It&rsquo;s all well and good for us to say you can only organize within the recommendations of your local community, but we have no way of knowing how responsible individuals are being. Of knowing if they have come in from out of town for the event. If a member of their household is a frontline worker who might be exposed daily, if someone in their family is high risk and we could be endangering a life.</p></blockquote>\n\n\n\n<p>Without widely distributed vaccines, hosting in-person gatherings with the possibility of attendees traveling from hotspot locations would be unconscionable.</p>\n\n\n\n<p>Kaos also commented on how difficult enforcement would be for WordPress community volunteers who would be tasked with making sure individuals wear masks properly, use hand sanitizer, maintain distance, and uphold any other requirements. </p>\n\n\n\n<p>&ldquo;All of this would be putting unpaid and uncompensated volunteers at risk unnecessarily,&rdquo; Kaos said.</p>\n\n\n\n<p>&ldquo;If people would like to make the choice to see their friends and collaborators in person, that can be their choice. But I don&rsquo;t feel morally comfortable legally and finically supporting in-person gatherings when I think we could prevent even one death by extending our pause on in-person events to wait for a vaccine to be readily available.&rdquo;</p>\n\n\n\n<p>Other commenters discussed how to manage the logistics of sponsoring masks and sanitizer for organizers by coordinating with local venues and figuring out a way around slow international shipments.  </p>\n\n\n\n<p>&ldquo;This actually opens totally new ways to organize WordPress events!&rdquo; WordCamp organizer Timi Wahalahti said. &ldquo;Why not have a bicycle trip or something similar with your WordPress friends?&rdquo;</p>\n\n\n\n<p>Live event recordings are another consideration for hosting events in a way that is accessible to more vulnerable populations. According to WordPress community organizer Andrea Middleton, professional video recording has historically been cost prohibitive at scale.</p>\n\n\n\n<p>&ldquo;A year ago focusing on recordings may have sounded in some ways counterproductive to growing in-person events,&rdquo; WordPress core contributor David Ryan said. &ldquo;But I think today they provide a short-term fix to the head count crunch, can help bring/keep folx in-the-fold while making in-person attendance even safer, all while adding long-term value even when travel and gatherings normalize.&rdquo;</p>\n\n\n\n<p>The discussion on finding a safe path forward for restarting in-person events will be open until December 16, 2020. Organizers and community members can <a href=\"https://make.wordpress.org/community/2020/12/01/discussion-how-can-the-wordpress-community-return-to-hosting-safe-in-person-events/\">comment on the post</a> for consideration. Angela Jin said the Community Team will continue to support online events in 2021 and beyond, regardless of any decisions resulting from the discussion.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 03 Dec 2020 22:10:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"WPTavern: Gutenberg 9.5 Improves Site Editor and Adds New Options for Cover and Code Blocks\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108450\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:227:\"https://wptavern.com/gutenberg-9-5-improves-site-editor-and-adds-new-options-for-cover-and-code-blocks?utm_source=rss&utm_medium=rss&utm_campaign=gutenberg-9-5-improves-site-editor-and-adds-new-options-for-cover-and-code-blocks\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4774:\"<p class=\"has-drop-cap\">Gutenberg 9.5 <a href=\"https://make.wordpress.org/core/2020/12/02/whats-new-in-gutenberg-2-december/\">went live today</a>. The development team is continuing forward with work that we will start seeing down the road in WordPress 5.7 and beyond. The big user-facing highlights for this release were the additions of a full-height alignment option for the Cover block, font-size support in the Code block, and improved previews for block patterns.</p>\n\n\n\n<p>The majority of users will not see most of the work that went into the 9.5 release. The team addressed dozens of bugs and enhancements for the full-site editing feature. To test them, users must be using a block-based WordPress theme, such as <a href=\"https://wptavern.com/twenty-twenty-one-blocks-theme-launching-as-a-separate-project\">Twenty Twenty-One Blocks</a>, <a href=\"https://wptavern.com/q-first-fse-wordpress-theme-now-live\">Q</a>, or <a href=\"https://wptavern.com/block-based-bosco-second-full-site-editing-theme-lands-in-the-wordpress-directory\">Block-Based Bosco</a>.</p>\n\n\n\n<p>We are a long way from seeing a production-ready site editor, but it is nice to see the improvements with each major Gutenberg release, such as the ability to <a href=\"https://github.com/WordPress/gutenberg/pull/27224\">set a post&rsquo;s featured image</a> if it doesn&rsquo;t exist. The new description, status, and theme <a href=\"https://github.com/WordPress/gutenberg/pull/27156\">admin columns for templates and template parts</a> add useful information. And, the developer side of me is happy to see a new <code>wp_theme</code> <a href=\"https://github.com/WordPress/gutenberg/pull/27016\">taxonomy for grouping templates</a> under the hood rather than metadata.</p>\n\n\n\n<p>The development team has made progress on the Query block. It is probably the most important piece of the full-site editing puzzle, and its current state is still holding back movement on block-based themes. The block now sports a new <a href=\"https://github.com/WordPress/gutenberg/pull/27067\">&ldquo;grid view&rdquo; option</a>. There is also a <a href=\"https://github.com/WordPress/gutenberg/pull/26990\">Posts List variation</a> that sets up a default of listing blog posts and excluding sticky posts. This block variation is a step toward pushing third-party plugin developers into creating custom variations for their post types in the future, building from the example set by WordPress.</p>\n\n\n\n<h2>Full-Screen Cover Block</h2>\n\n\n\n<img />Setting the Cover block to full height.\n\n\n\n<p class=\"has-drop-cap\">The Gutenberg team added a new <a href=\"https://github.com/WordPress/gutenberg/pull/26615\">Full Height Alignment</a> toolbar option to the Cover block. This is an independent alignment option and does not interfere with the existing horizontal alignments.</p>\n\n\n\n<p>When adding the Cover block to a post, users will see a new frame-like button in the toolbar. After clicking, it will automatically set the height setting in the block options to <code>100 vh</code>, which is the full height of the browser viewport. This option is far more flexible than having users set a height with pixel units, which do not automatically adjust based on the visitor&rsquo;s screen size.</p>\n\n\n\n<p>By combining this new alignment with full-width alignment, users can create full-screen layouts with the Cover block.</p>\n\n\n\n<p>The new toolbar control will likely <a href=\"https://github.com/WordPress/gutenberg/issues/16385\">land in other core blocks</a>. The Media &amp; Text block is another good use case. Plus, third-party plugin developers can integrate it into their blocks. As its use becomes more widespread in blocks, it will offer more robust design options for theme developers too.</p>\n\n\n\n<h2>Change Code Block Font Size</h2>\n\n\n\n<img />Setting the Code block&rsquo;s font size.\n\n\n\n<p class=\"has-drop-cap\">The Code block now has the same <a href=\"https://github.com/WordPress/gutenberg/pull/27294\">font-size option</a> as other text-based blocks, such as Paragraph and List. In general, users should probably shy away from adjusting this on a per-post basis and stick to the global default set by their theme or the Global Styles options when they eventually land in WordPress.</p>\n\n\n\n<p>However, there are use cases where it makes sense to change the code font-size in particular layouts.  I imagine some development-related site owners will want to highlight or showcase code in some way.</p>\n\n\n\n<p>With that in mind, it would be interesting to see other design options brought to Code block. Currently, it does not offer much in the way of customization, but color and background options could allow users to spruce up their code examples a bit without relying on a third-party plugin for that extra bit of pizzazz.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 02 Dec 2020 23:45:15 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WordPress.org blog: The Month in WordPress: November 2020\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9283\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://wordpress.org/news/2020/12/the-month-in-wordpress-november-2020/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:10892:\"<p>November 2020 saw several updates to the WordPress 5.6 release. Read on to follow all the latest news from the WordPress world!</p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2>WordPress 5.6 updates</h2>\n\n\n\n<p>The Core team released WordPress 5.6 <a href=\"https://wordpress.org/news/2020/11/wordpress-5-6-beta-3/\">Beta 3</a> on Nov. 2, <a href=\"https://wordpress.org/news/2020/11/wordpress-5-6-beta-4/\">Beta 4</a> on Nov. 12, <a href=\"https://wordpress.org/news/2020/11/wordpress-5-6-release-candidate/\">release candidate</a> 1 on Nov. 17, and <a href=\"https://wordpress.org/news/2020/12/wordpress-5-6-release-candidate-2/\">release candidate 2</a> on Dec. 1. You can test the Beta versions and the release candidates by <a href=\"https://wordpress.org/wordpress-5.6-beta2.zip\">downloading them from WordPress.org</a> or by using the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin. Check out the <a href=\"https://make.wordpress.org/core/2020/11/20/wordpress-5-6-field-guide/\">WordPress 5.6 field guide</a> to understand the features of WordPress 5.6 and learn how you can incorporate them into your websites. WordPress 5.6 <a href=\"https://make.wordpress.org/core/5-6/\">will be out by Dec. 9, 2020</a>. </p>\n\n\n\n<p>But our work is never done: You can submit <a href=\"https://make.wordpress.org/core/2020/11/23/wordpress-5-7-whats-on-your-wishlist/\">feature suggestions for WordPress 5.7</a> by Dec. 15.&nbsp;</p>\n\n\n\n<p>Want to contribute to upcoming WordPress releases? Join the WordPress Core dev chats on Wednesdays at 5 a.m. and 8 p.m. UTC in the <a href=\"https://wordpress.slack.com/archives/C02RQBWTW\">#core</a> channel on the <a href=\"https://make.wordpress.org/chat/\">Make WordPress Slack</a>, and <a href=\"https://make.wordpress.org/core/tag/dev-chat/\">catch up with recaps</a> on the <a href=\"https://make.wordpress.org/core/\">Core team blog</a>. If you would like to help with WordPress 5.6 outreach, contact the <a href=\"https://make.wordpress.org/marketing/\">WordPress Marketing team</a> on the <a href=\"https://wordpress.slack.com/archives/C0GKJ7TFA\">#marketing</a> channel.</p>\n\n\n\n<h2>Gutenberg 9.3 and 9.4 are out</h2>\n\n\n\n<p>Contributor teams released Gutenberg <a href=\"https://make.wordpress.org/core/2020/11/04/whats-new-in-gutenberg-4-november/\">Version 9.3</a> on Nov. 4 and <a href=\"https://make.wordpress.org/core/2020/11/19/whats-new-in-gutenberg-18-november-2/\">Version 9.4</a> on Nov. 18. Both versions include&nbsp; several improvements to Full Site Editing (FSE) flows, in addition to bug fixes and feature upgrades. Version 9.3 is the first release that isnt included entirely in WordPress 5.6; the version automatically enables FSE experiments when a block-based theme is active. Version 9.4 introduces some new features like percentage width for button blocks, block variation transformations, social icon support, and font size support for the list block. You can find out more about the Gutenberg roadmap in the <a href=\"https://make.wordpress.org/core/2020/11/02/whats-next-in-gutenberg-november-2020/\">Whats next in Gutenberg blog post</a>.</p>\n\n\n\n<p>Want to get involved in building Gutenberg? Follow <a href=\"https://make.wordpress.org/core/\">the Core team blog</a>, contribute to <a href=\"https://github.com/WordPress/gutenberg/\">Gutenberg on GitHub</a>, and join the <a href=\"https://wordpress.slack.com/archives/C02QB2JS7\">#core-editor</a> channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>.</p>\n\n\n\n<h2>Learn WordPress updates</h2>\n\n\n\n<p>WordPress contributor teams are all set to launch <a href=\"https://learn.wordpress.org/\">Learn WordPress</a> in December. Community members can now watch<a href=\"https://learn.wordpress.org/workshops\"> video workshops</a> to learn about various WordPress topics, <a href=\"https://www.meetup.com/learn-wordpress-discussions/\">participate in discussion groups</a>, and use <a href=\"https://learn.wordpress.org/lesson-plans/\">lesson plans</a> for organizing their own workshops. Contributor teams have launched <a href=\"https://make.wordpress.org/community/2020/11/18/quizzes-are-now-live-on-learn-wordpress/\">quizzes</a> and are also working on <a href=\"https://make.wordpress.org/community/2020/11/18/standards-for-learn-wordpress-workshop-content/\">setting standards</a> for workshops.<br /></p>\n\n\n\n<p>Want to contribute to Learn WordPress? You can now submit a <a href=\"https://learn.wordpress.org/workshop-presenter-application/\">workshop application</a> (submissions in languages other than English are welcome!), apply to become a <a href=\"https://learn.wordpress.org/discussion-group-leader-application/\">discussion group leader</a>, organize <a href=\"https://make.wordpress.org/community/handbook/virtual-events/organize-learn-wordpress-discussion-groups-for-your-wordpress-meetup/\">discussions for your local WordPress meetup group</a>, or <a href=\"https://make.wordpress.org/training/2020/11/25/high-priority-items-before-learn-wordpress-org-launch-part-2/\">help fix issues with existing lesson plans</a>.</p>\n\n\n\n<h2>WordPress 5.6 Translations and Polyglots survey</h2>\n\n\n\n<p>WordPress 5.6 is ready to be translated and is now at <a href=\"https://make.wordpress.org/polyglots/handbook/glossary/#hard-freeze\">hard string freeze</a>. If you would like to contribute, <a href=\"https://make.wordpress.org/polyglots/2020/11/07/wordpress-5-6-ready-to-be-translated/\">check out these instructions</a> and ensure that <a href=\"https://make.wordpress.org/polyglots/handbook/translating/packaging-localized-wordpress/automated-release-packages/\">your locale is ready for an automated release</a>. The Polyglots team has also kicked off its <a href=\"https://wordpressdotorg.survey.fm/polyglots-translator-research\">translator research survey</a>. Please <a href=\"https://wordpressdotorg.survey.fm/polyglots-translator-research\">participate in the survey</a>, share the <a href=\"https://wordpressdotorg.survey.fm/polyglots-translator-research\">survey link</a> with members of your locale, and help amplify the <a href=\"https://www.facebook.com/WPTranslationDay/posts/1275404086174610\">Facebook</a>, <a href=\"https://twitter.com/TranslateWP/status/1333342595913834496\">Twitter</a>, and <a href=\"https://www.linkedin.com/posts/wptranslationday_makewordpress-wordpress-activity-6739110862650523648-fX8R/\">LinkedIn</a> posts about it.</p>\n\n\n\n<p>Want to help WordPress speak your language? Follow <a href=\"https://make.wordpress.org/polyglots\">the Polyglots team blog</a> and join the <a href=\"https://wordpress.slack.com/archives/C02RP50LK\">#polyglots</a> channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>.&nbsp;</p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2>Further Reading:</h2>\n\n\n\n<ul><li><a href=\"https://www.php.net/releases/8.0/en.php\">PHP 8</a> is out, and WordPress 5.6 <a href=\"https://make.wordpress.org/core/2020/11/23/wordpress-and-php-8-0/\">aims to be &#8220;beta-compatible&#8221; with the latest PHP version</a>.</li><li>Contributor teams have kicked off <a href=\"https://make.wordpress.org/themes/2020/11/18/theme-previews-in-the-time-of-blocks/\">an ongoing discussion on starter content for WordPress themes</a>. Starter content for the <a href=\"http://wp-themes.com/twentytwentyone/\">Twenty Twenty One</a>, <a href=\"http://wp-themes.com/twentytwenty/\">Twenty Twenty</a>, and <a href=\"http://wp-themes.com/twentyseventeen/\">Twenty Seventeen</a> themes are now available.</li><li>The Accessibility team is <a href=\"https://github.com/10degrees/accessibility-statement-plugin\">testing a tool</a> to generate the structure of an accessibility statement for WordPress websites based on <a href=\"https://www.w3.org/WAI/planning/statements/generator/#create\">W3C standards</a>, and it is <a href=\"https://github.com/10degrees/accessibility-statement-plugin/issues\">requesting feedback from the community</a>.</li><li>The <a href=\"https://wordpressfoundation.org/\">WordPress Foundation</a> has published a <a href=\"https://wordpressfoundation.org/2020/open-source-workshops-november-2020-report/\">report on Open Source workshops</a> that were held online in 2020, based on the <a href=\"https://learn.wordpress.org/\">Learn WordPress</a> platform.</li><li>The Docs team is actively <a href=\"https://make.wordpress.org/docs/2020/11/12/follow-up-on-gutenberg-developer-documentation-restructuring-proposal/\">following up</a> on a proposal to <a href=\"https://make.wordpress.org/docs/2020/08/13/plan-proposal-for-a-new-better-structured-gutenberg-developer-documentation/\">restructure the Gutenberg developer documentation</a>.</li><li>The Community team is back with <a href=\"https://make.wordpress.org/community/tag/tuesdaytrainings/\">Tuesday Trainings</a>. The team is <a href=\"https://make.wordpress.org/community/2020/11/16/community-team-goals-for-2021-share-your-suggestions/\">also inviting suggestions on team goals for 2021</a> with a deadline of Dec. 14.</li><li>The Support team is <a href=\"https://make.wordpress.org/support/2020/11/changing-up-the-forum-front-page/\">making changes to the forum page</a> to improve discoverability.</li><li>Two online WordCamps took place in November: <a href=\"https://finland.wordcamp.org/2020/\">WordCamp Finland Online</a> and <a href=\"https://mexico.wordcamp.org/2020/\">WordCamp Mexico Online</a>. You can find Livestream recaps of the events on their websites. Videos will soon be available on WordPress.tv as well.</li><li>The Themes team <a href=\"https://make.wordpress.org/themes/2020/11/11/meeting-notes-tuesday-november-10-2020/\">made some changes to WordPress theme requirements</a>. These include removing updated CSS guidelines and a proposed plan to make WordPress themes accessibility-ready. The team is also <a href=\"https://make.wordpress.org/themes/2020/11/19/feedback-requested-resolution-process-for-issues-found-in-live-themes/\">requesting feedback</a> on the resolution process for issues found in live themes.</li><li>WordPress 5.6 will feature a <a href=\"https://make.wordpress.org/core/2020/11/05/updating-core-jquery-to-version-3-part-2/\">major jQuery change</a>, with the bundled jQuery version being updated to Version 3.5.1 and jQuery Migrate being updated to Version 3.3.2.</li><li>The <a href=\"https://make.wordpress.org/community/tag/wpdiversity/\">Diversity speaker training group</a> of the Community team is requesting feedback on reimagining their work. Please <a href=\"https://make.wordpress.org/community/2020/11/12/input-requested-re-imagining-the-work-of-the-diverse-speaker-training-group-wpdiversity/\">share your feedback as comments on the post</a> by Dec. 18.</li></ul>\n\n\n\n<p><em>Have a story that we should include in the next Month in WordPress post? Please </em><a href=\"https://make.wordpress.org/community/month-in-wordpress-submissions/\"><em>submit it here</em></a><em>.</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 02 Dec 2020 09:13:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Hari Shanker R\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: New Plugin Adds Google-Doc Style Commenting to Gutenberg Blocks\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108408\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:191:\"https://wptavern.com/new-plugin-adds-google-doc-style-commenting-to-gutenberg-blocks?utm_source=rss&utm_medium=rss&utm_campaign=new-plugin-adds-google-doc-style-commenting-to-gutenberg-blocks\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3328:\"<p><a href=\"https://www.multidots.com/\">Multidots</a>, a development agency and WordPress VIP Agency Partner, has released a plugin that brings content collaboration to the block editor. The <a href=\"https://wordpress.org/plugins/commenting-feature/\">Google-Doc Style Gutenberg Block Commenting</a> plugin landed on WordPress.org in October and is just starting to gain traction.</p>\n\n\n\n<p>It adds inline commenting to the editor where users can highlight text or select entire blocks and leave a comment. Other users can leave comments and/or mark the thread as resolved for a collaborative editing experience. Alternatively, the post author can use comments for making notes on sections that need to be improved or reviewed prior to publishing. The features support the following editorial workflow:</p>\n\n\n\n<ul><li>Add comments on Gutenberg blocks</li><li>Reply to comment</li><li>Get feedback</li><li>Resolve it</li><li>Get email notification of resolved comments</li></ul>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Multidots has a <a href=\"https://www.multidots.com/gutenberg-commenting-demo/\">live demo</a> set up where you can test leaving comments, replies, and marking threads as resolved. The plugin is currently compatible with a range of text-based blocks that are part of a page or post. Commenting can be accessed by highlighting text and then clicking on the dropdown arrow in the toolbar. Inline comments can be displayed or hidden via the icon in the top toolbar.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>The plugin restricts adding and editing comments to Super Administrators, Administrators, and Editors. These user roles can edit their own comments but cannot edit or delete those added by other users.</p>\n\n\n\n<p>Google-Doc Style Gutenberg Block Commenting could be useful for organizations where multiple teams need to review content before publishing. Not having the ability to collaborate using the block editor may even be a deal breaker for some teams that are considering WordPress. When collaborating on posts in the past I have often used Google Docs just for the ability to give inline comments with notifications. This plugin cuts many time-consuming steps out of that process, such as obtaining collaborators&rsquo; Gmail addresses, pasting the most recent version of the post into a document, and ultimately having to paste it all back into the editor. </p>\n\n\n\n<p>The plugin&rsquo;s authors consider this a beta version and plan to add more features based on community feedback. After testing it, I found that resolved threads seem to disappear, but it might be helpful to have a lasting record of them. Users cannot comment on images or other types of non-text-based blocks, and this seems somewhat limiting. There are no notifications for comments &ndash; only resolved threads, which makes it difficult to know when content needs further review.</p>\n\n\n\n<p>Multidots is planning for the next release to be a more optimized version with enhanced commenting features, including the ability to leave popup suggestions for adding/removing certain text at a specific location and asynchronous commenting. Anyone interested in following the progress or contributing can <a href=\"https://github.com/multidots/gutenberg_commenting/\">find the project on GitHub</a>.</p>\n\n\n\n<p></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 02 Dec 2020 04:40:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"WordPress.org blog: WordPress 5.6 Release Candidate 2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9274\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://wordpress.org/news/2020/12/wordpress-5-6-release-candidate-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2247:\"<p>The second release candidate for WordPress 5.6 is here!</p>\n\n\n\n<p>WordPress 5.6 is slated for releaseon<strong>December 8, 2020</strong>, and we need<em>your</em>help to get thereif you havent tried 5.6 yet,now is the time!</p>\n\n\n\n<p>You can test WordPress 5.6 release candidate 2 in two ways:</p>\n\n\n\n<ul><li>Try the<a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a>plugin (choose the bleeding edge nightlies option).</li><li>Or<a href=\"https://wordpress.org/wordpress-5.6-RC2.zip\">download the release candidate here (zip)</a>.</li></ul>\n\n\n\n<p>Thank you to all of the contributors who tested the&nbsp;Beta releases and gave feedback. Testing for bugs is a critical part of polishing every release and a great way to contribute to WordPress.</p>\n\n\n\n<h2>Plugin and Theme Developers</h2>\n\n\n\n<p>Please test your plugins and themes against WordPress 5.6 and update the<em>Tested up to</em>version in the readme file to 5.6. If you find compatibility problems, please be sure to post to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">support forums</a>. That way, those can be figured out before the final release. </p>\n\n\n\n<p>For a more detailed breakdown of the changes included in WordPress 5.6, check out the<a href=\"https://wordpress.org/news/2020/10/wordpress-5-6-beta-1/\">WordPress 5.6 beta 1 post</a>. The<a href=\"https://make.wordpress.org/core/2020/11/20/wordpress-5-6-field-guide/\">WordPress 5.6 Field Guide</a>is also out! Its your source for details on all the major changes.</p>\n\n\n\n<h2>How to Help</h2>\n\n\n\n<p>Do you speak a language other than English?<a href=\"https://translate.wordpress.org/projects/wp/dev\">Help translate WordPress into more than 100 languages!</a></p>\n\n\n\n<p><em><strong>Think you found a bug?</strong> Post it to the<a href=\"https://wordpress.org/support/forum/alphabeta\">Alpha/Beta area</a>in the support forums. We would love to hear from you! If youre comfortable writing a reproducible bug report you can<a href=\"https://make.wordpress.org/core/reports/\">file one on WordPress Trac</a>. Don&#8217;t forget to check <a href=\"https://core.trac.wordpress.org/tickets/major\">the list of known bugs</a></em>!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 01 Dec 2020 22:09:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Josepha\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"WPTavern: Block-Based Bosco, Second Full-Site Editing Theme Lands in the WordPress Directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108321\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:227:\"https://wptavern.com/block-based-bosco-second-full-site-editing-theme-lands-in-the-wordpress-directory?utm_source=rss&utm_medium=rss&utm_campaign=block-based-bosco-second-full-site-editing-theme-lands-in-the-wordpress-directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5489:\"<img />\n\n\n\n<p class=\"has-drop-cap\">Fr&auml;nk Klein, a Principal Engineer at Human Made, is now the second theme developer to release a block-based theme to the WordPress theme directory. <a href=\"https://wordpress.org/themes/block-based-bosco/\">Block-Based Bosco</a> is a recreation of his <a href=\"https://wordpress.org/themes/bosco/\">Bosco</a> theme, which he released in 2014.</p>\n\n\n\n<p>Block-based themes, also called FSE (full-site editing) themes, are currently experimental. They require the use of the Gutenberg plugin, which will automatically detect their structure and activate the beta version of the site editor. This system allows users to experience a WordPress install that is comprised entirely of blocks. Widgets, nav menus, and the customizer screens are out. Everything from posts to site headers to navigation is handled through HTML templates, which users can customize via the site editor. It is still a raw experience but continually improves with each update of the Gutenberg plugin.</p>\n\n\n\n<p>Just over a month ago, Themes Team representative Ari Stathopoulos <a href=\"https://wptavern.com/q-first-fse-wordpress-theme-now-live\">released the first block-based theme</a>, named Q, to the official theme directory. It was both a milestone in WordPress theming history and an invitation for developers to follow his lead.</p>\n\n\n\n<p>We have since seen the initial work toward a <a href=\"https://wptavern.com/twenty-twenty-one-blocks-theme-launching-as-a-separate-project\">block-based version</a> of the upcoming Twenty Twenty-One default theme. It is not yet in the directory, but the community should expect it soon.</p>\n\n\n\n<p>Developers like Klein and Stathopoulos are paving the way for others. For those who do not have the time or the inclination to scour the Gutenberg plugin&rsquo;s code or follow dozens of tickets, they can take the easy route. Study the code of people who have done the legwork.</p>\n\n\n\n<p>Klein has also written a detailed post titled <a href=\"https://wpdevelopment.courses/articles/full-site-editing-theme-learnings/\">What I Learned Building a Full-Site Editing Theme</a> in which he goes into detail about his experience. Despite his optimism for the future of theming, he does not shy away from the problems he stumbled upon. It is a must-read for any theme author who is preparing to take the plunge into block-based theme building.</p>\n\n\n\n<p>One thing that some developers may find surprising or may even make them feel slightly uncomfortable is that Klein spent much of his development time working from the site editor rather than in a code editor. &ldquo;It&rsquo;s likely that this will be the future workflow for creating themes,&rdquo; he wrote. &ldquo;Because not only can you edit a theme visually, but it&rsquo;s also much more practical than writing block markup by hand. Especially because the interface makes it easy to discover the different options offered by blocks, so that you can adjust them as needed for your desired theme design.&rdquo;</p>\n\n\n\n<h2>About the Theme</h2>\n\n\n\n<img />Block-Based Bosco in the site editor.\n\n\n\n<p class=\"has-drop-cap\">Block-Based Bosco is relatively simple. It is a one-column, no-sidebar theme, which is what most block-based themes will look like at the moment.</p>\n\n\n\n<p>&ldquo;Full-site editing themes are still missing a lot of essential features,&rdquo; wrote Klein. &ldquo;Therefore it&rsquo;s important to choose a theme design that fits with these constraints. Else you&rsquo;re going to have a very frustrating experience.&rdquo;</p>\n\n\n\n<p>Unlike Q, which is a bare-bones theme primarily for testing theme-related features, Block-Based Bosco is based on a design that users might want to actually use on a site, at least someday. Currently, full-site editing is not yet ready for use with production sites. The theme design holds up well for a simple personal blog.</p>\n\n\n\n<p>There are things the theme could do better in the short term. Offering support for wide and full alignments would be ideal, particularly for a one-column theme. The editor and front-end content width also do not match, so it is not a perfect what-you-see-is-what-you-get experience. These are not make-or-break features for these types of experimental themes at this point. We are simply in the testing ground stage.</p>\n\n\n\n<p>Right now, end-users need to start tinkering with themes like Block-Based Bosco &mdash; please do so on a test install and not a live site &mdash; and offering feedback. They also allow other developers to get more comfortable with a new system before it suddenly feels like it comes crashing down in 2021.</p>\n\n\n\n<h2>Opening Up the Theme Directory</h2>\n\n\n\n<p class=\"has-drop-cap\">One thing is obvious at this point. The WordPress theme directory needs to allow theme authors to upload block-based themes without hacks or other workarounds. Block-Based Bosco and similar themes are currently being shipped with dummy files, such as <code>header.php</code> and <code>footer.php</code>, and unnecessary PHP code in <code>functions.php</code> to bypass the Theme Check system. With these extra files and code removed, block-based themes are minuscule in comparison to traditional WordPress themes.</p>\n\n\n\n<p>There is an <a href=\"https://meta.trac.wordpress.org/ticket/5504\">open ticket</a> on the WordPress Meta Trac and a <a href=\"https://github.com/WordPress/theme-check/pull/280\">patch for the Theme Check plugin</a>. Someone needs to pull the trigger and make it happen.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 01 Dec 2020 21:19:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:113:\"WPTavern: Admin 2020 Version 2 Introduces New Lite Version, Better Plugin Compatibility, and Modular Architecture\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108302\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:267:\"https://wptavern.com/admin-2020-version-2-introduces-new-lite-version-better-plugin-compatibility-and-modular-architecture?utm_source=rss&utm_medium=rss&utm_campaign=admin-2020-version-2-introduces-new-lite-version-better-plugin-compatibility-and-modular-architecture\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5328:\"<img />\n\n\n\n<p>Six months ago, <a href=\"https://admintwentytwenty.com/\">Admin 2020</a> captured the attention of WordPress users with its fresh approach to skinning the admin screens. <a href=\"https://admintwentytwenty.com/admin-2-is-here/\">Version 2</a> of the plugin has been completely rewritten to support a modular architecture so users can enable or disable features, or selectively enable them&nbsp;by user role or username. Some users prefer the default menu but want to be able to categorize their media into folders with the plugin&rsquo;s CMS-friendly architecture for organizing media and posts. This update significantly improves performance for those who don&rsquo;t require the analytics, admin bar, menu, or other features. </p>\n\n\n\n<p>The plugin now has a new settings interface that is less cluttered than the previous version.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>&ldquo;Admin 2020 started off as a WordPress admin theme, and that was always at the core of the plugin,&rdquo; developer Mark Ashton said. &ldquo;As we grew, we added more and more features on top of that and it became very difficult in its current iteration to separate those feature sets, or disable some features and let others carry on.&rdquo;</p>\n\n\n\n<p>Version 2 also greatly improves compatibility with other plugins. Ashton was spending a lot of time adding support for other plugins, which slowed down development. The new approach to compatibility causes fewer styling conflicts and works without having to add custom stylesheets for other plugins. Prior to this version, Admin 2020 disabled 90% of WordPress admin styling and applied its own. </p>\n\n\n\n<p>&ldquo;While this gave us complete control over layouts and styling, it was one of the reasons we had to spend a lot of time adding support for other plugins,&rdquo; Ashton said. &ldquo;So for version 2, we kept the WP styling (most of it anyway) and applied a lightweight theme on top&nbsp;of it. The end result is a theme that is more refined, quicker, and the most compatible we have ever put out.<br />Usually the only plugins we have problems with these days are the ones that actively disable non standard WP scripts and styles, which obviously breaks admin 2020&rsquo;s layout.&rdquo;</p>\n\n\n\n<p>In the interest of keeping Admin 2020 lightweight, the plugin now uses a custom build of the <a href=\"https://getuikit.com/\">UIkit</a> framework that is more tailored to its specific use case. </p>\n\n\n\n<p>&ldquo;Instead of having uikit as a base, and then layering on top of it, we just tailored it to suit the plugin needs and thanks to the wonders of scss it is an incredibly easy framework to modify,&rdquo; Ashton said. &ldquo;Doing this also allowed us to support RTL much easier which was a very common feature request.&rdquo;</p>\n\n\n\n<h2>New Admin 2020 Lite Version Offers Basic Features, Coming to WordPress.org in 2021</h2>\n\n\n\n<p>Admin 2020 is now available on the plugin&rsquo;s website in a Lite version for free. In recognition of WordPress.org&rsquo;s undeniable force as a distribution channel, Ashton is considering changing his previous strategy of pursuing a fully commercial model to embrace the idea of marketing a free plugin with a paid upgrade. </p>\n\n\n\n<p>&ldquo;Admin 2020 has grown so much since we launched in May this year and it&rsquo;s no longer just an admin theme,&rdquo; Ashton said. &ldquo;In fact, we see it as more of an admin extension now that also has a theme. Because of this, we felt there are now enough features to be able to offer the lite and pro versions.&rdquo;</p>\n\n\n\n<p>With the new modular system in version 2, the free and commercial versions are the same plugins, except the lite version has the paid modules removed.</p>\n\n\n\n<p>&ldquo;This means the development of the two versions is synched and updates,&nbsp;new features and bug&nbsp;fixes all rollout at the same time,&rdquo; Ashton said. &ldquo;For the time being we are going to stick to our own distribution&nbsp;channel just to keep everything streamlined, but releasing through&nbsp;<a rel=\"noreferrer noopener\" href=\"http://wordpress.org/\" target=\"_blank\">wordpress.org</a>&nbsp;is something we have planned for next year.&rdquo;</p>\n\n\n\n<p>Launching a new business during a pandemic is no easy feat but Ashton has grown Admin 2020&rsquo;s user base to 3,642 active installations and is still looking to hire someone to assist in developing and maintaining the plugin.</p>\n\n\n\n<p>&ldquo;This has grown dramatically since the release of version 2 and will likely be around 5,000 or more in a week due to the sales from the Black Friday/Cyber Monday event,&rdquo; he said. </p>\n\n\n\n<p>Next up on the roadmap, Admin 2020 users can expect more customization options and deeper integration with WooCommerce. Ashton is currently working on the custom admin pages feature set that will allow users to create admin pages using the block editor and some of the more popular page builders. </p>\n\n\n\n<p>&ldquo;We are also working on expanding our WooCommerce integration with the idea of having a full suite of cards and data available on the overview page to help better visualize your business and sales,&rdquo; Ashton said. &ldquo;We are also going to be changing admin 2020&rsquo;s name towards the end of the year but I won&rsquo;t say what to just yet.&rdquo;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 30 Nov 2020 23:36:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"WPTavern: Block Navigation Plugin Provides Missing Context-Based Outline for the WordPress Editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108323\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:239:\"https://wptavern.com/block-navigation-plugin-provides-missing-context-based-outline-for-the-wordpress-editor?utm_source=rss&utm_medium=rss&utm_campaign=block-navigation-plugin-provides-missing-context-based-outline-for-the-wordpress-editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4596:\"<p class=\"has-drop-cap\">&Aacute;lvaro Garc&iacute;a wrote the first code for his <a href=\"https://wordpress.org/plugins/block-navigation\">Block Navigation</a> plugin back in November 2018. It is one of those hidden gems that I wish I had known about two years ago as I began using the block editor. It has been available. I simply did not know about it until blindly stumbling upon it in a <a href=\"https://www.facebook.com/groups/gutenberghub/permalink/2844169185815585/\">discussion</a> in the WordPress Gutenberg Community group on Facebook.</p>\n\n\n\n<p>The goal of the plugin is to provide an alternative to the editor&rsquo;s current navigation. For the most part, it excels. WordPress has set the bar so low that any improvement seems like a godsend.</p>\n\n\n\n<p>The plugin adds a new sidebar panel titled Block Navigation. That panel then lists each block with the added context needed to understand what block it is associated with in the content. For example, a Paragraph block in the navigation list will display its first few words. Other blocks do the same. Images and galleries in the list display their respective thumbnails. It handles nested blocks too.</p>\n\n\n\n<p>All users must do is search for and click on the block they want to jump to in the content.</p>\n\n\n\n<img />Navigating to  specific paragraph in the document.\n\n\n\n<p>The plugin is packed with several other features. Users can shift blocks up and down from the navigation panel. They can also move blocks anywhere in the document with the click of a button or remove them altogether.</p>\n\n\n\n<p>One of the more interesting features of the Block Navigation plugin is its ability to log a block&rsquo;s data to the console. For developers, this could be a handy feature to quickly look up information for a block. While I doubt the average user would use it, there might be some potential applications for support requests, particularly with third-party block plugins.</p>\n\n\n\n<img />Console log of a block&rsquo;s data.\n\n\n\n<p>The downside of the plugin is that it does not provide a color scheme that simply matches the default WordPress color palette. However, it does provide a dozen color options for users to choose from. The Banana (light) scheme seemed the least out of place.</p>\n\n\n\n<p>With the navigation being handled in the sidebar, it could interfere with some users&rsquo; workflows. For users who prefer to keep the block options sidebar available at all times, they will need to switch back and forth between sidebars. The plugin does provide a button for switching to each block&rsquo;s setting via its submenu (vertical ellipsis icon) in the navigation list.</p>\n\n\n\n<p>The thing that would make this plugin better would be putting it into the editor toolbar, replacing the current Outline dropdown.</p>\n\n\n\n<h2>It Should Be a Core WordPress Feature</h2>\n\n\n\n<p class=\"has-drop-cap\">The block editor&rsquo;s Outline dropdown is lackluster at best. For short posts, it is unnecessary. For long posts, there is no context for any of the blocks in the list. The goal is to be able to jump to specific points in the document without scrolling. However, unless you know the exact location in the block you want to jump to, it can sometimes be impossible to use the feature.</p>\n\n\n\n<img />Outline dropdown.\n\n\n\n<p>The Document Outline section of the Details dropdown provides some much-needed context. It displays the post&rsquo;s headings. However, this outline does not allow users to click on an item and jump to its associated block.</p>\n\n\n\n<img />Details dropdown.\n\n\n\n<p>Paal Joachim Romdahl proposed a fix for the Outline dropdown in October 2018. &ldquo;What about just using the icon and then showing some of the text in the beginning of the paragraph?&rdquo; he asked in a <a href=\"https://github.com/WordPress/gutenberg/issues/11010\">GitHub ticket</a> that has seen no discussion for nearly a year.</p>\n\n\n\n<div class=\"wp-block-image\"><img />Merged dropdowns.</div>\n\n\n\n<p>There is currently an <a href=\"https://github.com/WordPress/gutenberg/pull/14956\">open pull request</a> on GitHub to merge the Details and Outline dropdowns in the toolbar. The original proposal added a tabbed interface. However, an alternative patch without the tabs proposed in the same ticket would merge the best of both worlds by adding the more-detailed structural outline while linking to the blocks in the document.</p>\n\n\n\n<p>The only question left now is whether I can still update my <a href=\"https://wptavern.com/wordpress-5-7-wish-list-save-block-editor-settings-per-user\">WordPress 5.7 wish list</a> to include this feature.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 30 Nov 2020 23:03:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"BuddyPress: BuddyPress 6.4.0 Maintenance and Security Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=315780\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://buddypress.org/2020/11/buddypress-6-4-0-maintenance-and-security-release/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1569:\"<p><a href=\"https://downloads.wordpress.org/plugin/buddypress.6.4.0.zip\">BuddyPress 6.4.0</a>&nbsp;is now available. This is a security and maintenance release. All BuddyPress installations are strongly encouraged to upgrade as soon as possible.</p>\n\n\n\n<p>The 6.4.0 release addresses one security issue: non-capable users could add a style attributes to span and p elements in possible rich text fields of their profile page. The vulnerability has been fixed.</p>\n\n\n\n<p>Version 6.4.0 also fixes 7 bugs, including compatibility updates to welcome <a href=\"https://www.php.net/releases/8.0/en.php?lang=en\">PHP 8.0 release</a> (Congratulations to all PHP 8.0 contributors!).</p>\n\n\n\n<p>For complete details, visit the&nbsp;<a href=\"https://codex.buddypress.org/releases/version-6-4-0/\">6.4.0 changelog</a>.</p>\n\n\n\n<p>Update to BuddyPress 6.4.0 today in your WordPress Dashboard, or by&nbsp;<a href=\"https://wordpress.org/plugins/buddypress/\">downloading from the WordPress.org plugin repository</a>.</p>\n\n\n\n<h2>Many thanks to 6.4.0 contributors&nbsp;<span class=\"dashicons dashicons-heart\"></span></h2>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/johnjamesjacoby\">John James Jacoby (johnjamesjacoby)</a>, <a href=\"https://profiles.wordpress.org/zeldatea/\">Zeldatea</a>, <a href=\"https://profiles.wordpress.org/dd32/\">Dion Hulse</a>, <a href=\"https://profiles.wordpress.org/r-a-y/\">Ray (r-a-y)</a>, <a href=\"https://profiles.wordpress.org/dcavins/\">David Cavins (dcavins)</a> &amp;<a href=\"https://profiles.wordpress.org/imath/\">Mathieu Viet (imath)</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 27 Nov 2020 22:32:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mathieu Viet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WordPress Foundation: Open Source Workshops: November 2020 report\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://wordpressfoundation.org/?p=150204\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://wordpressfoundation.org/2020/open-source-workshops-november-2020-report/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3597:\"<p>The WordPress Foundation has been organizing <a href=\"https://wordpressfoundation.org/2018/open-source-training-events-announced/\">Introduction to Open Source workshops</a>, as part of our continuing efforts to educate the public about WordPress and related open-source software (OSS). In 2019, as part of our goal of organizing workshops in parts of the world with less participation in open source, we held <a href=\"https://wordpressfoundation.org/2019/successful-open-source-workshops-in-bhutan-india-pakistan-and-angola/\">four successful workshops</a> in India, Pakistan, Bhutan, and Thimphu.&nbsp;</p>\n\n\n\n<p>By March 2020, the COVID-19 pandemic had engulfed the world, forcing community organizers to cancel all in-person events. Unfazed by these challenges, our community organizers pivoted to online events by organizing <a href=\"https://wordpressfoundation.org/2020/charity-hackathons-august-2020-report/\">four successful online charity hackathons</a> in <a href=\"https://doaction.org/ja/event/japan-2020/\">Japan</a>, <a href=\"https://doaction.org/event/south-africa-2020/\">South Africa</a>, <a href=\"https://doaction.org/event/india-2020/\">India</a>, and <a href=\"https://doaction.org/event/nigeria-2020/\">Nigeria</a>, so far. The Introduction to Open Source workshops have also moved online. The <a href=\"https://learn.wordpress.org/workshop/introduction-to-open-source/\">workshop</a> is now available online as part of <a href=\"https://learn.wordpress.org/\">Learn WordPress</a>, which is a brand new initiative from WordPress contributor teams to help people learn how to use, build for, and contribute to WordPress. Community members across the world can now<a href=\"https://learn.wordpress.org/workshop/introduction-to-open-source/\"> learn about Open-Source</a> safely from the comfort of their homes and test their knowledge using <a href=\"https://learn.wordpress.org/quiz/introduction-to-open-source/\">the embedded quiz</a>. The workshops are also followed by <a href=\"https://www.meetup.com/learn-wordpress-discussions/\">discussion groups</a>, where participants can discuss their learnings in real-time and find answers to their questions.&nbsp;&nbsp;</p>\n\n\n\n<p>As of November 2020, the Introduction to Open-source workshop video has been viewed 757 times. Three online discussion group events with over 152 RSVPs were also held successfully. Sign-ups are open for two more discussion groups that are listed below:</p>\n\n\n\n<ul><li><a href=\"https://www.meetup.com/learn-wordpress-discussions/events/274841875/\">Tuesday, December 8 2020, at 6:00 AM UTC</a></li><li><a href=\"https://www.meetup.com/learn-wordpress-discussions/events/274841881/\">Wednesday, December 16 2020, at 4:00 PM UTC</a></li></ul>\n\n\n\n<p>You can watch the <a href=\"https://learn.wordpress.org/workshop/introduction-to-open-source/\">workshop video</a> and participate in these discussion groups to learn about open-source software and find answers to your questions on open-source.</p>\n\n\n\n<p>In addition to these scheduled discussion groups, community organizers can organize <a href=\"https://make.wordpress.org/community/handbook/virtual-events/organize-learn-wordpress-discussion-groups-for-your-wordpress-meetup/\">their own online discussion groups</a> or hold online watch parties for the <a href=\"https://learn.wordpress.org/workshop/introduction-to-open-source/\">Introduction to Open-Source workshop</a>.&nbsp;</p>\n\n\n\n<p>Given the global spread of the COVID-19 pandemic, WordPress Foundation events are likely to be held online in 2021. We will be announcing our plans for 2021 events later this year.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 27 Nov 2020 09:05:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Hari Shanker\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"WPTavern: Something To Be Thankful For\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108221\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:121:\"https://wptavern.com/something-to-be-thankful-for?utm_source=rss&utm_medium=rss&utm_campaign=something-to-be-thankful-for\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4328:\"<img />\n\n\n\n<p class=\"has-drop-cap\">Over the past several weeks, I have received around four dozen emails, texts, PMs, and other messages related to Black Friday and Cyber Monday deals. Last year, we ran a <a href=\"https://wptavern.com/wordpress-black-friday-sales-roundup\">roundup of deals</a> happening throughout the WordPress ecosystem.  However, we are not running such a post this year. It took a solid week to compile and piece together the previous article. It was a lot of work for what was a statistical dud. Readership tends to wane around holidays as people spend more time offline and with their families.</p>\n\n\n\n<p>Plus, I firmly believe that our readers would rather see what we have to say about a particular product than simply scroll through a list of offers that are already widely shared on Twitter, Facebook, and elsewhere.</p>\n\n\n\n<p>As George Olaru, the CEO of Pixelgrade, wrote in <em><a href=\"https://pixelgrade.com/upstairs/discounts/\">I discount, you discount, we both lose</a></em>, software is not a perishable food item. It is not at risk of spoilage in a few days, and if it is, we have a real problem. On the flip side, some small businesses rely on this holiday to generate a large portion of their yearly revenue. However, we should all have some serious conversations about whether it is healthy for discounted software to permeate the WordPress plugin and theme markets every time a holiday rolls around. Whatever your stance, Olaru&rsquo;s piece is worth reading and thinking on.</p>\n\n\n\n<p>It is also tough to get into the holiday spirit this year. With Covid-19, the Black Friday markets have changed, which is probably not a bad thing on the whole &mdash; <em>do we all really need to pile into stores to fight over the latest gadgets?</em> The pandemic has also meant that families have had to make hard decisions about gatherings. The Tadlock family decided to cancel our pre-Thanksgiving/reunion we have in early November. We host it early because the doctors and nurses in the family often have to work on the holiday, and they agreed that a large gathering was not ideal. Fortunately, we live in an era where we can connect with each other in moments and from vast distances.</p>\n\n\n\n<p>No, it did not feel right to do a sales roundup this year. Instead, I wanted to get back to the root of the Thanksgiving holiday, at least what I was taught the holiday was supposed to be about.</p>\n\n\n\n<p>While tomorrow&rsquo;s Thanksgiving holiday is an American tradition, I am certain our readers abroad can join in the celebration. It is a day of giving thanks for the blessings of the previous year. In times past, this has often meant being thankful for the harvest and having food on the table. Today, it still means the same to many. However, the holiday is all about counting our blessings, and that is something we should all take time to do.</p>\n\n\n\n<p>This year, the thing I am most thankful for is the community, the people who all band together to create the most used CMS on the web, the people who evangelize the platform, and the people who continually take part in this grand experiment.</p>\n\n\n\n<p>One of the things I attempt to do when writing is to share exciting things happening in our little corner of the world. Yes, I am often critical too. This is because I want to see people and companies strive to create better themes, plugins, and other products. For those times when I stretch to hyperbole or perhaps lean toward the negative, know that it comes from a place that is hoping for your success. It is hard to balance at times, but I am thankful that I can do this day in and day out.</p>\n\n\n\n<p>After writing for the Tavern for over a year now, I feel like I am on a wondrous journey with so many of you. Whether it is a random message just to say hello or a ping about a new product, I look forward to seeing it all.</p>\n\n\n\n<p>These human-to-human connections were not something I was expecting as I began this gig. Thank you to everyone who has made that possible.</p>\n\n\n\n<p>Let&rsquo;s all take a day and share some of the WordPress-related things we are thankful for this year &mdash; <em>we can all save our block editor criticisms for tomorrow</em>. It has been a rough year. We could all really use some positivity right now.</p>\n\n\n\n<p>What are you thankful for?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 25 Nov 2020 19:51:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"WPTavern: Getting Your WordPress Plugins and Themes Ready for PHP 8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108160\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:179:\"https://wptavern.com/getting-your-wordpress-plugins-and-themes-ready-for-php-8?utm_source=rss&utm_medium=rss&utm_campaign=getting-your-wordpress-plugins-and-themes-ready-for-php-8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7380:\"<p>On Monday, WordPress core contributor Jonathan Desrosiers published a <a rel=\"noreferrer noopener\" href=\"https://make.wordpress.org/core/2020/11/23/wordpress-and-php-8-0/\" target=\"_blank\">detailed post</a> on the Make WordPress Core blog about the upcoming PHP 8 release and how it affects WordPress.</p>\n\n\n\n<h2>PHP 8 Is Coming</h2>\n\n\n\n<p>Scheduled for release on <a rel=\"noreferrer noopener\" href=\"https://wiki.php.net/todo/php80\" target=\"_blank\">November 26, 2020</a>, PHP 8 is the next major update to our favorite scripting language. While previous PHP releases have not had too much of an adverse effect on the WordPress ecosystem, this update has some breaking changes that could affect backward compatibility. It should also be noted that many features that were deprecated in PHP 7.x will now be removed in PHP 8.</p>\n\n\n\n<h2>The Status of WordPress Core</h2>\n\n\n\n<p>In his post, Desrosiers highlights the work that has been done to keep the core software up to date.  &ldquo;WordPress Core aims to be compatible with PHP 8.0 in the 5.6 release (currently scheduled for December 8, 2020),&rdquo; he wrote. </p>\n\n\n\n<p>However, this does not mean it is safe to upgrade to PHP 8 when WordPress 5.6 is released.  WordPress is rarely run just on its own and usually relies on at least one theme and a collection of plugins to function as a blog or web site. As such, he points out, &ldquo;The state of PHP 8 support within the broader ecosystem (plugins, themes, etc.) is impossible to know. For that reason, WordPress 5.6 should be considered &lsquo;beta compatible&rsquo; with PHP 8<strong>.</strong>&ldquo;</p>\n\n\n\n<p>What this means, essentially, is that until most major themes and plugins are PHP 8 compatible, WordPress cannot be considered fully compatible.</p>\n\n\n\n<h2>Understand How PHP 8 Could Affect Your Plugin or Theme</h2>\n\n\n\n<p>Companies like Yoast have been preparing for this for a little while now. In late October, Yoast CTO Omar Reiss, along with fellow contributors Juliette Reinders Folmer, maintainer of the <a rel=\"noreferrer noopener\" href=\"https://github.com/WordPress/WordPress-Coding-Standards\" target=\"_blank\">WordPress Coding Standards Sniffs for PHPCS</a>, and Yoast DevOps manager Herre Groen, compiled and published a <a rel=\"noreferrer noopener\" href=\"https://developer.yoast.com/blog/the-2020-wordpress-and-php-8-compatibility-report/\" target=\"_blank\">comprehensive WordPress/PHP 8 compatibility report</a>. </p>\n\n\n\n<p>While I highly recommend you take the time to read through the entire report, it does outline the main reason that the PHP 8 upgrade could have such a drastic effect on large WordPress sites, especially the plugin and theme ecosystem.</p>\n\n\n\n<p>&ldquo;However, PHP 7.* versions have seen a far larger set of deprecations than previous versions of PHP. Where PHP 5.6 to PHP 7 was a relatively simple migration, going from 7.x to 8 could be very painful, especially for very old codebases, like WordPress and many of the plugins that are available for it. For well-typed codebases or codebases which have stayed up-to-date with the latest PHP versions, there isn&rsquo;t a big problem.&rdquo;</p>\n\n\n\n<p>As a maintainer of a few plugins, some built on code dating back eight years, it is worrisome that this upgrade could cause sites to break.</p>\n\n\n\n<img />PHPCompatibility repository.\n\n\n\n<h2>How to Prepare Yourself</h2>\n\n\n\n<p>I asked Reiss and Folmer what plugin and theme developers can do to get ready, and they shared some pointers.</p>\n\n\n\n<p>First and foremost, developers should inform themselves about the changes coming in PHP 8: read <a rel=\"noreferrer noopener\" href=\"https://make.wordpress.org/core/2020/11/23/wordpress-and-php-8-0/\" target=\"_blank\">the Make post about PHP 8</a>, read the <a rel=\"noreferrer noopener\" href=\"https://developer.yoast.com/blog/the-2020-wordpress-and-php-8-compatibility-report/\" target=\"_blank\">Yoast PHP8 Compatibility</a> report, read the &ldquo;<a rel=\"noreferrer noopener\" href=\"https://make.wordpress.org/core/2020/11/23/wordpress-and-php-8-0/\" target=\"_blank\">Migrating from PHP 7.4 to PHP 8.0</a>&rdquo; section of the PHP manual, and potentially dig deeper by reading the <a rel=\"noreferrer noopener\" href=\"https://github.com/php/php-src/blob/PHP-8.0/UPGRADING\" target=\"_blank\">UPGRADING doc in the PHP 8 branch</a> and the <a rel=\"noreferrer noopener\" href=\"https://wiki.php.net/rfc#php_80\" target=\"_blank\">RFCs for PHP 8</a>.</p>\n\n\n\n<p>Some available tools can be used to help look for incompatibilities:</p>\n\n\n\n<ul><li>Run PHP lint on PHP 8 over their code, either via the &nbsp;<code>php -l</code>&nbsp;command (making sure to iterate over all files) or by using <a rel=\"noreferrer noopener\" href=\"https://github.com/php-parallel-lint/PHP-Parallel-Lint\" target=\"_blank\">PHP Parallel Lint</a>.</li><li>Run <a rel=\"noreferrer noopener\" href=\"https://github.com/PHPCompatibility/PHPCompatibility\" target=\"_blank\">PHPCompatibility</a> over their code: it should be noted that nearly all PHP 8 related sniffs are in the as-of-yet-not-yet-released version 10.0.0 of PHPCompatibility, so people would need to use the&nbsp;<code>develop</code>&nbsp;branch or via Composer&nbsp;<code>dev-develop</code>&nbsp;for the time being, until version 10.0.0 is released. </li><li>Run the unit/integration tests for the plugin or theme on PHP 8 and fix anything which that comes up as an error. This will often mean that the test suite first needs to be made compatible with PHPUnit 9.3+. The <a rel=\"noreferrer noopener\" href=\"https://github.com/Yoast/PHPUnit-Polyfills\" target=\"_blank\">PHPUnit Polyfills</a> package and <a rel=\"noreferrer noopener\" href=\"https://github.com/Yoast/wp-test-utils\" target=\"_blank\">WP Test Utils</a> package (both published under the Yoast GitHub organization) can help with this. It&rsquo;s also important to note a considerable test coverage is needed to make this reliable.</li><li>Run the WordPress <a rel=\"noreferrer noopener\" href=\"https://make.wordpress.org/core/handbook/testing/automated-testing/phpunit/\" target=\"_blank\">unit tests</a> and WordPress <a rel=\"noreferrer noopener\" href=\"https://make.wordpress.org/core/2019/06/27/introducing-the-wordpress-e2e-tests/\" target=\"_blank\">e2e tests</a> with your plugin activated, and fix any issues that arise.</li><li>Check whether the (strict) code coverage of said tests is high enough and if not, add more tests, making sure both happy and unhappy paths are covered.</li><li>If there are no tests, test everything manually, focusing especially on the &ldquo;unhappy paths&rdquo;, and expect to receive bug reports for the foreseeable future. At the same time, this is probably a good time to look into implementing unit/integration tests for your plugin or theme.</li></ul>\n\n\n\n<h2>There Is Still Time, But It Is Running Out</h2>\n\n\n\n<p>As Desrosiers pointed out in the Make post, WordPress is only officially aiming to be PHP 8 ready by the time 5.6 is released in early December. Potentially, this means that many WordPress-focused hosting companies will only consider offering upgrades to their customers once WordPress core is compatible. So as plugin and theme developers, we have some time to test our products and get them ready, but that window is closing fast. </p>\n\n\n\n<p>Fortunately for us, the knowledge and tools to get up to date are out there.  We merely need to put them into action.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 25 Nov 2020 17:03:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Jonathan Bossenger\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"WPTavern: WordPress 5.7 Wish List: Save Block Editor Settings Per User\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108176\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:183:\"https://wptavern.com/wordpress-5-7-wish-list-save-block-editor-settings-per-user?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-5-7-wish-list-save-block-editor-settings-per-user\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4651:\"<p class=\"has-drop-cap\">WordPress 5.6 development is winding down as we begin to close out the beta testing round, inching toward the final release on December 8. That means it is time to think about what WordPress 5.7 will look like. This is one of my favorite times of the WordPress development cycle because I get to see what others want to be added to the core platform. I also get to share a feature request of my own.</p>\n\n\n\n<p>Francesca Marano <a href=\"https://make.wordpress.org/core/2020/11/23/wordpress-5-7-whats-on-your-wishlist/\">opened the discussion</a> on the Make Core blog. She asks that people link to a specific ticket, which can be from WordPress Trac or the Gutenberg repository.</p>\n\n\n\n<p>One consideration for everyone&rsquo;s wish list is that 2021 will potentially see <a href=\"https://make.wordpress.org/core/2019/11/21/tentative-release-calendar-2020-2021/\">four major WordPress releases</a> rather than the typical three. WordPress 5.7 is tentatively scheduled to land on March 9, 2021. The team has scheduled future releases in three-month intervals. While the dates are not written in stone, it could mean each release&rsquo;s feature set might need to be scaled back to some small degree.</p>\n\n\n\n<p>Most features that land in WordPress 5.7 will be items that are already under development. Enhancements like <a href=\"https://wptavern.com/wordpress-5-6-release-team-pulls-the-plug-on-block-based-widgets\">block-based widgets</a> and <a href=\"https://wptavern.com/navigation-screen-sidelined-for-wordpress-5-6-full-site-editing-edges-closer-to-public-beta\">nav menus</a> that were punted from the 5.6 release should land early and be ready for a full three months of testing. The development team will also focus heavily on pushing an early/beta version of the site editor into core WordPress.</p>\n\n\n\n<p>There is still room for other things to land, and now is the time for everyone to make their case for their pet feature.</p>\n\n\n\n<p>Unlike past wish-list discussions, I am going to take a step back and control myself. Instead of asking for one of those big-ticket items that I know is unlikely to happen &mdash; <em>hello, <a href=\"https://wptavern.com/open-call-for-wordpress-5-5-tickets-whats-on-your-wish-list\">completed post type API</a> and <a href=\"https://wptavern.com/wordpress-5-6-wish-list-homepage-post-type-selection-and-block-management\">homepage post type selection</a></em> &mdash;, I will simply ask for something more practical.</p>\n\n\n\n<p>In WordPress 5.7, I want the block inspector tabs and some block option defaults to remain the same each time I write a new post.</p>\n\n\n\n<p>One of my biggest pet-peeves is with the image block in particular. Each time I add an image, I first close the Styles tab in the sidebar. I do not use it often, so it is not important enough to always be open. Then, I must switch the Image Size setting to Full Size from its default Large. I typically format my images for display before uploading and simply want to use the image at the size I uploaded. These are small things, but they break my workflow. As a daily writer, it has become a nuisance over time.</p>\n\n\n\n<img />Configuring image block settings.\n\n\n\n<p>These should be per-user settings. Each user&rsquo;s workflow is different, so WordPress likely needs to handle this as user metadata or a similar method.</p>\n\n\n\n<p>I was unable to track down an open ticket for saving the tab state. There are over 2,600 currently-open issues. Maybe I did not nail down the right search terminology. Or, it may be a non-issue for other users.</p>\n\n\n\n<p>However, there is a two-year-old ticket for <a href=\"https://github.com/WordPress/gutenberg/issues/8663\">remembering the last image size</a> used. I was happy to find like-minded peers who share my frustration in this case. There is also a more recent ticket about <a href=\"https://github.com/WordPress/gutenberg/pull/20269\">storing the default image size</a> on a per-user basis. The feedback in the tickets shows a clear and present need for WordPress to fix this problem.</p>\n\n\n\n<p>A representative of Feast Design Co. noted in the first ticket, &ldquo;Every time somebody inserts an image they have to change the image size. This seems small but at 10 seconds per image x 5 images per post x 2 posts per week x 52 weeks per year, this is 86 minutes per year.&rdquo; I believe I can manage it in a little less than 10 seconds per image, but it stills knocks me out of my flow each time. It is a seemingly trivial issue, but the time wastage adds up for those who add many images to posts throughout the year.</p>\n\n\n\n<p>What is on your wish list for WordPress 5.7?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 24 Nov 2020 21:43:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: Genesis Block Theme Beta, StudioPress Pursuing a Block-First Future\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108147\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:197:\"https://wptavern.com/genesis-block-theme-beta-studiopress-pursuing-a-block-first-future?utm_source=rss&utm_medium=rss&utm_campaign=genesis-block-theme-beta-studiopress-pursuing-a-block-first-future\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5740:\"<p class=\"has-drop-cap\">On November 11, StudioPress <a href=\"https://studiopress.blog/genesis-block-theme-beta/\">announced an open beta</a> for its Genesis Block Theme. This is a pivotal moment, or at least one moment in a series of significant moments, for adoption of the block editor. Feel free to call me on this in a year or two if it does not pan out.</p>\n\n\n\n<p>The original Genesis theme is the foundational tool that 1,000s of developers use to build many 1,000s more websites across the web. Over the past decade, StudioPress has remained one of the top-tier commercial WordPress theme companies, and it has done so on the back of its Genesis product. It has also remained an important part of the company&rsquo;s offering since <a href=\"https://wptavern.com/wp-engine-acquires-studiopress\">WP Engine acquired it in 2018</a>.</p>\n\n\n\n<p>While WP Engine and StudioPress have bet big on the block editor with products like <a href=\"https://wordpress.org/plugins/genesis-blocks\">Genesis Blocks</a>, the Genesis Block Theme will be a game-changer when it launches as a finished product, likely sometime next year.</p>\n\n\n\n<p>This is not necessarily because StudioPress will offer a better product than what many others are creating. It is about one of the largest theme development companies shifting toward a block-first approach. Others will fall in line. Or be left behind.</p>\n\n\n\n<p>WP Engine and StudioPress have done this slowly and strategically, thoughtfully transitioning their user base into the block world. With WP Engine&rsquo;s <a href=\"https://wptavern.com/atomic-blocks-rebranded-to-genesis-blocks-migration-path-to-new-plugin-coming-soon\">acquisition of Atomic Blocks</a> (now Genesis Blocks) and <a href=\"https://wptavern.com/block-lab-team-joins-wp-engine-looks-to-the-future-of-block-building\">bringing on the Block Lab team</a> earlier this year, the company is setting itself up to continue pushing what developers and users can do with WordPress&rsquo;s block system. The Genesis Block Theme is the next step in what I am assuming is a long list of product ideas the company is pursuing.</p>\n\n\n\n<img />Using the Genesis Blocks plugin with the Genesis Block Theme beta.\n\n\n\n<p>Typical Genesis-based child themes, at least those directly sold by the StudioPress team, have always catered to those who prefer a more minimalist-get-out-of-the-user&rsquo;s-way approach to design. Many of them should make an easy transition to the block editor. Add a few style adjustments here, make a few tweaks there, and, you have a theme that is fully capable of handling the block editor. It is a testament to the company&rsquo;s design chops when it does not really matter what WordPress is doing under the hood. The theme designs hold up regardless.</p>\n\n\n\n<p>Times are changing, however. The StudioPress team is looking at WordPress 5.7, which is expected to land in the spring of 2021, and getting ready to handle the launch of the WordPress site editor.</p>\n\n\n\n<p>David Vogelpohl, the VP of Growth for WP Engine, left specific instructions on how to test the Genesis Block Theme beta in the announcement. One of the key items in that list is to skip modifying the theme directly or using the customizer settings. The goal is to identify pain points when approaching site design via blocks. It is good to start shifting how the Genesis user base approaches building sites in general.</p>\n\n\n\n<p>He also asks testers to install the Genesis Blocks plugin. It is a library of various blocks, sections, and layouts for building block-based content. This will help both developers and users become more accustomed to the shift in building with the company&rsquo;s key product.</p>\n\n\n\n<p>Vogelpohl <a href=\"https://wptavern.com/wp-engine-launches-genesis-pro-add-on-for-customers-more-features-in-the-works\">teased a &ldquo;Genesis X&rdquo; project</a> in May that would focus on pushing the boundaries of the block editor and, eventually, full-site editing. Deciding against launching a separate product, the team has been pushing features from this project into Genesis Blocks. Three weeks ago, StudioPress <a href=\"https://studiopress.blog/collections-for-genesis-blocks/\">launched its new Collections feature</a>, which was born from Genesis X.</p>\n\n\n\n<p>&ldquo;You can think of Collections like a theme&rsquo;s block-based demo content, but available on-demand as you build out content vs. only during one-click-theme-setup features within the framework today,&rdquo; said Vogelpohl.</p>\n\n\n\n<img />The Slate Collection from the Genesis Blocks plugin.\n\n\n\n<p>Collections are essentially categorized page sections or entire layouts that share a similar design aesthetic. Genesis Blocks currently has one Collection titled Slate available for free. In practice, a user can already build out nearly an entire site with just this single Collection. This seems to be the direction that Genesis and its line of products are heading. Everything is pretty much plug-and-play. Select a few layouts for various pages. Click a few buttons. Customize the content. And, voil&agrave; &mdash; a turnkey system for building websites.</p>\n\n\n\n<p>StudioPress must wait for the site editor to land in WordPress 5.7 before it can handle everything. Site headers, footers, and sidebars still require customization outside of the block editor.</p>\n\n\n\n<p>Right now, the Genesis Block Theme beta is nothing out of the ordinary. It is essentially a base theme that allows the accompanying Genesis Blocks plugin to shine. It will also allow the development team to test ideas based on user feedback in the coming weeks and months.  Vogelpohl said they will eventually tackle full-site editing based on what they learn from the beta run&rsquo;s feedback.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 23 Nov 2020 22:11:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"BuddyPress: BuddyPress 7.0.0 Release Candidate\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=315640\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://buddypress.org/2020/11/buddypress-7-0-0-release-candidate/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2972:\"<p>Hi BuddyPress community members!</p>\n\n\n\n<p>The first<a href=\"https://downloads.wordpress.org/plugin/buddypress.7.0.0-RC1.zip\">release candidate for BuddyPress 7.0.0</a>is ready for a last round of testing!</p>\n\n\n\n<p>This is an important milestone as we progress toward the BuddyPress 7.0.0 final release date. Release Candidate means that we think the new version is ready for release, but with more than 200,000 active installs, hundreds of BuddyPress plugins, thousands of WordPress themes, and many possible specific WordPress configurations its possible we missed one or more details.</p>\n\n\n\n<p><strong>BuddyPress 7.0.0 is slated for release on December 9th, 2020</strong>. Do you want to help us get there? Here&#8217;s how you can:</p>\n\n\n\n<ol><li>This release candidate also marks the <a href=\"https://make.wordpress.org/polyglots/handbook/glossary/#string-freeze\">string freeze</a> point of the 7.0.0 release schedule, so if you you speak a language other than English, please<a href=\"https://translate.wordpress.org/projects/wp-plugins/buddypress/\">help us translate BuddyPress into many languages!</a></li><li>You are a BuddyPress Plugin and/or Theme developer? You should test your code against BuddyPress 7.0.0. If you find compatibility problems, please report a ticket on our <a href=\"https://buddypress.trac.wordpress.org/\">Trac environment</a>.</li><li>You are using BuddyPress and can easily set up a staging environment? Please use <a href=\"https://wordpress.org/plugins/bp-beta-tester/\">our Beta Tester plugin</a> or <a href=\"https://downloads.wordpress.org/plugin/buddypress.7.0.0-RC1.zip\">directly install the Release Candidate</a> on your staging site to make sure everything works as expected for you. If not: tell us what&#8217;s wrong on <a href=\"https://wordpress.slack.com/messages/buddypress\">Slack</a> or reply to this specific<a href=\"https://buddypress.org/support/topic/buddypress-7-0-0-release-candidate/\">support topic</a>with a detailed explanation of your trouble.</li><li>You are a WordPress news writer? We&#8217;d love you to share this post with your readers: the more testers, the better!</li></ol>\n\n\n\n<p><strong>It&#8217;s always best to anticipate than having a bad surprise after updating the plugin from your WordPress Dashboard</strong>: <strong><a href=\"https://codex.buddypress.org/participate-and-contribute/\">get involved</a>!</strong></p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2>What to expect from BuddyPress 7.0.0</h2>\n\n\n\n<p>First, note that <strong>BP 7.0.0 will require at least version 4.9 of WordPress</strong>. Then, read an overview of its top features in the post we published to announce the <a href=\"https://buddypress.org/2020/10/buddypress-7-0-0-beta1/\">first beta of 7.0.0</a>. If you would like more detail, you can read our <a href=\"https://bpdevel.wordpress.com/category/development-notes/7-0/\">7.0.0 developer notes</a>.</p>\n\n\n\n<p>Thanks in advance for your contributions!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 20 Nov 2020 22:15:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mathieu Viet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: Build Editor Blocks for Clients With the Genesis Custom Blocks Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108109\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:203:\"https://wptavern.com/build-editor-blocks-for-clients-with-the-genesis-custom-blocks-plugin?utm_source=rss&utm_medium=rss&utm_campaign=build-editor-blocks-for-clients-with-the-genesis-custom-blocks-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4956:\"<p class=\"has-drop-cap\">In early September, WP Engine <a href=\"https://wpengine.com/blog/introducing-genesis-custom-blocks/\">announced the launch</a> of <a href=\"https://wordpress.org/plugins/genesis-custom-blocks/\">Genesis Custom Blocks</a>, a block-creation plugin made possible by its StudioPress team. The concept should feel familiar to developers who have made use of Advanced Custom Fields and similar plugins. However, the focus of this new plugin is entirely on blocks.</p>\n\n\n\n<p>The plugin is more of a framework than a plug-and-play extension for WordPress. It requires some PHP knowledge to handle the front-end output. The goal is to make it easy for developers to create custom blocks without JavaScript knowledge. It allows them to render blocks on the server-side via custom templates.</p>\n\n\n\n<p>Genesis Custom Blocks handles all the dirty work on the backend while leaving the basic PHP, HTML, and CSS of the front end completely up to developers.</p>\n\n\n\n<p>The plugin seemed to slip through the cracks of the plugin directory&rsquo;s guideline against frameworks &mdash; the Plugin Review Team started <a href=\"https://make.wordpress.org/plugins/2016/03/01/please-do-not-submit-frameworks/\">disallowing new framework-type plugins</a> in 2016. Team rep Mika Epstein confirmed that the plugin should not have been approved. She also said that she would talk to the developers, explain why it&rsquo;s not good, and see about finding a path forward.</p>\n\n\n\n<p>Setting guideline issues aside, the plugin is a nice addition to the toolbox of any developer who needs to quickly knock out custom blocks for clients.</p>\n\n\n\n<h2>How the Plugin Works</h2>\n\n\n\n<p class=\"has-drop-cap\">Genesis Custom Blocks is currently a lightweight field manager for custom blocks. It provides an admin interface for creating, editing, and managing those blocks. Developers use this interface to essentially create block options in which a user can configure via the editor.</p>\n\n\n\n<p>The free version of the plugin includes 13 standard form fields, such as text, image, URL, color, and more. The <a href=\"https://www.studiopress.com/genesis-custom-blocks/\">commercial version</a> includes an additional six field types and allows users to import or export their custom blocks.</p>\n\n\n\n<img />Editing the test block included with the plugin.\n\n\n\n<p>For the block to output anything on the front end, the developer must create custom templates and use the Genesis Custom Blocks API. This template will render the output in the editor too, at least until the user clicks on the block, which takes them into editing mode.</p>\n\n\n\n<img />Inserting and editing a custom block in the editor.\n\n\n\n<p>Without anything other than a cursory reading of <a href=\"https://developer.wpengine.com/genesis-custom-blocks/\">the docs</a>, I was able to build a custom block and its associating template in minutes. What makes the plugin stand out is the simplicity of its system. It does not try to do too much. It provides enough basic fields for most developers to create the custom blocks they need for clients. I am certain that many of them will get a ton of mileage out of it.</p>\n\n\n\n<p>It also does the extra things that developers should expect from a StudioPress-caliber product like allowing developers to create custom block categories, pick an icon, and set up keywords for each block.</p>\n\n\n\n<p>One missing element is the ability to set custom blocks to full and wide-width. Developers may need to write custom CSS for both the editor and front end to handle such use cases. They can create custom inspector (block options sidebar) controls for width or alignment too. However, it would be a nice bonus if the plugin handled the standard WordPress alignments.</p>\n\n\n\n<h2>The Big Problem</h2>\n\n\n\n<p class=\"has-drop-cap\">The plugin commits the greatest sin of WordPress development. It fails to <a href=\"https://developer.wordpress.org/plugins/plugin-basics/best-practices/#avoid-naming-collisions\">prefix or namespace</a> its custom functions. It is a mistake that is expected of rookie developers. However, for a seasoned company such as StudioPress to create <code>block_field()</code>, <code>block_value()</code>, and similarly-named functions in the global namespace is almost unforgivable.</p>\n\n\n\n<p>The problem this creates, particularly given the size of the Genesis development community, is that it is basically stealing potential function names from WordPress. If the core platform ever decides to add these functions, fatal errors will ensue on 1,000s of sites.</p>\n\n\n\n<p>If the functions were limited in scope to the plugin itself, it would be an easy fix. However, these functions are meant for direct use by developers who are building with the plugin.</p>\n\n\n\n<p>Given the plugin&rsquo;s short time out in the wild, I hope the development team reconsiders their naming scheme and transitions it to something that does not run the risk of a future fatal error.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 20 Nov 2020 19:46:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"WPTavern: Gutenberg 9.4 Introduces Button Width Selector and Typography Controls for List Block\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108056\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:235:\"https://wptavern.com/gutenberg-9-4-introduces-button-width-selector-and-typography-controls-for-list-block?utm_source=rss&utm_medium=rss&utm_campaign=gutenberg-9-4-introduces-button-width-selector-and-typography-controls-for-list-block\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3978:\"<p><a href=\"https://make.wordpress.org/core/2020/11/19/whats-new-in-gutenberg-18-november-2/\">Gutenberg 9.4.0</a> was released this week with many small improvements to existing features, while work on full site editing continues. This release will not be included in the upcoming WordPress 5.6 release but those who are using the Gutenberg plugin will have access to the improvements right away. </p>\n\n\n\n<p>The button block now has a <a href=\"https://github.com/WordPress/gutenberg/pull/25999\">width selector</a>, which allows the user to set the button to 25%, 50%, 75%, or 100% of the parent container. By default, a button&rsquo;s width is determined by the size of its content. If you like bigger buttons, this update will give you more flexibility. Button margins are also <a href=\"https://github.com/WordPress/gutenberg/pull/26781\">included in the width calculations</a>, so users can create multiple buttons in a row, or a grid of buttons, and have them properly fit together and aligned. </p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Making a button is easier than it has ever been before. Gone are the days of using shortcodes or hunting for the correct CSS class to apply in order to match the theme. Button creation used to be so needlessly difficult with a fragmented, unfriendly workflow, but the block editor continues to chip away at the complexity with each new release.</p>\n\n\n\n<p>Version 9.4 also introduces typography controls for the list block. Gutenberg contributors have been discussing <a href=\"https://github.com/WordPress/gutenberg/issues/8171\">adding color and text size customizations to all text-based blocks</a> since 2018, and the list block is finally getting some font size controls.</p>\n\n\n\n<img />\n\n\n\n<p>Social icons can also be resized now. Users can select from several preset sizes, including small, normal, large, and huge.</p>\n\n\n\n<p>The 9.4 update adds support for &lt;kbd&gt; tags with a new button in the overflow rich text menu. These tags are useful for displaying content in the browser&rsquo;s default monospace font, which helps when writing documentation or articles with inline code.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>This release lays the groundwork for handling block variation transformations. Block variations are essentially the same block with registered variations that appear as a separate block in the block inserter. For example, the navigation block has horizontal and vertical variations. The editor now introduces a&nbsp;<code>transform</code>&nbsp;option for&nbsp;the <code>scope</code>&nbsp;field in block variations, so developers can control how to handle these transformations.</p>\n\n\n\n<p>Enhancements in this release add polish to many aspects of the UI, including the&nbsp;inserter search, custom select menu styles, the link interface, Search block styling, shortcode block styling, and reduces the UI on hover (an optional setting in preferences).</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>One handy new feature for writing is that users can now add a header by typing <code>/h1</code>&nbsp;to&nbsp;<code>/h6</code>&nbsp;followed by enter/return. While I like the idea of this, it seems unintuitive to have to use enter/return to change the block to a header. This feature would be easier to remember if it mimicked the existing feature that allows users to add a header by typing&nbsp;<code>###</code>&nbsp;followed by a space. Changing the trigger action to a space instead of a return would make more sense here.</p>\n\n\n\n<p>Version 9.4 also includes a great deal of progress behind the scenes on experiments, including the full site editing framework, FSE blocks, the site editor, and global styles. Check out the <a href=\"https://make.wordpress.org/core/2020/11/19/whats-new-in-gutenberg-18-november-2/\">changelog</a> for a full list of bug fixes and enhancements.</p>\n\n\n\n<p></p>\n\n\n\n<ul class=\"wp-block-social-links\"></ul>\n\n\n\n<div class=\"wp-block-buttons\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 20 Nov 2020 07:00:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"WPTavern: WordPress To Combine Its Long-Neglected Theme Previewer With Starter Content\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108035\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:217:\"https://wptavern.com/wordpress-to-combine-its-long-neglected-theme-previewer-with-starter-content?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-to-combine-its-long-neglected-theme-previewer-with-starter-content\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5669:\"<p class=\"has-drop-cap\">Six weeks ago, WordPress 5.6 release lead Helen Hou-Sand&iacute; breathed new life into two almost-forgotten features around the WordPress website and platform. The idea was to take the starter content feature, which themes can optionally add for new installs, and apply it to the WordPress.org theme preview system. It was not a new idea. However, it finally had some teeth because a core lead was making it a priority.</p>\n\n\n\n<p>&ldquo;I&rsquo;m revisiting this in the context of 5.6 and Twenty Twenty-One &mdash; could we possibly consider a combination of starter content (the core feature) and the existing theme unit test data (with room for more later)?&rdquo; <a href=\"https://meta.trac.wordpress.org/ticket/30#comment:66\">wrote Hou-Sand&iacute; in a ticket</a> that seemed to be going nowhere after seven years. &ldquo;I don&rsquo;t think we&rsquo;d want to have just starter content, as that should ideally be a much more limited amount of content pieces, but unifying somewhat would help with the overall goal of aligning the demo with what users can actually accomplish on their sites.&rdquo;</p>\n\n\n\n<p>Yesterday, Hou-Sand&iacute; formally <a href=\"https://make.wordpress.org/themes/2020/11/18/theme-previews-in-the-time-of-blocks/\">announced the launch</a> of the project. Currently, the <a href=\"http://wp-themes.com/twentytwentyone/\">Twenty Twenty-One</a>, <a href=\"http://wp-themes.com/twentytwenty/\">Twenty Twenty</a>, and <a href=\"http://wp-themes.com/twentyseventeen/\">Twenty Seventeen </a>demos display their respective starter content.</p>\n\n\n\n<img />Block-based starter content in the Twenty Twenty-One theme preview.\n\n\n\n<p>The initial goal was to turn the feature on selectively, testing it with a few default themes. This would give the meta team time to iron out any bugs. It would also give the Themes Team time to decide on any additional guidelines considerations before opening it to everyone.</p>\n\n\n\n<p>The Themes Team reps do not seem to think there will be any need for new guidelines, so there should not be much to do on their end.</p>\n\n\n\n<p>&ldquo;I&rsquo;m up for having a discussion about it but I do think that, in general, guidelines already cover it (we might need to reword the guideline about excluding advertising for clarity), but theme devs aren&rsquo;t gonna want to give a bad impression in their public-facing previews,&rdquo; said Themes Team representative William Patton. &ldquo;We probably want to just check the guidelines to make sure they cover things here, but from my perspective, I think guidelines already cover things quite well.&rdquo;</p>\n\n\n\n<p>This is the sort of thing that could get theme authors excited again. Themers can sometimes feel like they are second-class citizens. More often than not, plugin authors get the shiny, new toys long before &mdash; if they ever &mdash; roll out to the theme directory. It is always an exciting time when themes are shown a little love.</p>\n\n\n\n<p>Hou-Sand&iacute; pointed out that the theme previewer changes would not be forever limited to a handful of core themes. This is merely the first step.</p>\n\n\n\n<p>The big question: <em>why now?</em></p>\n\n\n\n<p>There is no doubt that the theme previewer has been a problem area for years. Users have complained about it. Theme authors and reviewers have relentlessly discussed it and called for a change. Some authors have even attempted various, hacky workarounds, sometimes finding themselves on the shortlist for banishment. At the end of the day, most people just want to see themes in all their glory. They are the face of WordPress. As Hou-Sand&iacute; wrote in the announcement, &ldquo;The theme previewer site in today&rsquo;s context does a serious disservice to themes.&rdquo;</p>\n\n\n\n<p>To answer the <em>why now</em> question, the block system has a lot to do with it. Internally, the system opens up a world of possibilities that are much easier to implement. Whether it is starter content or custom front page templates, blocks will be a huge part of the equation going forward.</p>\n\n\n\n<p>&ldquo;I also believe that between blocks, block patterns, and eventually full site editing, it is more important than ever to the broad success of the WordPress project for themes to showcase their ideal states and make it easier for users to achieve the same thing on their sites,&rdquo; wrote Hou-Sand&iacute;. &ldquo;Starter content, introduced in 4.7, was a step in this direction, but has languished for quite some time.&rdquo;</p>\n\n\n\n<p>It is also part of an ongoing rethinking of what should happen with starter content. On October 6, she <a href=\"https://make.wordpress.org/core/2020/10/06/revisiting-starter-content-on-org-and-beyond/\">opened a discussion</a> for feedback on the feature&rsquo;s future. The post received a few useful responses. However, it could still use feedback from a wider range of people involved with the WordPress project, particularly theme authors.</p>\n\n\n\n<p>I also explored some possibilities in response to that post in <a href=\"https://wptavern.com/the-future-of-starter-content-wordpress-themes-need-a-modern-onboarding-and-importing-tool\">The Future of Starter Content: WordPress Themes Need a Modern Onboarding and Importing Tool</a>.</p>\n\n\n\n<p>The biggest concern at this point should be whether theme authors consider this <em>too little too late</em>. There is a little excitement brewing from a few short conversations I have seen in theming circles. However, this is a time for theme authors to jump on board, provide feedback, and pitch in. This is the first step in gaining the sort of control over theme previews that many have long sought.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 19 Nov 2020 21:40:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: Local 5.9.2 Adds Image Optimization via New Free Add-On\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=107997\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:175:\"https://wptavern.com/local-5-9-2-adds-image-optimization-via-new-free-add-on?utm_source=rss&utm_medium=rss&utm_campaign=local-5-9-2-adds-image-optimization-via-new-free-add-on\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2426:\"<p>Local 5.9.2 was <a href=\"https://localwp.com/releases/\">released</a> this month with a new image optimization feature. The Pro version of Flywheel&rsquo;s local WordPress development product got a revamp four months ago, bringing in a new collection of pre&#8209;launch&nbsp;tools. While image optimization falls into that category, the company decided to make this new feature available to both free and pro tiers via an optional <a href=\"https://localwp.com/add-ons/local-addon-image-optimizer\">add-on</a>. </p>\n\n\n\n<p>Users can install the new add-on directly in the app and then navigate to Tools &rsaquo; Image Optimizer. After enabling the add-on and relaunching the app, Local will be able to scan the installation for image files and compress them offline, without using cloud-based services. The add-on allows users to navigate away from an active optimization session and carry on with development while it works in the background.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Before proceeding, users can also navigate to the Image Optimizer settings and elect to strip the metadata (i.e. focal length, date, time, and location) to further reduce the file size and, as a byproduct, remove potentially identifying data. The default optimization simply reduces file size and does not strip metadata.</p>\n\n\n\n<p>After optimization is complete, an overview of the total reductions and disk space saved will be displayed.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>The add-on currently uses <a href=\"https://github.com/danielgtaylor/jpeg-archive#jpeg-recompress\">jpeg-recompress</a> to optimize images, a utility from the open source <a href=\"https://github.com/danielgtaylor/jpeg-archive\">JPEG Archive</a> project. Here is how it works: </p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>Compress JPEGs by re-encoding to the smallest JPEG quality while keeping&nbsp;<em>perceived</em>&nbsp;visual quality the same and by making sure huffman tables are optimized. This is a&nbsp;<strong>lossy</strong>&nbsp;operation, but the images are visually identical and it usually saves 30-70% of the size for JPEGs coming from a digital camera, particularly DSLRs.&nbsp;</p></blockquote>\n\n\n\n<p>Local&rsquo;s development team plans to expand this in the future to add more options like lossless compression. Version 5.9.2 also fixes several bugs with the UI and adds improvements to make it more consistent. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 19 Nov 2020 03:19:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WPTavern: Should WordPress Notify Users of Plugin Ownership Changes?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=107875\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:179:\"https://wptavern.com/should-wordpress-notify-users-of-plugin-ownership-changes?utm_source=rss&utm_medium=rss&utm_campaign=should-wordpress-notify-users-of-plugin-ownership-changes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4409:\"<img />Potential idea for showing plugin ownership change.\n\n\n\n<p>That is the question posed by Ian Atkins in a <a href=\"https://meta.trac.wordpress.org/ticket/5509\">recent ticket</a> for WordPress.</p>\n\n\n\n<p>&ldquo;I&rsquo;ve experienced a few plugins change ownership, and it&rsquo;s really not clear as a user, developer, and maintainer of sites when that has happened,&rdquo; he wrote in the ticket. &ldquo;Whilst having a plugin continue to be developed is admirable &mdash; I do think it would be wise to inform users of that change.&rdquo;</p>\n\n\n\n<p>For full disclosure, the ownership change that prompted Atkins to create the ticket was from the Members plugin. I am the former owner of the plugin and sold it to the MemberPress team in 2019 (I was a full-time plugin and theme developer before joining WP Tavern). Having been both a plugin author and user in this scenario before helps mold my viewpoint.</p>\n\n\n\n<p>I agree with the idea. WordPress should have some mechanism for notifying users of changes of ownership. The more transparency that exists in the ecosystem, the healthier it is for all.</p>\n\n\n\n<p>As a plugin author who was letting go of a project that I had worked nearly a decade on, it was tough to say goodbye. I had built friendships and trusted users who walked beside me on my journey. I posted on the company blog, Twitter, Facebook, and the WordPress support forums. I replied to emails, PMs, and more. I wanted to be as transparent with my plugin users as possible. When the plugin was out of my hands, there was no way for me to reach out to the 1,000s of users who did not follow me on social media or the blog. The new owner was as transparent.  Even today, a year later, some users are just now realizing someone else is running the show.</p>\n\n\n\n<p>In hindsight, perhaps there was more we could have done. Maybe there was more WordPress could have also done and can do in the future. There are valid concerns from users.</p>\n\n\n\n<p>Atkins lists three primary reasons for his proposal:</p>\n\n\n\n<ul><li>There might be privacy policy changes that have impacts on what data is shared and how it is shared. Legally, depending on location, this may have to be communicated to end-users (under GDPR, etc.).</li><li>The plugin may change direction or add features that were not originally included or required under the stewardship of the prior owner.</li><li>The plugin may have changed hands to a developer or development house that a user knows isn&rsquo;t as reliable as the previous owner.</li></ul>\n\n\n\n<p>He also asked whether the plugin team reviewed ownership changes. <a href=\"https://developer.wordpress.org/plugins/wordpress-org/plugin-developer-faq/#how-do-i-change-the-plugin-owner\">Changing owners</a> is a simple task, and these changes are tracked internally.</p>\n\n\n\n<p>Mika Epstein, a Plugin Review Team representative, said that the team could make such changes public. The biggest flaw with that system is that it is not always possible to know when a plugin&rsquo;s owner changes. Sometimes, an entire company is sold, which would include ownership of the WordPress.org account. She also cited situations where serviceware plugins change hands in unobvious ways.</p>\n\n\n\n<p>&ldquo;I want to be clear, I&rsquo;m not against this!&rdquo; she said in a follow-up response. &ldquo;I&rsquo;m for this! I just want to be clear that we&rsquo;re going to get MAYBE half of the changes.&rdquo;</p>\n\n\n\n<p>Half would be better than none. An automated system may work to create notices in some situations. However, an addition to the plugin review guidelines may also be part of the solution.</p>\n\n\n\n<p>Plugin authors could also take it upon themselves to implement an ownership-change notification. This may be one of those use cases for the much-maligned admin notices that is worth exploring.</p>\n\n\n\n<p>At this point, we are just asking the question of whether WordPress should create a system in which users are notified of plugin ownership changes. What would you like to see in terms of solutions?</p>\n\n\n\n<p>I want to see continued progress on the transparency front. Atkins&rsquo; first list item is the most important. If there are privacy policy changes or a plugin deals with personal data in any way, users need to know when the plugin has a new owner. They should be able to make a decision about their continued use of the plugin with all the facts laid bare.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 18 Nov 2020 17:09:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:11:\"\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"HeroPress: Final Day to Apply to Speak at WordFest Live 2021\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://heropress.com/?p=3416\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:165:\"https://heropress.com/final-day-to-apply-to-speak-at-wordfest-live-2021/#utm_source=rss&utm_medium=rss&utm_campaign=final-day-to-apply-to-speak-at-wordfest-live-2021\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1008:\"<p>Friends across the globe, today is your last chance to get in your talk for WordFest Live. You only have until midnight tonight, UTC, so don&#8217;t delay!</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\"><a href=\"https://www.wordfest.live/call-for-speakers/\">Call for Speakers</a></blockquote>\n</div>\n\n\n\n<p>If you&#8217;re interested but not sure which talk to choose, learn more here: <a href=\"https://www.wordfest.live/2020/11/speaking-at-wordfest-live-2021/\">https://www.wordfest.live/2020/11/speaking-at-wordfest-live-2021/</a></p>\n\n\n\n<p>Share your knowledge across this 24 hour global celebration of WordPress. Support the team at Big Orange Heart by being involved. Let&#8217;s continue to go farther together!</p>\n<p>The post <a rel=\"nofollow\" href=\"https://heropress.com/final-day-to-apply-to-speak-at-wordfest-live-2021/\">Final Day to Apply to Speak at WordFest Live 2021</a> appeared first on <a rel=\"nofollow\" href=\"https://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 18 Nov 2020 16:10:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"WPTavern: WordPress.com Gives Conservative Treehouse the Boot, Citing TOS Violations\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=107926\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:211:\"https://wptavern.com/wordpress-com-gives-conservative-treehouse-the-boot-citing-tos-violations?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-com-gives-conservative-treehouse-the-boot-citing-tos-violations\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4931:\"<p>The Conservative Treehouse, a political publication hosted on WordPress.com for the past 10 years, is <a href=\"https://theconservativetreehouse.com/2020/11/15/the-treehouse-is-deplatformed/\">moving to a new host</a> after receiving a notice from Automattic regarding violations of its Terms of Service. The site&rsquo;s owner, previously identified as Florida resident Mark Bradman, claims to have a 500,000 &ndash; 1,000,000 unique readers per day. He has been ordered to find a new hosting provider and migrate the site away from WordPress.com by December 2, 2020.</p>\n\n\n\n<p>Bradman followed up with Automattic to inquire about the specific infractions that put the site in violation of <a href=\"https://wordpress.com/automattic-ads-tos/\">Automattic Ads Terms of&nbsp;Service</a>. A representative from WordPress.com referred him to Section 5&rsquo;s guidelines on &ldquo;Prohibited Content,&rdquo; and the prohibition against calls to violence in <a href=\"https://wordpress.com/support/user-guidelines/\">WordPress.com&rsquo;s User Guidelines</a>. </p>\n\n\n\n<div class=\"wp-block-image\"><img />Source: <a href=\"https://theconservativetreehouse.com/2020/11/16/update-from-wordpress-automattic-on-treehouse-deplatforming/\">The Conservative Treehouse</a></div>\n\n\n\n<p>The Conservative Treehouse was characterized by <a href=\"https://www.thedailybeast.com/meet-the-conservative-treehouse-the-blog-thats-ground-zero-for-insane-trump-sht\">The Daily Beast</a> as &ldquo;Patient Zero for a number of hoaxes that have percolated through [the] right-wing media ecosystem&rdquo; after President Trump <a href=\"https://twitter.com/realDonaldTrump/status/1270333484528214018?s=20\">tweeted</a> a conspiracy theory that originated on the site. Trump referenced an incident in Buffalo where police officers shoved an elderly protestor during the anti-police brutality protests that happened in June. The notion that the protester was an &ldquo;ANTIFA provacateur&rdquo; was originally seeded by an <a href=\"https://theconservativetreehouse.com/2020/06/06/buffalo-officials-duped-by-professional-antifa-provocateur-arrest-and-charge-two-police-officers-righteous-police-team-stand-together-and-walk-out/\">article</a> on The Conservative Treehouse.</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Buffalo protester shoved by Police could be an ANTIFA provocateur. 75 year old Martin Gugino was pushed away after appearing to scan police communications in order to black out the equipment. <a href=\"https://twitter.com/OANN?ref_src=twsrc%5Etfw\">@OANN</a>  I watched, he fell harder than was pushed. Was aiming scanner. Could be a set up?</p>&mdash; Donald J. Trump (@realDonaldTrump) <a href=\"https://twitter.com/realDonaldTrump/status/1270333484528214018?ref_src=twsrc%5Etfw\">June 9, 2020</a></blockquote>\n</div>\n\n\n\n<p>A cursory review of the past several months of posts on the anonymous blog shows it is home to a steady stream of misinformation. <a href=\"https://www.newsguardtech.com/\">NewsGuard</a>, an organization that assigns trust ratings based on transparent <a href=\"https://www.newsguardtech.com/ratings/rating-process-criteria/\">criteria</a>, recommends readers proceed with caution because the website &ldquo;severely violates basic journalistic standards.&rdquo; The Conservative Treehouse gets a rating of <a href=\"https://www.newsguardtech.com/wp-content/uploads/2020/06/ConservativeTreeHouse-1.pdf\">30/100</a> due to publishing false information and unsubstantiated conspiracy theories on numerous topics:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>Because The Conservative Treehouse has published false and misleading claims, including about the COVID-19 pandemic, NewsGuard has determined that the website repeatedly publishes false content and does not gather and present information responsibly.</p></blockquote>\n\n\n\n<p>Bradman said he received the notification about the website being removed after publishing his post on what he calls &ldquo;<a href=\"https://theconservativetreehouse.com/2020/11/13/covid-19-is-the-agenda-biden-is-merely-the-delivery-vehicle/\">the COVID-19 agenda</a>.&rdquo; The conclusion of the article includes an image of a knife with the word &ldquo;resist&rdquo; written on it, followed by the words &ldquo;whatever it takes.&rdquo; The site&rsquo;s comments are home to a &ldquo;Rag Tag Bunch of Conservative Misfits,&rdquo; as the tagline suggests, and there are more than 1,800 comments on the post announcing its upcoming move to a new host.</p>\n\n\n\n<p>Despite the publication&rsquo;s poor reputation, the site ranks #3,294 in the US, according to Alexa, with a largely American audience. Its owner claims to have more than 200,000 subscribers.</p>\n\n\n\n<p>&ldquo;We will take this challenge head-on and we will use this attack against our freedom as fuel to launch CTH 2.0, a new version of The Conservative Treehouse,&rdquo; Bradman said.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 18 Nov 2020 05:24:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"WordPress.org blog: WordPress 5.6 Release Candidate\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9258\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://wordpress.org/news/2020/11/wordpress-5-6-release-candidate/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3347:\"<p>The first release candidate for WordPress 5.6 is now available!</p>\n\n\n\n<p>This is an important milestone in the communitys progress toward the final release of WordPress 5.6.</p>\n\n\n\n<p>Release Candidate means that the new version is ready for release, but with millions of users and thousands of plugins and themes, its possible something was missed. WordPress 5.6 is slated for release&nbsp;on&nbsp;<strong>December 8, 2020</strong>, but we need&nbsp;<em>your</em>&nbsp;help to get thereif you havent tried 5.6 yet,&nbsp;<strong>now is the time</strong>!</p>\n\n\n\n<p>You can test the WordPress 5.6 release candidate in two ways:</p>\n\n\n\n<ul><li>Try the<a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a>plugin (choose the Bleeding edge&#8221; channel and Beta/RC Only stream options)</li><li>Or<a href=\"https://wordpress.org/wordpress-5.6-RC1.zip\">download the release candidate here (zip)</a>.</li></ul>\n\n\n\n<p>Thank you to all of the contributors who tested the&nbsp;Beta releases and gave feedback. Testing for bugs is a critical part of polishing every release and a great way to contribute to WordPress.</p>\n\n\n\n<h2>Whats in WordPress 5.6?</h2>\n\n\n\n<p>The final release of 2020 continues the annual tradition of a new default theme that is custom built to showcase the new features and functionality of the software. Continued progress on the block editor is especially clear in this release, which brings more blocks to more places, and fewer clicks to implement your layouts.</p>\n\n\n\n<p>WordPress 5.6 also has lots of refinements to polish the developer experience. To learn more, subscribe to the&nbsp;<a href=\"https://make.wordpress.org/core/\">Make WordPress Core blog</a>&nbsp;and pay special attention to the&nbsp;<a href=\"https://make.wordpress.org/core/tag/5-6+dev-notes/\">developer notes</a>&nbsp;tag for updates on those and other changes that could affect your products.</p>\n\n\n\n<h2>Plugin and Theme Developers</h2>\n\n\n\n<p>Please test your plugins and themes against WordPress 5.6 and update the&nbsp;<em>Tested up to</em>&nbsp;version in the readme file to 5.6. If you find compatibility problems, please be sure to post to the&nbsp;<a href=\"https://wordpress.org/support/forum/alphabeta/\">support forums</a>,&nbsp;so those can be figured out before the final release.</p>\n\n\n\n<p>The&nbsp;WordPress 5.6 Field Guide, due very shortly, will give you a more detailed dive into the major changes.</p>\n\n\n\n<h2>How to Help</h2>\n\n\n\n<p>Do you speak a language other than English?&nbsp;<a href=\"https://translate.wordpress.org/projects/wp/dev\">Help us translate WordPress into more than 100 languages!</a>&nbsp;This release also marks the&nbsp;<a href=\"https://make.wordpress.org/polyglots/handbook/glossary/#hard-freeze\">hard string freeze</a>&nbsp;point of the 5.6 release schedule.</p>\n\n\n\n<p><em><strong>If you think youve found a bug</strong>, you can post to the&nbsp;<a href=\"https://wordpress.org/support/forum/alphabeta\">Alpha/Beta area</a>&nbsp;in the support forums. Wed love to hear from you! If youre comfortable writing a reproducible bug report,&nbsp;<a href=\"https://make.wordpress.org/core/reports/\">file one on WordPress Trac</a>, where you can also find&nbsp;<a href=\"https://core.trac.wordpress.org/tickets/major\">a list of known bugs</a>.</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 17 Nov 2020 22:43:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Josepha\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"WPTavern: Proposal to Create an Expanded View or Overlay for the Block Patterns Inserter\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=107663\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:221:\"https://wptavern.com/proposal-to-create-an-expanded-view-or-overlay-for-the-block-patterns-inserter?utm_source=rss&utm_medium=rss&utm_campaign=proposal-to-create-an-expanded-view-or-overlay-for-the-block-patterns-inserter\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5954:\"<p class=\"has-drop-cap\">The &ldquo;version 1.0&rdquo; launch of block patterns in WordPress 5.5 was overall successful. However, it was easy to overlook the problems while waiting for this feature to land after months of anticipation. Now that we have had a couple of months of seeing the block pattern system baked into core WordPress, it is time to address issues that are becoming more evident.</p>\n\n\n\n<p>As much as I love block patterns as a feature, I cannot say the same for the user interface and overall experience. The pattern category dropdown <a href=\"https://wptavern.com/gutenberg-9-1-adds-patterns-category-dropdown-and-reverts-block-based-widgets-in-the-customizer\">added in Gutenberg 9.1</a> was a marked improvement over the endless list of patterns. However, it did not go far enough in presenting them in a user-friendly way.</p>\n\n\n\n<p>WordPress has long had a habit of sticking too much into a tiny panel &mdash; many theme authors never felt like the customizer panel <a href=\"https://wptavern.com/wordpress-org-now-requires-theme-authors-to-use-the-customizer-to-build-theme-options#comment-68451\">offered enough space</a>, for example. The same seems to be the case for the block editor&rsquo;s inserter panel. It is good enough for allowing end-users to pick and choose blocks. However, patterns are much larger than the smaller block icons. When users start scrolling through dozens of patterns at a time in the coming months and years, it will become a usability nightmare.</p>\n\n\n\n<p>Paal Joachim Romdahl is <a href=\"https://github.com/WordPress/gutenberg/issues/26905\">proposing an alternative</a>. His idea is to add an &ldquo;expander&rdquo; icon/button that would allow users to view more patterns at once via an overlay. At least this would be the case for larger screen sizes, such as desktop users.</p>\n\n\n\n<p>&ldquo;Viewing a lot of patterns in the small inserter panel does not work too well,&rdquo; he wrote in the GitHub ticket. &ldquo;It gets tiring needing to scroll one pattern at a time. Having a larger view will help the user to compare multiple patterns at once.&rdquo;</p>\n\n\n\n<img src=\"https://user-images.githubusercontent.com/5323259/99002124-46249480-253c-11eb-83bd-7524790f3b66.gif\" alt=\"Preview of how the current pattern overlay proposal would work.\" />Current pattern overlay proposal.\n\n\n\n<p>Romdahl has also created a <a href=\"https://www.figma.com/proto/TuDKX6ckaecNARP2B8NWp4/Expand-to-view-patterns-in-a-larger-overlay-window?node-id=3%3A49&scaling=min-zoom\">Figma prototype</a> for people to test what the system would look like in a live demo. The UI is not polished, but it looks like a promising start.</p>\n\n\n\n<p>He created the proposal after reading the Tavern&rsquo;s recent coverage of WordPress.com&rsquo;s <a href=\"https://wptavern.com/wordpress-com-drops-over-100-block-patterns-carving-a-path-the-design-community-should-follow\">launch of over 100 block patterns</a>. Some of the pattern categories are easy to work through and find the right layout. Others, such as the Text and Call to Action categories, may have 20 or more patterns to scroll through.</p>\n\n\n\n<img />Inserting a block pattern on WordPress.com.\n\n\n\n<p>If WordPress creates an official block pattern directory, which is <a href=\"https://wptavern.com/wordpress-contributors-discuss-launching-an-official-block-pattern-directory\">currently under consideration</a>, adding new patterns could be as simple as clicking a button. It would be an easy way to rack up dozens of patterns in moments, particularly if a user is trying out various layouts and does not uninstall unused patterns afterward.</p>\n\n\n\n<p>Not many users are exposed to the hundreds of patterns WordPress.com&rsquo;s users have access to. We should move forward with this proposal before they are.</p>\n\n\n\n<p>An overlay for inserting patterns and templates is not a new concept. It is common in the WordPress development community. Plugin and theme developers solved this problem ages ago.</p>\n\n\n\n<p>The Redux plugin <a href=\"https://wptavern.com/redux-framework-relaunches-focuses-efforts-on-gutenberg-templates\">handles hundreds of templates</a> with an overlay:</p>\n\n\n\n<img />Viewing templates from the Redux library.\n\n\n\n<p>The Layout block from the <a href=\"https://wptavern.com/atomic-blocks-rebranded-to-genesis-blocks-migration-path-to-new-plugin-coming-soon\">Genesis Blocks plugin</a> is essentially just a custom pattern inserter with a much nicer UI than WordPress:</p>\n\n\n\n<img />Overlay created by the Layout block from Genesis Blocks.\n\n\n\n<p>Mikael Korpela <a href=\"https://github.com/WordPress/gutenberg/issues/21080#issuecomment-710055158\">added similar thoughts</a> to a ticket related to the next steps for the inserter. He proposed a full-screen experience for browsing patterns.</p>\n\n\n\n<p>&ldquo;The patterns sidebar is great if you just want to keep it open while you modify your page, but it&rsquo;s harder for browsing because of limited space, especially when you&rsquo;ve registered a lot of patterns,&rdquo; he wrote in the ticket.</p>\n\n\n\n<p>He shared an image of how Sections on Squarespace are handled:</p>\n\n\n\n<img />Selecting a Section on the Squarespace website.\n\n\n\n<p>An overlay might also help drive the pattern directory proposal. It would be easy enough at that point to create a new tab in the overlay interface, hook into the WordPress.org API, and allow users to browse through installable patterns &mdash; no need to leave the comfort of the block editor.</p>\n\n\n\n<p>Another common feature that many of these types of systems share is a way to save patterns as favorites. This makes them easy to locate in the future. Paul Lacey makes the same argument in <a href=\"https://youtu.be/0nT_41mxTsw?t=3047\">episode #136</a> of the WP Builds Weekly WordPress News podcast. He wants his clients to have easy access to their most-used block patterns. This would be a nice bonus to help clean up the block patterns user experience.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 17 Nov 2020 21:02:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"WPTavern: WPGraphQL 1.0 Released, Now Available in WordPress.org Plugins Directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=107827\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:207:\"https://wptavern.com/wpgraphql-1-0-released-now-available-in-wordpress-org-plugins-directory?utm_source=rss&utm_medium=rss&utm_campaign=wpgraphql-1-0-released-now-available-in-wordpress-org-plugins-directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4075:\"<p><a href=\"https://www.wpgraphql.com/2020/11/16/announcing-wpgraphql-v1/\">Version 1.0</a> of the <a href=\"https://wordpress.org/plugins/wp-graphql/\">WPGraphQL plugin</a> is now available in the official plugins directory on WordPress.org. This is the first stable version recommended for use in production, landing nearly four years from when the project started in November 2016. </p>\n\n\n\n<p>In an effort to keep WPGraphQL in line with WordPress&rsquo; commitment to preserving backwards compatibility, Jason Bahl, the creator and maintainer, held it off from a 1.0 release until he could minimize the potential for breaking changes.</p>\n\n\n\n<p>&ldquo;WPGraphQL turning 1.0 isn&rsquo;t a statement that there will never be breaking changes, instead it&rsquo;s a statement of stability and long term support,&rdquo; Bahl said.</p>\n\n\n\n<p>WPGraphQL has already had quite a bit of real world usage ahead of its first stable release. The plugin is in use on high profile sites like <a href=\"https://qz.com/\">QZ.com</a>,  <a href=\"https://denverpost.com/\">DenverPost.com</a>, and <a href=\"https://apollographql.com/blog\">ApolloGraphQL.com</a>. Installs of WPGraphQL grew from 50,000 in June 2020, to 71,573 installs in November 2020, according to <a href=\"https://packagist.org/packages/wp-graphql/wp-graphql\">Packagist.org</a>. Having the plugin available on WordPress.org will make it easier for users to install it and keep it updated.</p>\n\n\n\n<p>&ldquo;One of the big reasons I didn&rsquo;t want WPGraphQL on the .org repo was that the nature of it being an API could expose sites to potential security vulnerabilities,&rdquo; Bahl said. &ldquo;As we worked on stabilizing the plugin I wanted it to be a pretty conscious decision to add a GraphQL API to your WordPress site. Leaving the plugin on Github meant that the audience finding it and installing it was a more technical audience and could do at least some of the technical vetting to make sure it made sense for their project.&rdquo;</p>\n\n\n\n<p>In September, <a href=\"https://www.gatsbyjs.com/\">Gatsby</a>, the company that sponsors Bahl&rsquo;s time on WPGraphQL&rsquo;s development and maintenance, hired Pen Test Partners to perform an audit of the plugin and has resolved all the issues they discovered. The full report and resolutions will be published to the project&rsquo;s website soon.</p>\n\n\n\n<p>&ldquo;Now that the plugin is stable and secure, we&rsquo;re happy to have it on the WordPress.org repo where users will be able to find it by searching for plugins in the repo and take advantage of some new features of WordPress such as auto-updates,&rdquo; Bahl said.</p>\n\n\n\n<p>The 1.0 release does not contain any technical changes &ndash; it simply bumps the version number. The project has been publishing pre-1.0 releases leading up to this, logging 33 <a href=\"https://github.com/wp-graphql/wp-graphql/releases\">releases</a> in the past 12 months. Bahl said the biggest difference between 1.0 and pre-1.0 is the new <a href=\"https://www.wpgraphql.com/\">WPGraphQL.com</a> website. Previously, the project&rsquo;s documentation was hosted on a subdomain but it is now been rolled into the main site.</p>\n\n\n\n<p>&ldquo;Previously, <a rel=\"noreferrer noopener\" href=\"https://t.co/s062Bpz09o?amp=1\" target=\"_blank\">WPGraphQL.com</a> was a traditional WordPress site with the front-end using the classic WordPress theme layer,&rdquo; Bahl said. &ldquo;The new site is built with WordPress as the CMS, Gutenberg as the content editor, Gatsby as the front-end, and WPGraphQL as the layer that allows Gatsby and WordPress to communicate with each other. We&rsquo;re dogfooding our own technology.&rdquo;</p>\n\n\n\n<p>The project has also added close to 300 pages of new documentation. It includes a <a href=\"https://www.wpgraphql.com/developer-reference/\">Developer Reference</a> section with documentation on Actions, Filters, and Functions for customizing and extending WPGraphQL, along with a new <a href=\"https://www.wpgraphql.com/recipes/\">Recipes</a> section with code snippets for implementing solutions faster.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 16 Nov 2020 23:40:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"WPTavern: The Plus Addons for Gutenberg Plugin to Launch Soon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=106267\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:167:\"https://wptavern.com/the-plus-addons-for-gutenberg-plugin-to-launch-soon?utm_source=rss&utm_medium=rss&utm_campaign=the-plus-addons-for-gutenberg-plugin-to-launch-soon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6548:\"<p class=\"has-drop-cap\">WordPress development company POSIMYTH is getting set to announce its venture into block development in the coming days.  The new plugin, <a href=\"https://theplusaddons.com/gutenberg/\">The Plus Addons for Gutenberg</a>, is a collection of blocks, templates, and additional features for building sites with the block editor. The plugin is currently awaiting review for inclusion in the WordPress.org plugin directory. I was able to snag a test version and have been using it for around a week.</p>\n\n\n\n<p>The POSIMYTH team began working as an outsourcing agency in 2013. Since then, it has worked on over 1,000 projects. The company eventually began building WordPress themes and plugins for the Envato Marketplace. It has continued to grow and currently serves more than 50,000 customers.</p>\n\n\n\n<p>&ldquo;Being an outsourcing company in the past, we have always felt the need for one-stop solutions for agencies and freelancers,&rdquo; said Sagar Patel, the founder and director at POSIMYTH Innovations. &ldquo;We have built many Gutenberg field components from scratch as well as in-depth options in blocks, which will not just be for simple tasks, it will be for complex layouts and options as well.&rdquo;</p>\n\n\n\n<p>One of the company&rsquo;s most-used products is its <a href=\"https://wordpress.org/plugins/the-plus-addons-for-elementor-page-builder/\">The Plus Addons for Elementor</a> plugin. The free version currently has over 9,000 active installations. Patel describes it as a &ldquo;complete package&rdquo; for building Elementor-based websites.</p>\n\n\n\n<p>&ldquo;Our Gutenberg version will be kind of a recreation of our Elementor version, but on top of that, we are adding more options and features based on our feedback from Elementor users,&rdquo; he said. &ldquo;Some blocks are completely revamped and made with a unique concept, but some are just a recreation of the Elementor version. For example, our Popup Builder, Countdown, Global Features, and some others are completely made from scratch with a new structure.&rdquo;</p>\n\n\n\n<p>The company recently surveyed over 1,000 its users. One of the points they noted is that many of those users wanted to use WordPress&rsquo;s built-in block editor. However, they were unable to find reliable options for building complex websites. The results of this survey are one of the primary reasons the company is building this plugin.</p>\n\n\n\n<h2>The Plugin</h2>\n\n\n\n<img />TP Row block for building columns.\n\n\n\n<p class=\"has-drop-cap\">The free version of The Plus Addons for Gutenberg will launch with 29 blocks, 16 of which are free and 13 <em>freemium</em> ones with commercial upgrades. The commercial/pro version of the plugin will add an extra 11 blocks along with several shapes, tooltips, effects, and other options. Pricing is expected to start at $39 per year for its lowest tier.</p>\n\n\n\n<p>The plugin also has global color and typography options. These should not be confused with WordPress&rsquo;s upcoming Global Styles system. The two features work similarly. However, the plugin&rsquo;s system only works with its blocks instead of the entire website.</p>\n\n\n\n<p>The terminology could pose some confusion for users. There will also be some crossover between the two systems, both handling the same needs. Patel said he is aware of this and will always work to make sure the plugin respects WordPress&rsquo;s built-in Global Styles system. &ldquo;We will always keep that in sync with our global options,&rdquo; he said. &ldquo;It&rsquo;s still in the initial stage. We will keep on updating based on feedback from users and as per the updates of the Gutenberg team.&rdquo;</p>\n\n\n\n<p>Many of the block options are similar to what <a href=\"https://wptavern.com/editorplus-introduces-its-first-blocks-and-adds-a-custom-block-creator\">Editor Plus</a> is doing for the core WordPress blocks. However, the options are for the plugin&rsquo;s custom blocks only. The UI feels polished enough that you feel like the design team has been here before and knows what it is doing. Some plugins do not get to that point until version 2 or 3. I was able to navigate the block options with ease.</p>\n\n\n\n<p>However, some blocks were out of place. For example, the Style Lists block could have simply been custom options tacked onto the WordPress List block. Adding list items in the block sidebar is not as natural as in the editor&rsquo;s content area. The end-goal is to simply make a standard list. Everything else is simply eye-candy. Ideally, the plugin would relegate those options to the core block.</p>\n\n\n\n<p>The same could be said of the Blockquote, TP Button, TP Image, and others. These could be extensions of the core WordPress blocks. Other blocks like the TP Heading, TP Paragraph, and Testimonials might be better served as custom patterns.</p>\n\n\n\n<img />Adding a testimonial from the plugin to the editor.\n\n\n\n<p>The concept of building custom, in-house blocks seems to be more prevalent each day as more plugin companies release block libraries. The trend will likely continue. The block system is reasonably extendable. <em>Recreating the wheel</em> is unnecessary.</p>\n\n\n\n<p>The Plus Addons for Gutenberg&rsquo;s blocks are well done, and it is hard to fault a plugin for having a consistent experience across its custom blocks.</p>\n\n\n\n<p>Overall, the plugin does not offer any groundbreaking ideas for new blocks. Most of these are available in other, similar block libraries. What sets this plugin apart is the development team&rsquo;s work on packing a ton of block options into an easy-to-use interface.</p>\n\n\n\n<p>Patel said he does not consider the team to be in competition with anyone else in the market. &ldquo;We are on a mission to provide a one-stop solution for all needs of WordPress website designers and developers.&rdquo; The goal is to make it easy for freelancers and agencies to build complex layouts in the block editor without writing code.</p>\n\n\n\n<p>The project&rsquo;s website currently touts the availability of predesigned templates. The team decided not to include this feature in its initial free version, focusing on the other features in the plugin instead. Patel wants to assure users that templates will be available in both the free and pro versions of the plugin.</p>\n\n\n\n<p>&ldquo;[Templates] will be available in a couple of months or early after the initial free version&rsquo;s launch,&rdquo; he said. &ldquo;We will have UI blocks, homepage templates, as well as full-site demos with multiple pages in that.&rdquo;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 16 Nov 2020 22:32:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"WPTavern: Google Webmasters Central Rebrands to Google Search Central\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=107724\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:183:\"https://wptavern.com/google-webmasters-central-rebrands-to-google-search-central?utm_source=rss&utm_medium=rss&utm_campaign=google-webmasters-central-rebrands-to-google-search-central\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2395:\"<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Twenty years ago, every aspect of developing a website and putting it online was more complex than it is today &ndash; an enchantment of Merlin&rsquo;s wand to most common folks. The term &ldquo;webmaster&rdquo; hasn&rsquo;t aged well, but it was commonly used in a different era when tech wizards were the only people creating and managing websites. The term has become outmoded as online publishing and website building has become more user-friendly.</p>\n\n\n\n<p>Google recently ran a study that showed usage of the term webmaster is in sharp decline, as web professionals now prefer more specialized terms, such as blogger, developer, SEO, or online marketer. In recognition of this change, the company is <a href=\"https://webmasters.googleblog.com/2020/11/goodbye-google-webmasters.html\">rebranding</a> &ldquo;Google Webmasters Central&rdquo; to &ldquo;Google Search Central.&rdquo; The change will be rolled out to Google&rsquo;s websites and social media within the next couple days.</p>\n\n\n\n<p>In addition to the rebranding, Google is also centralizing its help information on one site and consolidating its blogs:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>Moving forward, the&nbsp;<a href=\"https://support.google.com/webmasters\">Search Console Help Center</a>&nbsp;will contain only documentation related to using Search Console. It&rsquo;s also still the home of our help forum, newly renamed from &ldquo;Webmasters Help Community&rdquo; to &ldquo;<a href=\"https://support.google.com/webmasters/community\">Google Search Central Community</a>&ldquo;. The information related to how Google Search works, crawling and indexing, Search guidelines, and other Search-related topics are moving to&nbsp;<a href=\"https://developers.google.com/search\">our new site</a>, which previously focused only on web developer documentation.&nbsp;</p></blockquote>\n\n\n\n<p>The Google Webmasters blog and 13 other localized blogs are being moved to the new site for better discovery and easier language switching. Google is going to redirect current RSS and email subscribers to the new blog URL, so readers only need to update their bookmarks.</p>\n\n\n\n<p>Google is also introducing a new jumping spider bot to accompany its Googlebot mascot in crawling the internet. The creature doesn&rsquo;t yet have a nickname, but the company is soliciting suggestions.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 13 Nov 2020 22:46:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"WordPress.org blog: WordPress 5.6 Beta 4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9249\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2020/11/wordpress-5-6-beta-4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5476:\"<p>WordPress 5.6 Beta 4 is now available for testing!</p>\n\n\n\n<p><strong>This software is still in development,</strong>&nbsp;so we recommend that you run this version on a test site.</p>\n\n\n\n<p>You can test the WordPress 5.6 beta in two ways:</p>\n\n\n\n<ul><li>Try the<a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a>plugin (choose the bleeding edge nightlies option).</li><li>Or<a href=\"https://wordpress.org/wordpress-5.6-beta4.zip\">download the beta here(zip)</a>.</li></ul>\n\n\n\n<p>The current target for the final release is December 8, 2020. This is justover<strong> three weeks away</strong>, so your help is needed to ensure this release is tested properly.</p>\n\n\n\n<p>Thank you to all of the contributors that tested the<a href=\"https://wordpress.org/news/2020/11/wordpress-5-6-beta-3/\">beta 3</a>development release and provided feedback. Testing for bugs is an important part of polishing each release and a great way to contribute to WordPress.</p>\n\n\n\n<h2><strong>Some Highlights</strong></h2>\n\n\n\n<p>Sincebeta 3,<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://core.trac.wordpress.org/query?status=closed&changetime=11%2F04%2F2020..11%2F12%2F2020&milestone=5.6&group=component&col=id&col=summary&col=owner&col=type&col=priority&col=component&col=version&order=priority\">42 bugs</a>have been fixed. Here is a summary of a few changes included in beta 4:</p>\n\n\n\n<ul><li>There was a change to the auto-updates implementation for new installations of the software (<a href=\"https://core.trac.wordpress.org/ticket/50907\">#50907</a>). <em><a href=\"https://make.wordpress.org/core/2020/11/10/upgrade-install-component-meeting-summary-november-10-2020/\">Next steps</a>, and <a href=\"https://make.wordpress.org/core/2020/11/10/wp5-6-auto-update-implementation-change/\">rationale</a> are both available.</em></li><li>Added better handling of unexpected values in Site Health (<a href=\"https://core.trac.wordpress.org/ticket/50145\">#50145</a>).</li><li>Added a way for developers to filter the available authors list in Quick Edit (<a href=\"https://core.trac.wordpress.org/ticket/47685\">#47685</a>).</li><li>More accessible handling of the tag cloud widget (<a href=\"https://core.trac.wordpress.org/ticket/51455\">#51455</a>).</li><li><a href=\"https://core.trac.wordpress.org/query?status=closed&changetime=11%2F04%2F2020..11%2F12%2F2020&component=Media&milestone=5.6&group=component&col=id&col=summary&col=owner&col=type&col=priority&col=component&col=version&order=priority\">Multiple improvements in the Media component</a>.</li><li><a href=\"https://core.trac.wordpress.org/query?status=closed&changetime=11%2F04%2F2020..11%2F12%2F2020&component=Build%2FTest+Tools&milestone=5.6&group=component&col=id&col=summary&col=owner&col=type&col=priority&col=component&col=version&order=priority\">Multiple improvements in the Build/Test Tools component</a>.</li></ul>\n\n\n\n<p><em>To see all of the features for each Gutenberg release in detail, check out the release posts:<a href=\"https://make.wordpress.org/core/2020/07/22/whats-new-in-gutenberg-july-22/\">8.6</a>,<a href=\"https://make.wordpress.org/core/2020/08/05/whats-new-in-gutenberg-august-5/\">8.7</a>,<a href=\"https://make.wordpress.org/core/2020/08/19/whats-new-in-gutenberg-august-19/\">8.8</a>,<a href=\"https://make.wordpress.org/core/2020/09/03/whats-new-in-gutenberg-2-september/\">8.9</a>,<a href=\"https://make.wordpress.org/core/2020/09/16/whats-new-in-gutenberg-16-september/\">9.0</a>,<a href=\"https://make.wordpress.org/core/2020/10/01/whats-new-in-gutenberg-30-september/\">9.1</a>,<a href=\"https://make.wordpress.org/core/2020/10/21/whats-new-in-gutenberg-21-october/\">9.2</a>, and<a href=\"https://github.com/WordPress/gutenberg/releases/tag/v9.3.0-rc.1\">9.3</a>.</em></p>\n\n\n\n<h2 id=\"block-76156b2b-0a52-4502-b585-6cbe9481f55b\">Developer notes</h2>\n\n\n\n<p id=\"block-3fe5e264-0a95-4f12-9a18-0cb9dc5955d1\">WordPress 5.6 has lots of refinements to the developer experience. To keep up, subscribe to the<a href=\"https://make.wordpress.org/core/\">Make WordPress Core blog</a>and pay special attention to the<a href=\"https://make.wordpress.org/core/tag/5-6+dev-notes/\">developers notes</a>for updates on those and other changes that could affect your products.</p>\n\n\n\n<h2 id=\"block-bc89fd56-47b0-439f-8e2c-4a642c80a616\">How to Help</h2>\n\n\n\n<p id=\"block-9d871099-ec49-446c-8322-9e49b7498c10\">If you think youve found a bug, you can post to the&nbsp;<a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta area</a>&nbsp;in the support forums. Wed love to hear from you!</p>\n\n\n\n<p id=\"block-bd71c1d3-39d9-4b2a-8193-3486497b45fd\">If youre comfortable writing a reproducible bug report,&nbsp;<a href=\"https://core.trac.wordpress.org/newticket\">file one on WordPress Trac</a>,&nbsp;where you can also find a list of&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=new&milestone=5.6&group=component&col=id&col=summary&col=owner&col=type&col=priority&col=component&col=version&order=priority\">known bugs</a>.</p>\n\n\n\n<p><em>Props to @tonyamork,@audrasjbfor technical notes and@angelasjin,<em></em><a href=\"https://profiles.wordpress.org/yvettesonneveld/\">@yvettesonneveld</a><em>,</em><a href=\"https://profiles.wordpress.org/cguntur/\">@cguntur</a>, <a href=\"https://profiles.wordpress.org/cbringmann/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>cbringmann</a> for final review.</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 12 Nov 2020 23:49:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Josepha\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:150:\"WPTavern: Envato Passes $1 Billion in Community Earnings While Continuing to Aggressively Market Its Elements Subscription Against Marketplace Authors\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=107668\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:343:\"https://wptavern.com/envato-passes-1-billion-in-community-earnings-while-continuing-to-aggressively-market-its-elements-subscription-against-marketplace-authors?utm_source=rss&utm_medium=rss&utm_campaign=envato-passes-1-billion-in-community-earnings-while-continuing-to-aggressively-market-its-elements-subscription-against-marketplace-authors\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:16409:\"<p>Envato has <a href=\"https://forums.envato.com/t/we-ve-reached-1-billion-in-community-earnings/340756\">passed $1 billion in community earnings</a> after 14 years in business. The company reached the goal a year earlier than anticipated, thanks to the contributions of 81,000 different creators around the globe and millions of customers who have purchased products from <a rel=\"noreferrer noopener\" href=\"https://themeforest.net/\" target=\"_blank\">Envato Market</a>,&nbsp;<a rel=\"noreferrer noopener\" href=\"https://studio.envato.com/\" target=\"_blank\">Envato Studio</a>,&nbsp;<a href=\"https://tutsplus.com/\">Envato Tuts+</a>&nbsp;and&nbsp;<a href=\"https://elements.envato.com/\">Envato Elements</a>.</p>\n\n\n\n<p>&ldquo;To this day, we&rsquo;re very proud that our community earns more money than our company does,&rdquo; Envato co-founder Collis Ta&rsquo;eed said. Last month Ta&rsquo;eed stepped down from his position as CEO to pursue a new ethical chocolate e-commerce <a href=\"https://heytiger.com.au/\">venture</a>. He was replaced by former HotelsCombined.com CEO, Hichame Assi. </p>\n\n\n\n<p>Due to the pandemic, the Australian tech company recently transitioned to all employees working from home during the global lockdown.&nbsp;Along with the announcement of Ta&rsquo;eed&rsquo;s exit, Envato delivered a 20% profit share payout, totaling $3.75m AUD, to its 630-person workforce. The company reported that this is an increase on the 10% allocation from the previous financial year. </p>\n\n\n\n<p>&ldquo;Profit share has become an integral part of Envato and helps connect the team with a share of the success they create through their efforts,&rdquo; Ta&rsquo;eed said. </p>\n\n\n\n<p>During the past several years, the company has focused heavily on driving profits through Envato Elements, its subscription service. Ta&rsquo;eed said the business is now &ldquo;more subscription oriented than at any time in our history.&rdquo;</p>\n\n\n\n<p>One WordPress plugin author, who sells on Codecanyon, <a href=\"https://forums.envato.com/t/we-ve-reached-1-billion-in-community-earnings/340756/18\">commented</a> on the milestone post, urging Envato to renew its focus on the marketplaces. </p>\n\n\n\n<p>&ldquo;Please focus on the marketplaces as well,&rdquo; FWDesign said. &ldquo;In the past 2-3 years, you guys focused on Elements, cannibalizing the marketplace, is time to give us something back. Personally, I feel forgotten.&rdquo; </p>\n\n\n\n<p>While the community earnings have allowed creators to improve their lives in various ways &ndash; from paying family medical bills to buying apartments &ndash; the increase in focus on Envato Elements has been highly controversial. Envato&rsquo;s forums are replete with complaints about Elements &ldquo;poaching clients from existing marketplaces,&rdquo; after many authors <a href=\"https://forums.envato.com/t/what-are-envatos-plans-for-themeforest/66598/216\">spoke out</a> about Envato advertising Elements on authors&rsquo; marketplace product pages. </p>\n\n\n\n<p>Authors employ various marketing channels to bring traffic to their items, such as Facebook ads or Adwords, and have complained for years that potential customers were whisked away from their product pages by Elements ads. Many authors reported declining sales on individual products as a result. </p>\n\n\n\n<p>In May 2018, Envato rolled out a <a href=\"https://forums.envato.com/t/changes-to-wordpress-and-after-effects-on-elements/172885/12\">critical change</a> that made all items across all item types available to all subscribers (monthly and annual). This was particularly controversial for WordPress theme authors and many reported significant decreases in sales as a direct result.</p>\n\n\n\n<p>At that time, former Envato employee James Giroux responded to authors&rsquo; concerns, characterizing the new subscription service as &ldquo;a long-term play:&rdquo;</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>&ldquo;With Elements, you are buying into a revenue stream rather than a one-time transaction. So, when you compare the value of a Market customer vs an Elements subscriber, you may see less from the subscriber in the first month, but more in their cumulative lifetime revenue.&rdquo;</p></blockquote>\n\n\n\n<p>Elements may not be the right choice for every Envato creator, but the company&rsquo;s investment in the service is now pulling in <a href=\"https://www.afr.com/technology/envato-profits-halve-but-every-staffer-ever-gets-spoils-20190407-p51btb\">$40 million in annual recurring revenue</a> as of 2018-2019, accounting for 35% of Envato&rsquo;s $113M in revenue for 2019. </p>\n\n\n\n<p>&ldquo;This year we continued to reinvent ourselves as a subscription company, with a major uptick in subscribers across Envato,&rdquo; Ta&rsquo;eed said in <a href=\"https://forums.envato.com/t/2019-envato-annual-public-impact-statement/272986\">Envato&rsquo;s 2019 Annual Public Impact Statement</a>. However, this new business model is coming at the expense of authors who sell exclusively through the marketplaces.</p>\n\n\n\n<p>Envato authors have begged the company&rsquo;s leadership to <a href=\"https://forums.envato.com/t/call-for-collis-ta-eed-envato-founder-please-separate-elements/216716/4\">take down the banners</a> that boost Elements&rsquo; sales by siphoning customers off the marketplace, but the aggressive push towards subscriptions prevails. The frustration is palpable in numerous threads across the company&rsquo;s various marketplaces.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>&ldquo;It&rsquo;s one thing to advertise Elements on the web or wherever Envato likes, but to have this banner on all of our item pages is actively poaching potential customers away when they are moments away from buying our items,&rdquo; AudioJungle author Alister Bunclark said.</p>\n\n\n\n<p>Many authors have seen a decline in sales that is outside their control. No amount of marketing traffic to their own portfolios can make up for the $16.50 &ldquo;all you can eat&rdquo; offer that is plastered to the top of every page. The banner for the in-house competitor even appears directly in the cart for customers who are trying to checkout with products from non-Elements authors.</p>\n\n\n\n<p>&ldquo;The fact that we are even having to request that Envato stop relentlessly promoting a competing, lower-priced alternative to our portfolios (many of which are exclusively offered at AudioJungle) &ndash; on the marketplace where our portfolios are &ndash; is discouraging,&rdquo; one author <a href=\"https://forums.envato.com/t/call-for-collis-ta-eed-envato-founder-please-separate-elements/216716/16\">said</a>.</p>\n\n\n\n<p>WordPress authors selling on Themeforest are also frustrated with the banners. In 2019, Envato sold an item every 5 seconds, with WordPress accounting for <a href=\"https://docs.google.com/presentation/d/1Rj1J4FEihZAuzL87P5bh18w2dEIA66iDFIrJbnNuECM/embed?start=false&loop=false&delayms=3000&slide=id.g793418c9c6_0_155\">a third of sales.</a> The company claims to be the &ldquo;market leader for themes and templates for WordPress,&rdquo; despite the marketplace&rsquo;s overall poor reputation among WordPress professionals.</p>\n\n\n\n<p>One byproduct of Elements including WordPress products in the subscription is that it tends to encourage the use of outdated themes and plugins. Users can download thousands of products but the WordPress themes do not come with support. Many users are <a href=\"https://forums.envato.com/t/envato-elements-outdated-problem/141799\">not aware</a> of this when they purchase their subscriptions. Users can get updates only while their subscriptions are active, but they have to be downloaded manually. </p>\n\n\n\n<p>&ldquo;Despite tons of complaints from authors (who made this place what it is in the first place) it is even pointless to promote your items elsewhere to attract some &lsquo;buyers&rsquo; because they see the Elements promotions everywhere, even on our own product pages,&rdquo; Themeforest Elite author Bedros <a href=\"https://forums.envato.com/t/two-days-without-sales/287149/6\">said</a>.</p>\n\n\n\n<p>When authors took to the forums to report no sales or declining sales, one user <a href=\"https://forums.envato.com/t/two-days-without-sales/287149/10\">responded</a>, &ldquo;Don&rsquo;t panic. They killed the market with Elements.&rdquo;</p>\n\n\n\n<p>Certain marketplaces, like AudioJungle and WordPress themes, are disproportionately impacted by Elements, given the significant time investment to create these types of products. </p>\n\n\n\n<p>&ldquo;I wonder what&rsquo;s the point, in these circumstances, to spend months (in some cases even a year) to build a decent WordPress theme to sell on Envato,&rdquo; Bedros <a href=\"https://forums.envato.com/t/two-days-without-sales/287149/5\">said</a>. Another author on the same thread reported working on a theme for 16 months and had only 17 sales two months after it was approved.</p>\n\n\n\n<p>&ldquo;The big buyers (ad agencies and the like) will see an immediate savings on the subscription plan opposed to buying the products individually,&rdquo; AudioJungle author Daniel Warneke <a href=\"https://www.quora.com/Is-Envato-killing-their-marketplace-with-Envato-elements\">said</a>. &ldquo;This pulls the high volume purchasers out of the individual market.</p>\n\n\n\n<p>&ldquo;Envato hand picks the authors that have products in Envato Elements, so it stands to reason that they selected a broad range of the most popular products. This would make the service the most appealing.&rdquo; </p>\n\n\n\n<h2>Envato Reports 0.18% CTR on Elements Banner Ads But Will Not Remove Them</h2>\n\n\n\n<p>In the responses to <a href=\"https://forums.envato.com/t/2019-envato-annual-public-impact-statement/272986\">Envato&rsquo;s 2019 Annual Public Impact Statement</a>, Collis Ta&rsquo;eed confirmed that market sales are declining. He blames the &ldquo;movement of the industry&rdquo; towards other business models as the reason for the decline: </p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>To your question on Market sales, they&rsquo;re holding up better than we&rsquo;d hoped, though they are down year on year. Internally we look at the combination of Market and Elements both in gross revenue (which is up) and in authors earnings (which is up). But Market itself is down a few percent on this time last year, and that looks like an ongoing trend (though one that&rsquo;s not as steep as my worst fears at times!)</p><p>It&rsquo;s tempting to think the driver of Market&rsquo;s changes are Elements, especially as we drive subscription customers over. But we&rsquo;d been mapping the trend of the sales curve for years prior to the launch of Elements and had been seeing changes before we ever launched into subscriptions, because of the movement of the industry, first to &lsquo;bundles&rsquo; and then to &lsquo;subscriptions&rsquo; and &lsquo;free&rsquo;. From what I can tell the bigger forces on Market are actually industry ones.</p></blockquote>\n\n\n\n<p>Despite the vast undervaluing of their individual products, authors in general do not seem to be opposed to Elements entirely but rather they are opposed to Envato&rsquo;s aggressive advertisements on their portfolios. The same question surfaces every year and the company&rsquo;s leadership continues to dance around it.</p>\n\n\n\n<p>&ldquo;Can you explain to authors why they should spend money on advertising their products when as soon as they land on the landing page they see a great big dirty banner saying they can get everything unlimited for a monthly fee?&rdquo; template author Patchesoft <a href=\"https://forums.envato.com/t/2019-envato-annual-public-impact-statement/272986/39\">commented</a>. &ldquo;I feel like this question came up last year and we got a &lsquo;we&rsquo;ll see what we can do about it&rsquo; and yet here we are a year later.&rdquo; </p>\n\n\n\n<p>Ta&rsquo;eed <a href=\"https://forums.envato.com/t/2019-envato-annual-public-impact-statement/272986/78\">responded</a>, characterizing the banners as a cross-promotion of traffic between Market and Elements. He claimed that after the company performed some tests, removing the banner &ldquo;had negligible impact on sales at a daily level.&rdquo;</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>Definitely I know that the header bar on Market is up there amongst the most annoying things to authors. But at the same time, it&rsquo;s important for us to be transparent about the different offerings we have for customers so they can choose what&rsquo;s best for their needs. While it&rsquo;s pretty annoying, the traffic diverted from Market item pages is minimal (0.18% of visitors actually click through). That said we&rsquo;re exploring ways to let customers better know about Elements (and Placeit).</p></blockquote>\n\n\n\n<p>Authors are not buying this justification for the banner ads, and object to the use of the term &ldquo;cross-promotion,&rdquo; when the promotion only goes one way. Meanwhile, Elements, which enables non-exclusive sales, is treated like an ad-free, exclusive library.</p>\n\n\n\n<p>&ldquo;&rsquo;Annoying&rsquo; is not the correct word,&rdquo; AudioJungle member Purple Fog <a href=\"https://forums.envato.com/t/2019-envato-annual-public-impact-statement/272986/81\">said</a>. &ldquo;You gotta understand it&rsquo;s much, much more than that. It&rsquo;s infuriating, it&rsquo;s a betrayal, it&rsquo;s you flipping us the finger.</p>\n\n\n\n<p>&ldquo;If it&rsquo;s so important for you to let buyers know what all their options are, then why isn&rsquo;t there a top banner on Elements telling them they can also get the item for a one off fee, in case they don&rsquo;t want to subscribe?</p>\n\n\n\n<p>&ldquo;That 0.18% is pretty far from the figure you previously gave us (around 2%), and is even harder to believe. Do you mean that you are willing to antagonize the vast majority of authors just for 0.18% CTR? Makes little sense. It&rsquo;s also hard to believe when there are countless threads opened by buyers who felt they were tricked by that infamous banner. Either your people are lying to you, or you didn&rsquo;t set up the analytics properly, but in any case, something doesn&rsquo;t add up here.&rdquo;</p>\n\n\n\n<h2>Envato&rsquo;s Transformation Into a Subscription Company Comes at the Expense of Its Exclusive Market Authors</h2>\n\n\n\n<p>Envato continues to write its own rules due to its early success and has now amassed a vast labor force who depend on the company&rsquo;s offerings for their livelihoods. Those who are willing to devalue their work for inclusion in a subscription product (that is guaranteed to sell with a more compelling pricing point) are allowed to continue as cogs in a much more profitable machine.</p>\n\n\n\n<p>It&rsquo;s not wrong for Envato to pivot towards becoming a subscription company. To do so at the expense of market authors is unfair. These authors are paying to advertise for a competing library with lost sales from their own products. It exploits the marketplace authors who were hoping to make a sale, since their higher prices are now just a prop for making Elements look more attractive. Their portfolios become a gateway to the subscription service.</p>\n\n\n\n<p> Unless Envato changes how it advertises Elements, the company will remain at odds with exclusive market authors&rsquo; interests. This is especially true for creators in markets where having their work available to more customers doesn&rsquo;t instantly translate into more payments.</p>\n\n\n\n<p>&ldquo;Many authors have chosen to set up shop here exclusively and have supported and promoted this marketplace for years,&rdquo; AudioJungle author Promosapien said in a <a href=\"https://forums.envato.com/t/call-for-collis-ta-eed-envato-founder-please-separate-elements/216716/121\">thread</a> where authors called on the CEO to remove the banner ads.</p>\n\n\n\n<p>&ldquo;Envato is presently making strategic choices that they obviously feel strongly about and feel are necessary for their own viability. Unfortunately, those choices are diminishing the benefits of being an exclusive author here.</p>\n\n\n\n<p>&ldquo;In fact, you could probably make a good argument that there has never been a worse time to be an exclusive author at a marketplace &ndash; when that marketplace is actively and continually using its considerable promotional resources to move website visitors away from your portfolio to a newer, cheaper licensing platform (Elements subscription).&rdquo; </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 12 Nov 2020 23:47:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: Do Not Build Theme-Specific Block Plugins for WordPress, Please\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=107722\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:189:\"https://wptavern.com/do-not-build-theme-specific-block-plugins-for-wordpress-please?utm_source=rss&utm_medium=rss&utm_campaign=do-not-build-theme-specific-block-plugins-for-wordpress-please\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5141:\"<p class=\"has-drop-cap\">A few days ago, I came across a small library of blocks. As always, I was interested in seeing what this new plugin brought to the table. Would it surprise me with a block that has not been done before? Would it present a new take on some old ideas? Or, would it be the same old set of blocks that every other block bundle has? Regardless of what it offered, I was excited to try it all the same.</p>\n\n\n\n<p>As I clicked on the description to find out more, I was immediately let down. The plugin specifically stated that it was built for only one theme.  I could not use it with my preferred theme.</p>\n\n\n\n<p>This was not the first time I had run across this issue. Other theme authors have built their own block bundles in the past. The plugin was not bringing anything particularly new to the WordPress community. It had less than a handful of blocks that had already been done before in numerous other plugins.</p>\n\n\n\n<p>The problem was that this felt all too familiar.</p>\n\n\n\n<p>Over the years, the WordPress community has created a set of unwritten rules regarding what belongs in a theme vs. what belongs in a plugin. Custom post types, taxonomies, and shortcodes are <em>plugin territory</em>. To an extent, widgets should also be exclusive to plugins. However, because of the way they are handled under the hood, there was always an argument that it was OK for themes to register them.</p>\n\n\n\n<p>This theme vs. plugin argument has been ongoing for at least a decade. Because of how themes work, such arguments have been a losing battle. Except in a few edge cases, themes could do everything that a plugin could do. However, there was always supposed to be a clear-cut distinction between the two. Themes were meant to handle the front-end design of a website. Plugins were for everything else.</p>\n\n\n\n<p>Today, the WordPress project and its block system are making progress toward solidifying that distinction.</p>\n\n\n\n<p>Because of WordPress&rsquo;s legacy of having various parts that did not all quite fit together in the past, it has created a culture of developers building in-house solutions. Nearly every large theme development company has its own plugins for overcoming the platform&rsquo;s shortcomings. Most of the blame for this lies with the WordPress project. However, the project&rsquo;s move to blocks is creating a standardized system that handles everything from a paragraph to the overall site container. With standardization across the board, there will be less and less need for these custom solutions from every theme company.</p>\n\n\n\n<p>The block system set a clear line in the sand. It removed the need for shortcodes &mdash; good riddance &mdash; and will soon phase out widgets. Blocks should be putting those old questions to bed.</p>\n\n\n\n<p>For clarity, there is little difference between bundling blocks with a theme and building a separate plugin that only works with a specific theme. The end result is the same. Such a plugin would lock a user into sticking with that theme if they relied on the plugin at all.  Few people maintain the same front-end design forever.</p>\n\n\n\n<p>The goal is to allow users to switch themes at will while having access to their content and blocks.</p>\n\n\n\n<p>These theme-specific block plugins are thinking about blocks in the wrong way. When a user installs a block plugin, the expectation is that they can use those blocks regardless of their theme.</p>\n\n\n\n<p>The solution for themes is to use block <strong>patterns</strong> or <strong>styles</strong>. Suppose that you wanted to create a slider or carousel as a theme author. There are multiple solutions for this. The first and easiest is to simply recommend a plugin to users or build a plugin of your own that works with any theme. You could also easily add a slider style for the Gallery block. When the user selects it, it transforms the gallery into a slider.</p>\n\n\n\n<p>Or, suppose your theme needed to offer a big hero section with a call-to-action button. There is no need for a custom block in this situation. Theme authors can almost exclusively do this by building a custom pattern with existing blocks.</p>\n\n\n\n<p>The solution is not to bundle the block in the theme or create a plugin that only works with that one theme.</p>\n\n\n\n<p>The beauty of the block system is that most of the pieces are already in place, and they can be rearranged, grouped, and styled in unlimited ways.</p>\n\n\n\n<p>Today, there are hundreds of theme-specific plugins in existence. Part of that is because themers were working around the WordPress.org theme review guidelines. Part of that is because some developers did not think creatively enough about solutions. But, the biggest part of it has been because WordPress has not standardized how to build things across the entire platform. Much of that has changed and will continue to change as full-site editing crosses the horizon in 2021. There will be clear paths for themes and plugins.</p>\n\n\n\n<p>However, if theme companies continue building theme-specific blocks, we are just lugging along the baggage that the block system is meant to leave behind.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 12 Nov 2020 21:58:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"BuddyPress: BuddyPress 7.0.0-beta2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=315529\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"https://buddypress.org/2020/11/buddypress-7-0-0-beta2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3225:\"<p>First of all, we&#8217;d like to thank all the contributors who tested the <a href=\"https://buddypress.org/2020/10/buddypress-7-0-0-beta1/\">first beta</a> of our next major release. Beta testing is very important to us as it&#8217;s a good way to check the improvements we brought to BuddyPress are behaving as expected on your WordPress/BuddyPress configurations.</p>\n\n\n\n<p><a href=\"https://downloads.wordpress.org/plugin/buddypress.7.0.0-beta2.zip\">BuddyPress 7.0.0-beta2</a>is now available for testing, and we&#8217;d love to have your feedbacks about it!</p>\n\n\n\n<p>Since 7.0.0 beta1:</p>\n\n\n\n<ul><li>We fixed some issues about the newly introduced features (BP Activity Embed block : <a href=\"https://buddypress.trac.wordpress.org/changeset/12763\">12763</a> ; BP Types Admin UI : <a href=\"https://buddypress.trac.wordpress.org/changeset/12764\">12764</a>, <a href=\"https://buddypress.trac.wordpress.org/changeset/12767\">12767</a>, <a href=\"https://buddypress.trac.wordpress.org/changeset/12775\">12775</a>, <a href=\"https://buddypress.trac.wordpress.org/changeset/12776\">12776</a> &amp; <a href=\"https://buddypress.trac.wordpress.org/changeset/12777\">12778</a>).</li><li>We improved the performance of the BP xProfile component : <a href=\"https://buddypress.trac.wordpress.org/changeset/12768\">12768</a> &amp; <a href=\"https://buddypress.trac.wordpress.org/changeset/12781\">12781</a>.</li><li>We changed Member Types to behave more like Group Types: <a href=\"https://buddypress.trac.wordpress.org/changeset/12765\">12765</a>, <a href=\"https://buddypress.trac.wordpress.org/changeset/12767\">12767</a> &amp; <a href=\"https://buddypress.trac.wordpress.org/changeset/12778\">12778</a>.</li><li>We gave a default avatar to the BP Blogs on multisite configurations : <a href=\"https://buddypress.trac.wordpress.org/changeset/12772\">12772</a> &amp; <a href=\"https://buddypress.trac.wordpress.org/changeset/12779\">12779</a>.</li><li>We fixed issues with the BP Nouveau Template pack : <a href=\"https://buddypress.trac.wordpress.org/changeset/12773\">12773</a> &amp; <a href=\"https://buddypress.trac.wordpress.org/changeset/12774\">12774</a>.</li><li>We improved the BP Invitations feature : <a href=\"https://buddypress.trac.wordpress.org/changeset/12771\">12771</a>.</li></ul>\n\n\n\n<p>We&#8217;ve also updated the 7.0.0 release schedule : <strong>the 7.0.0 final release is now scheduled to December 9</strong>.</p>\n\n\n\n<p>And <strong>we need you to get there</strong>: do test the 7.0.0-beta2 release so that we can eventually solve issues you might find with your plugins, themes or specific WordPress/BuddyPress configurations.</p>\n\n\n\n<p>You can test BuddyPress 7.0.0-beta2 in 4 ways :</p>\n\n\n\n<ul><li>Try the<a href=\"https://wordpress.org/plugins/bp-beta-tester/\">BP Beta Tester</a>plugin.</li><li><a href=\"https://downloads.wordpress.org/plugin/buddypress.7.0.0-beta2.zip\">Download the beta here (zip file)</a>.</li><li>Check out our SVN repository:<code>svn co https://buddypress.svn.wordpress.org/trunk/</code></li><li>Clone our read-only Git repository:<code>git clone git://buddypress.git.wordpress.org/</code></li></ul>\n\n\n\n<p>Thanks in advance for your contributions <span class=\"dashicons dashicons-heart\"></span></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 11 Nov 2020 23:15:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mathieu Viet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:8:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Wed, 16 Dec 2020 12:09:51 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Wed, 16 Dec 2020 12:00:09 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:9:\"HIT ord 1\";s:16:\"content-encoding\";s:4:\"gzip\";}}s:5:\"build\";s:14:\"20201214172546\";}', 'no');
