s:5:\"billd\";s:4:\"last\";s:0:\"\";s:7:\"picture\";N;s:2:\"ip\";s:10:\"82.1.90.67\";s:11:\"is_verified\";b:1;s:10:\"secret_key\";s:32:\"sk_>?>aJ1J2fdUR<tH.%a!;Dr08muGpC\";s:10:\"public_key\";s:32:\"pk_794779f27ae57883d38269ee4f343\";s:2:\"id\";s:7:\"3755235\";s:7:\"created\";s:19:\"2020-10-06 15:23:52\";s:7:\"updated\";s:19:\"2020-10-06 15:33:11\";s:11:\"customer_id\";N;}s:7:\"created\";i:1601998391;s:9:\"timestamp\";i:1602084791;}s:73:\"get:/v1/installs/5686883/updates/latest.json?is_premium=false&readme=true\";O:8:\"stdClass\":3:{s:6:\"result\";O:8:\"stdClass\":17:{s:9:\"plugin_id\";s:3:\"843\";s:12:\"developer_id\";s:3:\"308\";s:4:\"slug\";N;s:12:\"premium_slug\";s:18:\"foogallery-premium\";s:7:\"version\";s:6:\"1.9.34\";s:11:\"sdk_version\";s:7:\"2.4.0.1\";s:25:\"requires_platform_version\";s:3:\"3.9\";s:20:\"tested_up_to_version\";s:3:\"5.5\";s:8:\"has_free\";b:1;s:11:\"has_premium\";b:1;s:12:\"release_mode\";s:8:\"released\";s:2:\"id\";s:5:\"20894\";s:7:\"created\";s:19:\"2020-08-31 19:03:40\";s:7:\"updated\";s:19:\"2020-10-06 14:01:18\";s:11:\"is_released\";b:0;s:3:\"url\";s:387:\"https://api.freemius.com/v1/installs/5686883/updates/20894.zip?is_premium=false&authorization=FSLA+5686883%3AvyeFjYSH7RnPLVG_W8MEp-KFqud2X-4xx8jM--924wUjm_CNrzFmwpTTmDdgtZqQTOQfA-q1aVMdgET0hc5rysR9OiP1Ar08EasAODkik0U2ZymoBvQp01ZM943MJUo5N_D2OUXr4M2y3x9HD6ZYi0ircFcV1Rzyg4pLNEOScJXiEtBmYeeyVjyFh7MviryTOJBczfJyKvlVmoWw7zGL7FfNhv_tBcGbUUsPZCH0Hza0807D7cmx44r8mwg4CH4eV7QlT2bPMwy7kDW4Er0wiQ\";s:6:\"readme\";O:8:\"stdClass\":12:{s:4:\"name\";s:53:\"FooGallery Image Gallery  Responsive Photo Gallery\";s:4:\"slug\";s:10:\"foogallery\";s:4:\"tags\";O:8:\"stdClass\":6:{s:7:\"gallery\";s:7:\"gallery\";s:13:\"image gallery\";s:13:\"image gallery\";s:13:\"photo gallery\";s:13:\"photo gallery\";s:18:\"responsive gallery\";s:18:\"responsive gallery\";s:24:\"wordpress gallery plugin\";s:24:\"wordpress gallery plugin\";s:19:\"best gallery plugin\";s:19:\"best gallery plugin\";}s:8:\"requires\";s:3:\"3.9\";s:6:\"tested\";s:3:\"5.5\";s:10:\"stable_tag\";s:5:\"trunk\";s:8:\"sections\";O:8:\"stdClass\":5:{s:11:\"description\";s:7411:\"<p>Make gallery management in WordPress great again! With FooGallery you can easily add a stunning photo gallery to your website in minutes.</p>\n\n<p>FooGallery is an easy-to-use image gallery plugin, with stunning gallery layouts. It is also responsive, retina-ready and supports lazy loading for lightning fast photo galleries.</p>\n\n<p>Live previews are available while creating an image gallery, and also within the Gutenberg block editor with our FooGallery Block.</p>\n\n<p>FooGallery was built to be highly configurable and extendable for developers or freelancers.</p>\n\n<p><a href=\"http://fooplugins.com/foogallery\">Visit the FooGallery Homepage</a></p>\n\n<p><strong>Features</strong></p>\n\n<ul>\n<li>6 Beautiful Image Gallery templates\n\n<ul>\n<li>Responsive Image Gallery - <a href=\"https://fooplugins.com/foogallery/wordpress-responsive-image-gallery/\">demo</a></li>\n<li>Image Viewer Gallery - <a href=\"https://fooplugins.com/foogallery/wordpress-image-viewer-gallery/\">demo</a></li>\n<li>Masonry Gallery - <a href=\"https://fooplugins.com/foogallery/wordpress-masonry-gallery/\">demo</a></li>\n<li>Simple Portfolio - <a href=\"https://fooplugins.com/foogallery/wordpress-portfolio-gallery/\">demo</a></li>\n<li>Justified Gallery - <a href=\"https://fooplugins.com/foogallery/wordpress-justified-gallery/\">demo</a></li>\n<li>Single Thumbnail Gallery - <a href=\"https://fooplugins.com/foogallery/wordpress-single-thumbnail-gallery/\">demo</a></li>\n</ul></li>\n<li>Easy to customize!\n\n<ul>\n<li>Thumbnail size, spacing &amp; alignment</li>\n<li>Borders : size, rounded corners, drop shadows, inner shadows</li>\n<li>Loading icons</li>\n<li>Hover effects : colors, scaling, icons, captions</li>\n</ul></li>\n<li>Albums built-in! (just activate the albums extension)\n\n<ul>\n<li>Responsive album layout - <a href=\"https://fooplugins.com/foogallery/wordpress-album-gallery/\">demo</a></li>\n<li>All-in-one Stack album - <a href=\"https://fooplugins.com/foogallery/wordpress-album-gallery/#all-in-one\">demo</a></li>\n</ul></li>\n<li>Gutenberg ready (Gallery previews inside the new editor!)</li>\n<li>Lazy loading</li>\n<li>Simple dots pagination <a href=\"https://fooplugins.com/foogallery/gallery-pagination/\">demo</a></li>\n<li>Live previews in admin</li>\n<li>Retina thumbnail support</li>\n<li>Gallery Widget</li>\n<li>Use built-in media library to manage images</li>\n<li>Drag n Drop reordering of images and galleries</li>\n<li>Custom CSS for both galleries and albums</li>\n<li>Copy to clipboard shortcodes</li>\n<li>Visual shortcodes in rich text editor</li>\n<li>Gallery picker to insert shortcodes</li>\n<li>Page usage metabox with one-click gallery page creation</li>\n<li>NextGen importer tool (albums and galleries and shortcodes)</li>\n<li>Multisite Support</li>\n</ul>\n\n<p><strong>PRO Features</strong></p>\n\n<ul>\n<li>3 more beautiful PRO gallery templates:\n\n<ul>\n<li>Polaroid gallery template - <a href=\"https://fooplugins.com/foogallery/wordpress-polaroid-gallery/\">demo</a></li>\n<li>Grid gallery template - <a href=\"https://fooplugins.com/foogallery/wordpress-grid-gallery/\">demo</a></li>\n<li>Slider gallery template - <a href=\"https://fooplugins.com/foogallery/wordpress-slider-gallery/\">demo</a></li>\n</ul></li>\n<li>Video Support - <a href=\"https://fooplugins.com/foogallery/wordpress-video-gallery/\">demo</a></li>\n<li>Filtered Image Gallery using Media Tags or Categories - <a href=\"https://fooplugins.com/foogallery/wordpress-filtered-gallery/\">demo</a></li>\n<li>Media tags and media category management for attachments</li>\n<li>PRO image and media lightbox built in! <a href=\"https://fooplugins.com/foogallery/foogallery-pro-lightbox/\">demo</a></li>\n<li>Dynamic Galleries (load images from other sources):\n\n<ul>\n<li>Load from a folder on the server</li>\n<li>Load from a collection from Adobe Lightroom (using WP/LR Sync)</li>\n<li>Load all attachments with Media Tags</li>\n<li>Load all attachments with Media Categories</li>\n<li>Load from a folder in Real Media Library</li>\n<li>Load images from Instagram</li>\n<li>Load featured images from a post/page/custom post type</li>\n</ul></li>\n<li>11 beautiful hover effect presets - <a href=\"https://fooplugins.com/foogallery/hover-presets/\">demo</a></li>\n<li>12 CSS thumbnail filters (Instagram) - <a href=\"https://fooplugins.com/foogallery/thumbnail-filters/\">demo</a></li>\n<li>Numbered pagination - <a href=\"https://fooplugins.com/foogallery/gallery-pagination/#numbered\">demo</a></li>\n<li>\"Load More\" pagination - <a href=\"https://fooplugins.com/foogallery/gallery-pagination/#load-more\">demo</a></li>\n<li>Infinite scroll image gallery - <a href=\"https://fooplugins.com/foogallery/gallery-pagination/#infinite-scroll\">demo</a></li>\n<li>Animated Loaded Effects - <a href=\"https://fooplugins.com/foogallery/animated-loaded-effects/\">demo</a></li>\n<li>Bulk Copy Gallery Settings - <a href=\"https://fooplugins.com/bulk-copy-foogallery-pro/\">more info</a></li>\n<li>More on the way!</li>\n</ul>\n\n<p><a href=\"https://fooplugins.com/foogallery/demos/\">See More Demos</a></p>\n\n<p>https://youtu.be/zY8eSTEIwpU</p>\n\n<p><strong>Documentation</strong></p>\n\n<ul>\n<li><a href=\"https://fooplugins.com/documentation/foogallery/\">FooGallery Documentation</a></li>\n</ul>\n\n<p><strong>Gutenberg</strong></p>\n\n<p>We love the new Gutenberg editor. We have built a really simple-to-use Gutenberg block to add your existing FooGallery image galleries in seconds. And it includes live previews of the image gallery too!</p>\n\n<p><strong>GDPR</strong></p>\n\n<p>When you install FooGallery for the first time, the plugin asks you (the website admin) to opt-in so that we can track your usage of the plugin and provide a better service (send you update emails for new version releases and security updates etc). <em>This is optional and not required in order to use the plugin.</em></p>\n\n<p>From your website point of view, FooGallery never collects or stores any visitor information at all, when someone visits your website.</p>\n\n<p><strong>PHP 7 Compatible</strong></p>\n\n<p>FooGallery has been tried and tested on servers running up to PHP 7.4</p>\n\n<p><strong>Retina Support</strong></p>\n\n<p>FooGallery now comes with built-in support for higher quality thumbnails on retina-enabled displays. No more blurry thumbnails, just crisp thumbnails so that your image galleries look amazing on all devices.</p>\n\n<p><strong>Video Support</strong></p>\n\n<p>FooGallery PRO now supports the creation of video galleries! Import from YouTube, Vimeo, Facebook, TED and Dailymotion, or use a self-hosted video from any online source. You can also easily create mixed galleries with both images and videos!</p>\n\n<p><strong>Albums Built In</strong></p>\n\n<p>Albums are built in as an extension. Simply head over to the extensions page and activate the albums extension. A new menu item will appear that allows you to add albums just as easily as galleries.</p>\n\n<p><strong>Built For Developers</strong></p>\n\n<p>FooGallery was designed to be the most developer-friendly image gallery plugin available for WordPress. It was also built on top of a solid extension framework, which means different functionality is separated out into different areas in the codebase. It also means the core plugin is lightweight, but still allowing for the most flexibility.</p>\n\n<p><strong>Special Thanks</strong></p>\n\n<p>Thanks to Fortinet FortiGuard Labs for the security testing conducted on the plugin. FooGallery is a safer plugin thanks to them.</p>\";s:12:\"installation\";s:257:\"<ol>\n<li>Upload <code>foogallery</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress</li>\n<li>You will be redirected to the FooGallery Help page to get your started</li>\n</ol>\";s:3:\"faq\";s:3330:\"<h4>My galleries are not working. Thumbnails are greyed out and not loading when I scroll down the page.</h4>\n\n<p>Lazy loading is not working on your gallery. This could be due to a conflict between our plugin and your theme.\nYou can test this theory by testing a different theme (if possible).\nWe can help you get it working, by contacting our support.</p>\n\n<h4>I have created a gallery in the backend, but when I look at it on the frontend, it does not show correctly.</h4>\n\n<p>Sometimes, there are issues when the theme does not follow WordPress best practices.\nIn order for FooGallery to function properly, the theme needs to have:\n    * A call to wp_head(); in the header.php file.\n    * A call to wp_footer(); in the footer.php file.</p>\n\n<p>One way to check if the theme is the problem, is by switching to one of the built-in WordPress themes, and then see if the gallery loads.</p>\n\n<h4>After updating, my galleries no longer work! What should I do?</h4>\n\n<p>Do you have any WordPress caching or optimization plugins? If so, then clear/purge your caches.\nDo you have any caching setup at your website host? If so, clear/purge those caches.</p>\n\n<h4>After installing the plugin, my site is broken! Help!</h4>\n\n<p>First thing to do is restore your site to it\'s previous working state.\n1. Get access to your site via FTP, or SFTP.\n2. Navigate to the wp-content/plugins folder.\n3. Rename the foogallery folder to foogallery1 in order to deactivate the plugin.\n4. At this point, your site should be working again.\n5. Please contact our support and provide the following info:\n    * What version of WordPress you are running.\n    * What version of PHP you are using.\n    * What version of FooGallery you installed.\n    * What error was shown when your site was broken?\n    * What plugins and theme are you using?</p>\n\n<h4>I purchased a PRO license, but the Free version is still running.</h4>\n\n<p>Make sure you are running the PRO version. You can check this by visiting the FooGallery -> Account page within the WordPress admin.\nIf you do not have the PRO version, you can download it by visiting your account page at https://fooplugins.com/account\nIf you have the PRO version, then clear any caches on your site or for your host. Also clear CSS Optimiztion Cache from FooGallery Settings.\nIf it still does not work, then please contact our support to help further.</p>\n\n<h4>Why are my thumbnails so blurry?</h4>\n\n<p>Have you enabled retina support for your galleries? To enable retina support, edit the gallery and locate the Retina Support metabox.</p>\n\n<h4>Can I add videos to my galleries?</h4>\n\n<p>Yes, video is supported in FooGallery PRO!</p>\n\n<h4>Do I need to install a separate plugin to show a lightbox?</h4>\n\n<p>For the Free version of FooGallery - Yes, you will need to install FooBox Image Lightbox.\nFor the PRO version of FooGallery - No, we have built in a uniquely beautiful lightbox!</p>\n\n<h4>How do I get albums working?</h4>\n\n<p>Simply go to the FooGallery extensions page and activate the Albums extension. If you do not see a button to activate the albums extension, reload the extensions list by clicking the reload button.</p>\n\n<h4>How do I turn off all the PRO Promotions in the admin?</h4>\n\n<p>Goto FooGallery Settings -> Advanced Tab and check \"Disable PRO Promotions\" and then save your settings.</p>\";s:9:\"changelog\";s:21969:\"<h4>1.9.34</h4>\n\n<p>Date Updated : 2020-08-30\n*   Fix : Fix for incorrect captions in some scenarios\n*   Fix : Compatibility with Owl Carousel Extension and others\n*   Update : FooGallery client side 1.4.18</p>\n\n<h4>1.9.31</h4>\n\n<p>Date Updated : 2020-08-07\n*   Fix : IMPORTANT fix for WP 5.5 compatibility when editing galleries (gallery preview button was not showing)</p>\n\n<h4>1.9.30</h4>\n\n<p>Date Updated : 2020-08-03\n*   Fix : IMPORTANT fix for WP 5.5 compatibility when editing galleries (gallery template selector was not showing)\n*   New : Support for All in One SEO Pack sitemaps\n*   Update : improved lightbox messages when no lightboxes are installed\n*   Update : Freemius SDK 2.4.0.1</p>\n\n<h4>1.9.28</h4>\n\n<p>Date Updated : 2020-07-18\n*   Fix : Fix for some installs showing thumbnail generation error\n*   Update : better mobile support for admin settings tabs\n*   Update : FooGallery client side 1.4.16</p>\n\n<h4>1.9.26</h4>\n\n<p>Date Updated : 2020-06-29\n*   Fix : Fix for All-In-One album hidden items still clickable\n*   Fix : Fix for fatal error on some versions of PHP\n*   Update : FooGallery client side 1.4.15</p>\n\n<h4>1.9.25</h4>\n\n<p>Date Updated : 2020-06-04\n* Fix : Fixed bug to prevent infinite loop with ResizeObserver in some themes\n* Fix : Fixed possible text-domain issue\n* Update : FooGallery client side 1.4.13</p>\n\n<h4>1.9.24</h4>\n\n<p>Date Updated : 2020-05-04\n* Fix : Fixed bug where thumbs were not loading on mobile in Justified and Portfolio galleries\n* Update : FooGallery client side 1.4.12</p>\n\n<h4>1.9.23</h4>\n\n<p>Date Updated : 2020-05-02\n* New : Reworked hover effect settings to allow none\n* New : Added new zoomed hover effect\n* New : Added new transparent theme hover effect\n* New : Added new advanced setting to add custom class to the gallery container\n* New : Added global settings for upscaling small images when using larger thumbnail dimensions\n* New : Added Pro feature promotions in gallery settings\n* New : Added setting to force GD Image editor as the default\n* New : Added info for active image editor to Settings -> Images tab\n* New : Improved caption sanitization\n* Fix : Fixed bug with Safari when editing a gallery, not loading thumbs\n* Fix : Fixed gallery previews in certain situations\n* Update : Freemius SDK 2.3.2\n* Update : FooGallery client side 1.4.11</p>\n\n<h4>1.9.11</h4>\n\n<p>Date Updated : 2020-03-29\n* Fix : Fix for Simple Portfolio template not saving \"None\" for captions.\n* Fix : Fixed albums when adding incorrect markup target=\"default\"\n* Fix : Updated thumbnail generation test logic to be more resilient, and improved admin message.\n* Fix : Updated RankMath compatibility to work with pre PHP 5.4\n* New : Added filter \"foogallery_build_dynamic_gallery\" for dynamic gallery creation\n* New : Added WPML config file for better translations. (Also improves Polylang compatibility.)</p>\n\n<ul>\n<li>Update : FooGallery client side 1.4.6 (including multiple bug fixes)</li>\n</ul>\n\n<h4>1.9.8</h4>\n\n<p>Date Updated : 2020-03-08\n* New : Added RankMath compatibility - sitemap image indexing.\n* New : Added new setting under Hover Effects : Invert Color. Invert the caption icon colors from dark to light.\n* New : All hover and loading icons converted to SVG format.\n* New : Lazy load gallery images when editing a gallery (improved performance for large galleries in the admin).</p>\n\n<ul>\n<li>Fix : Previews not updating in some cases.</li>\n<li>Update : FooGallery client side 1.4.0 (MAJOR UPDATE).</li>\n</ul>\n\n<h4>1.8.20</h4>\n\n<p>Date Updated : 2019-11-22\n* Fix : Fix for Masonry template layout issue in Firefox</p>\n\n<ul>\n<li>Update : FooGallery client side 1.3.6</li>\n</ul>\n\n<h4>1.8.18</h4>\n\n<p>Date Updated : 2019-10-23\n* New : Elementor compatibility - gallery previews in Elementor editor work, and added a FooGallery widget to the Elementor editor</p>\n\n<ul>\n<li>Fix : Images in Yoast SEO sitemaps pull correctly for all types of gallery embedding</li>\n<li>Fix : Lazy-load issues on certain browsers (reverted back to old logic)</li>\n<li>Fix : Updated WPThumb so that images with querystrings in the URL will work</li>\n<li>Fix : Minor security issue fixed on the FooGallery settings page (only exploitable by administrators)</li>\n</ul>\n\n<h4>1.8.14</h4>\n\n<ul>\n<li><p>New : Added setting to move \"Add Media\" button to front of attachment listing (Advanced tab in FooGallery Settings)</p></li>\n<li><p>Fix : Lazy-load issues with Gutenberg Editor</p></li>\n<li>Fix : Simple portfolio layout issue with certain themes</li>\n<li>Update : FooGallery client side 1.3.4</li>\n</ul>\n\n<h4>1.8.12</h4>\n\n<ul>\n<li>Fix : Previews not working on new galleries</li>\n</ul>\n\n<h4>1.8.11</h4>\n\n<ul>\n<li>New : Added advanced gallery settings for custom settings and custom attributes</li>\n<li>Fix : Rewrite of Simple Portfolio to incorrect thumb heights</li>\n<li>Fix : Lazy-load issues for certain themes</li>\n<li>Update : FooGallery client side 1.3.3</li>\n</ul>\n\n<h4>1.8.8</h4>\n\n<ul>\n<li>New : Implemented the Datasource architecture within the plugin</li>\n<li>Fix : PHP Warnings when previewing galleries</li>\n<li>Fix : Simple Portfolio thumbnails cut off in certain scenarios</li>\n<li>Fix : Updated Gutenberg block to work in latest Gutengerg release</li>\n<li>Update : FooGallery client side 1.2.10</li>\n</ul>\n\n<h4>1.7.8</h4>\n\n<ul>\n<li>New : Added filter to override content when creating a gallery page \'foogallery_create_gallery_page_content\'</li>\n<li>Fix : Fixed bug for Justified gallery, when last row was set to hidden</li>\n<li>Update : FooGallery client side 1.2.8</li>\n<li>Update : Freemius SDK 2.3.0</li>\n</ul>\n\n<h4>1.7.7</h4>\n\n<ul>\n<li>New : Added slider navigation buttons in Slider PRO template</li>\n<li>Fix : Fixed gallery usage with custom post types</li>\n<li>Fix : Captions being cut off in portfolio template</li>\n<li>Fix : Multiple small bugs and tweaks</li>\n<li>Update : Updated to handle Chrome\'s new allow attribute in videos</li>\n<li>Update : FooGallery client side 1.2.7</li>\n</ul>\n\n<h4>1.7.6</h4>\n\n<ul>\n<li>Fix : Fixed issues with paging introduced in 1.7.4</li>\n<li>Fix : Fixed conflicts with other lazy loading plugins</li>\n<li>Update : FooGallery client side 1.2.3</li>\n</ul>\n\n<h4>1.7.4</h4>\n\n<ul>\n<li>New : Major performance enhancements for all galleries</li>\n<li>New : Performance enhancements with FooBox</li>\n<li>New : Force HTTPS setting for migrated sites</li>\n<li>New : FooGallery Gutenberg block gallery search</li>\n<li>Fix : fixed scroll blocking violation warnings in dev tools</li>\n<li>Fix : fixed Wistia video import issues</li>\n<li>Update : FooGallery client side 1.2.2</li>\n</ul>\n\n<h4>1.6.17</h4>\n\n<ul>\n<li>IMPORTANT : Please update to address a security vulnerability.</li>\n<li>Fix : Security vulnerability</li>\n<li>Fix : Images caching in certain browsers, not loading</li>\n<li>Update : Freemius SDK 2.2.4</li>\n<li>Update : FooGallery client side 1.1.13</li>\n</ul>\n\n<h4>1.6.15</h4>\n\n<ul>\n<li>Fix : fixed logo path in admin</li>\n<li>Update : changed the paging default output to HTML</li>\n</ul>\n\n<h4>1.6.14</h4>\n\n<ul>\n<li>New : Added free trial tab to landing page</li>\n<li>New : Added demo tab to landing page</li>\n<li>New : Added support tab to landing page</li>\n<li>New : Added help with FooBox lightbox in gallery templates</li>\n<li>New : New setting to override thumb generation test URL</li>\n<li>New : New setting to output gallery JSON to script block</li>\n<li>New : Added rating admin notice after 5 galleries has been created</li>\n<li>Fix : Fixed issues with video support in All-In-One stack album</li>\n<li>Fix : Support for galleries loading in FooBox</li>\n<li>Update : updated plugin generator</li>\n<li>Update : FooGallery client side 1.1.10</li>\n<li>Update : Freemius SDK 2.2.3</li>\n</ul>\n\n<h4>1.6.13</h4>\n\n<ul>\n<li>New : Added setting to render JSON data to script block (fix for some caching plugins)</li>\n<li>Fix : Compatibility with WPML Media</li>\n</ul>\n\n<h4>1.6.11</h4>\n\n<ul>\n<li>Fix : Random thumbnails not loading in FireFox</li>\n<li>Update : FooGallery client side 1.1.8</li>\n</ul>\n\n<h4>1.6.10</h4>\n\n<ul>\n<li>Fix : Safari bug with lazy loading</li>\n<li>Fix : Thumbs not loading with paging</li>\n<li>Fix : duplicate caption title in some scenarios</li>\n<li>Fix : clicking html in caption was not loading lightbox</li>\n<li>Update : FooGallery client side 1.1.7</li>\n</ul>\n\n<h4>1.6.7</h4>\n\n<ul>\n<li>New : added new filter for allowed post types that foogallery can be attached to</li>\n<li>New : added loop setting for image viewer gallery template</li>\n<li>New : override sorting in shortcode by providing \"sort\" attribute</li>\n<li>Fix : Beaver Builder javascript error while editing a page</li>\n<li>Fix : album shortcodes not working in some page builders</li>\n<li>Fix : attach gallery to post when gutenberg block is included</li>\n<li>Fix : filtering + paging bugs corrected in some scenarios</li>\n<li>Fix : multiple small bugs and tweaks</li>\n<li>Fix : Thumbnail generation tries to use first image in media library</li>\n<li>Update : FooGallery client side 1.1.5</li>\n<li>Update : Freemius SDK 2.2.2</li>\n</ul>\n\n<h4>1.6.1</h4>\n\n<ul>\n<li>New : Gutenberg FooGallery block (including live gallery previews!)</li>\n<li>Fix : foogallery shortcode not rendering in certain cases</li>\n<li>Fix : disabling lazy loading via settings was being ignored</li>\n<li>Update : Freemius SDK 2.1.3 (which fixes fatal Multisite bug)</li>\n</ul>\n\n<h4>1.5.9</h4>\n\n<ul>\n<li>Fix : Theme customizer not loading for some theme/plugin combinations</li>\n</ul>\n\n<h4>1.5.8</h4>\n\n<ul>\n<li>Major version bump to correspond with FooGallery PRO which includes video support</li>\n<li>New : Upgrade offer to FooGallery PRO for FooVideo customers</li>\n<li>New : Language setting for load more pagination</li>\n<li>Update : FooGallery client side 1.1.2</li>\n<li>Update : Freemius SDK 2.1.1</li>\n<li>Fix : Pagination + Filtering bugs</li>\n<li>Fix : PHP 7.1 compatibility tests failing for clone</li>\n<li>Fix : better paging + filtering support</li>\n<li>Fix : better RTL support in media modal</li>\n<li>Multiple bug fixes and improvements</li>\n</ul>\n\n<h4>1.4.31</h4>\n\n<ul>\n<li>New : GDPR notice in readme</li>\n<li>New : Update to Freemius SDK 2.0.1</li>\n<li>Fix : Default captions bug introduced in 1.4.30</li>\n</ul>\n\n<h4>1.4.30</h4>\n\n<ul>\n<li>Fix : Album 404 issues when used on homepage</li>\n<li>Fix : Dimension attributes missing for upscaling small images</li>\n<li>Fix : Issue when galleries cannot be added to an album</li>\n<li>Fix : Lightbox caption mismatch</li>\n<li>New : Setting for legacy thumb cropping in Simple Portfolio gallery</li>\n<li>Update : FooGallery client side 1.0.26</li>\n</ul>\n\n<h4>1.4.29</h4>\n\n<ul>\n<li>New : Added an album setting to set the gallery title size (h2,h3,h4,h5,h6)</li>\n<li>Fix : media modal issues with Elementor</li>\n<li>Fix : media modal issues with Thrive Architect</li>\n<li>Fix : caption override fix for single thumbnail galleries</li>\n<li>Update : media modal improvements</li>\n</ul>\n\n<h4>1.4.27</h4>\n\n<ul>\n<li>Fix : Justified gallery issues in certain browsers / devices</li>\n<li>Fix : Portfolio gallery issues in certain browsers / devices</li>\n<li>Fix : Use of correct rel attribute for better lightbox compatibility and W3 validation</li>\n<li>Fix : Removed local translations that were incomplete and outdated</li>\n<li>Update : FooGallery client side 1.0.24</li>\n<li>Update : language files</li>\n</ul>\n\n<h4>1.4.26</h4>\n\n<ul>\n<li>Fix : Filtering introduced an array initialization construct not working for older versions of php</li>\n</ul>\n\n<h4>1.4.25</h4>\n\n<ul>\n<li>New : Retina support for albums!</li>\n<li>New : Default crop position setting for attachments</li>\n<li>New : Speed up gallery previews in wp-admin</li>\n<li>New : Caption support for Responsive Lightbox by dFactory</li>\n<li>Fix : Extension loading issues on certain installs</li>\n<li>Fix : Shortcode copy-to-clipboard metabox works again</li>\n<li>Fix : Bugs fixes for paging, filtering, FooBox and more</li>\n<li>Fix : Ensure jquery-ui-sortable is loaded on edit page for some installs</li>\n<li>Fix : All-In-One Stack Album layout bugs</li>\n<li>Fix : Reworked extensions listing page logic</li>\n<li>Update : FooGallery client side 1.0.23</li>\n<li>Update : Freemius SDK 1.2.4</li>\n</ul>\n\n<h4>1.4.15</h4>\n\n<ul>\n<li>Fix : All-In-One stack album fatal error when 2 albums on same page</li>\n</ul>\n\n<h4>1.4.14</h4>\n\n<ul>\n<li>Fix : All-In-One stack album now uses the gallery featured image</li>\n<li>Added more position options for Single Thumbnail Gallery</li>\n<li>Added paging output setting</li>\n<li>Update to latest client side JS 1.0.20</li>\n</ul>\n\n<h4>1.4.12</h4>\n\n<ul>\n<li>New : NextGen importer now includes shortcode replacement</li>\n<li>New : Masonry gallery supports captions below thumbnails</li>\n<li>New : Performance improvements for very large galleries (1000+ images)</li>\n<li>Fix : Bugs fixes for paging, FooBox and more</li>\n<li>Update to latest client side JS 1.0.18</li>\n</ul>\n\n<h4>1.4.8</h4>\n\n<ul>\n<li>New : added custom ready event setting for overcoming 3rd party jQuery exceptions</li>\n<li>New : added crop thumbnail option to \'Single Thumbnail\' and \'Image Viewer\' templates</li>\n<li>Update to latest client side JS</li>\n</ul>\n\n<h4>1.4.7</h4>\n\n<ul>\n<li>Fix : conflicts with WP Rocket CDN features</li>\n<li>Fix : conflicts with themes or plugins deferring script loading</li>\n<li>New : Auto-loading of default templates</li>\n<li>Update to latest client side JS</li>\n</ul>\n\n<h4>1.4.6</h4>\n\n<ul>\n<li>Fix : conflicts with other scripts or plugins using data-src attributes</li>\n<li>Fix : script moved back to use jQuery ready event, to avoid some conflicts</li>\n<li>New : Global setting to disable lazy loading for all galleries</li>\n<li>New : FooGallery Widget!</li>\n<li>New : Admin notice for Autoptomize users to delete cache on updates</li>\n<li>Update to latest client side JS</li>\n</ul>\n\n<h4>1.4.5</h4>\n\n<ul>\n<li>Fix : Lazy loading - scrolling galleries in certain scenarios were not loading thumbs</li>\n<li>Fix : Galleries that were hidden on page load were not displaying correctly when shown</li>\n<li>Fix : Default gallery settings were not being applied to new galleries</li>\n<li>New : shortcode arguments applied to gallery for common fields</li>\n<li>New : HTML caching is disabled by default now!</li>\n<li>Updated to latest client side JS and CSS</li>\n</ul>\n\n<h4>1.4.4</h4>\n\n<ul>\n<li>Fix : upgrade was calling underfined function</li>\n</ul>\n\n<h4>1.4.3</h4>\n\n<ul>\n<li>Fix : Justify gallery template issues</li>\n<li>Fix : Masonry gallery template issues</li>\n<li>Fix : Caption description not hidden when supposed to</li>\n<li>Fix : Complete rework of thumbnail dimension logic!</li>\n<li>Fix : Redirection bug on activation</li>\n<li>Fix : Added checks for galleries causing PHP warnings</li>\n<li>Fix : Multisite warnings on activation</li>\n<li>New : Last Row setting in Justify gallery template</li>\n<li>New : Alignment setting in Simple Portfolio gallery template</li>\n<li>New : Added more checks after load to ensure gallery layout is correct</li>\n<li>New : Added lazy loading advanced setting</li>\n<li>Updated to Freemius SDK 1.2.2.10</li>\n<li>Updated to latest client side JS and CSS</li>\n</ul>\n\n<h4>1.3.28</h4>\n\n<ul>\n<li>Complete rewrite of the built-in gallery templates</li>\n<li>New : lazy loading</li>\n<li>New : simple pagination</li>\n<li>New : Live Previews when editing a gallery</li>\n<li>260+ updates, changes and bug fixes</li>\n</ul>\n\n<h4>1.3.8</h4>\n\n<ul>\n<li>New : Built in support for FooBox, fixing a lot of issues where FooBox option is not available</li>\n<li>Fix : More reliable extension active status on extensions listing</li>\n<li>Fix : More obvious wording for 3rd party plugins when they are not installed</li>\n</ul>\n\n<h4>1.3.7</h4>\n\n<ul>\n<li>Fix : Activation redirect bug showing \"Sorry, you are not allowed to access this page.\"</li>\n</ul>\n\n<h4>1.3.6</h4>\n\n<ul>\n<li>New : Freemius integration!</li>\n<li>New : Added support for the Responsive Lightbox by dFactory</li>\n<li>New : New custom class field for an attachment</li>\n<li>New : Added more system info for better debugging when there are server issues</li>\n<li>Fix : Visual editor FooGallery edit button</li>\n<li>Fix : Image Viewer hover effect none now works as expected</li>\n<li>Fix : Disable HTML caching for randomly ordered galleries</li>\n</ul>\n\n<h4>1.2.20</h4>\n\n<ul>\n<li>New : Force Use Original thumb setting on gallery edit page</li>\n<li>Fix : PHP warning from thumbnail class since 1.2.19</li>\n</ul>\n\n<h4>1.2.19</h4>\n\n<ul>\n<li>New : Gallery output caching! Saves database requests improving load time</li>\n<li>New : Gallery usage column in admin gallery listing</li>\n<li>New : Better support for animated gifs</li>\n<li>New : Hover icons retina support</li>\n<li>New : Uninstall button on settings</li>\n<li>New : Save thumb dimensions per attachment. (needed in future versions)</li>\n<li>Fix : Extensions refactor and many issues resolved</li>\n<li>Fix : Better retina support for all templates</li>\n<li>Fix : Colorize / Greyscale CSS filters</li>\n<li>Fix : Even better wpthumb compatibility</li>\n</ul>\n\n<h4>1.2.18</h4>\n\n<ul>\n<li>Fix : Handle no settings in retina metabox</li>\n</ul>\n\n<h4>1.2.17</h4>\n\n<ul>\n<li>New : Retina support - metabox per gallery and default settings</li>\n<li>New : Attachment datasources - backend changes for how images are used in a gallery. (This will allow for new external sources in the future)</li>\n<li>New : Caption color settings in Simple portfolio gallery template</li>\n<li>New : Updated to latest Justified Gallery</li>\n<li>Fix : Better wpthumb compatibility</li>\n</ul>\n\n<h4>1.2.16</h4>\n\n<ul>\n<li>Fix : Yoast SEO Sitemaps fatal error with deleted galleries</li>\n<li>Fix : Updating pages with deleted galleries throws php warnings</li>\n</ul>\n\n<h4>1.2.15</h4>\n\n<ul>\n<li>Fix : Album admin CSS issues in WP 4.6</li>\n<li>Fix : Masonry layout issues in WP 4.6</li>\n<li>Fix : Media attachment fields not updating</li>\n<li>Fix : Better support for IE10</li>\n<li>New : Thumbnail generation test admin notice and settings</li>\n</ul>\n\n<h4>1.2.13</h4>\n\n<ul>\n<li>Fix : Shortcode replacing content in visual editor</li>\n<li>Fix : Gallery hover effect of None being ignored</li>\n<li>New : ImageViewer language settings for \'Prev\', \'Next\' &amp; \'of\'</li>\n<li>New : Setting to use original thumbnails if available</li>\n</ul>\n\n<h4>1.2.12</h4>\n\n<ul>\n<li>Fix : Simple Portfolio missing captions fix</li>\n</ul>\n\n<h4>1.2.11</h4>\n\n<ul>\n<li>Fix : Simple Portfolio undefined function fix</li>\n</ul>\n\n<h4>1.2.10</h4>\n\n<ul>\n<li>New : support for multiple admin JS and CSS assets for gallery templates</li>\n<li>New : Added setting to choose Caption Description source</li>\n<li>New : Crop position can be chosen for attachments</li>\n<li>New : Albums gallery details modal for setting a gallery URL</li>\n<li>New : Better shortcode preview in editor</li>\n<li>New : Editor button now supported if multiple editors exist</li>\n<li>Fix : Better No-Link support for gallery templates</li>\n<li>Fix : Compatible with Unyson plugin</li>\n<li>Fix : Compatible with Advanced Custom Fields</li>\n<li>Fix : Simple Portfolio fixes and tweaks</li>\n<li>Fix : ImageViewer fixes and better browser compatibility</li>\n<li>Fix : Changed assets enqueue version to rather use extension version</li>\n<li>Fix : Album URL fix for permalinks with no trailing slashes</li>\n</ul>\n\n<h4>1.2.9</h4>\n\n<ul>\n<li>New : Added Image Viewer gallery template</li>\n<li>New : Caption support for default template</li>\n<li>New : Yoast SEO gallery image support!</li>\n<li>New : Responsive options for Masonry gallery</li>\n<li>New : change gallery URL slug for albums</li>\n<li>New : setting to turn off loading animation in default gallery</li>\n<li>New : French translation</li>\n<li>Fix : Support for WP 4.4</li>\n<li>Fix : All templates - moved all jQuery ready events to vanilla JS</li>\n<li>Fix : Many gallery template tweaks</li>\n<li>Fix : allow no default to be chosen in settings</li>\n</ul>\n\n<h4>1.2.8</h4>\n\n<ul>\n<li>Works now with Polylang translation plugin</li>\n<li>CSS Updates &amp; enhancements to all gallery templates</li>\n<li>Password protected galleries now work as expected</li>\n<li>Ability to hide WYSIWYG editor button</li>\n<li>Updated WPThumb</li>\n<li>Multiple bug fixes and improvements</li>\n</ul>\n\n<h4>1.2.7</h4>\n\n<ul>\n<li>Bug fixes for 1.2.6 release</li>\n<li>Added 2 new settings to Justified Gallery template (maxRowHeight + Caption Source)</li>\n</ul>\n\n<h4>1.2.6</h4>\n\n<ul>\n<li>CSS load optimizations</li>\n<li>Updates and tweaks on all built-in gallery templates</li>\n<li>More robust extension loading</li>\n<li>More robust upgrades to FooBox PRO</li>\n<li>Improved copy-to-clipboard</li>\n<li>Added more hover effects</li>\n<li>Support for FooVideo</li>\n</ul>\n\n<h4>1.2.5</h4>\n\n<ul>\n<li>Fix for extensions being empty</li>\n<li>Added support for Multi-site</li>\n<li>Added esc_url to all places where url is rendered</li>\n<li>Updated to latest Justified Gallery v3.5.4</li>\n</ul>\n\n<h4>1.2.4</h4>\n\n<ul>\n<li>Many album template updates, enhancements and fixes</li>\n<li>Many gallery template tweaks and fixes</li>\n<li>Sort order settings for galleries and albums</li>\n<li>Added new Single Thumbnail Gallery template</li>\n</ul>\n\n<h4>1.2.1</h4>\n\n<ul>\n<li>Added setting to choose default gallery to copy settings from</li>\n<li>Fixed bug #45 - gallery fields not showing onload</li>\n<li>replaced minicolors with spectrum colorpicker</li>\n<li>Allow gallery fields to have a suffix</li>\n<li>Added function to render galleries \"foogallery_render_gallery( $gallery_id )\"</li>\n</ul>\n\n<h4>1.2.0</h4>\n\n<ul>\n<li>Added albums extension</li>\n<li>Added custom CSS metaboxes</li>\n<li>Updated Nextgen importer</li>\n<li>Fixed many bugs</li>\n</ul>\n\n<h4>1.1.8.2</h4>\n\n<ul>\n<li>Fixed \"edit gallery\" CSS with WP 4.0</li>\n</ul>\n\n<h4>1.1.8.1</h4>\n\n<ul>\n<li>Fixed \"insert gallery\" CSS with WP 4.0</li>\n</ul>\n\n<h4>1.1.8</h4>\n\n<ul>\n<li>Added 2 new gallery templates</li>\n<li>Added 10+ actions and filters for more customization</li>\n<li>Countless bug fixes and enhancements</li>\n</ul>\n\n<h4>1.1.7</h4>\n\n<ul>\n<li>first version!</li>\n</ul>\";s:11:\"screenshots\";s:0:\"\";}s:14:\"upgrade_notice\";s:0:\"\";s:11:\"donate_link\";s:22:\" http://fooplugins.com\";s:7:\"banners\";O:8:\"stdClass\":1:{s:3:\"low\";s:64:\"https://ps.w.org/foogallery/assets/banner-772x250.jpg?rev=946615\";}s:7:\"version\";s:6:\"1.9.34\";s:13:\"download_link\";s:387:\"https://api.freemius.com/v1/installs/5686883/updates/20894.zip?is_premium=false&authorization=FSLA+5686883%3AvyeFjYSH7RnPLVG_W8MEp-KFqud2X-4xx8jM--924wUjm_CNrzFmwpTTmDdgtZqQTOQfA-q1aVMdgET0hc5rysR9OiP1Ar08EasAODkik0U2ZymoBvQp01ZM943MJUo5N_D2OUXr4M2y3x9HD6ZYi0ircFcV1Rzyg4pLNEOScJXiEtBmYeeyVjyFh7MviryTOJBczfJyKvlVmoWw7zGL7FfNhv_tBcGbUUsPZCH0Hza0807D7cmx44r8mwg4CH4eV7QlT2bPMwy7kDW4Er0wiQ\";}}s:7:\"created\";i:1601998391;s:9:\"timestamp\";i:1602001991;}s:67:\"get:/v1/users/3755235/plugins/843/payments.json?include_addons=true\";O:8:\"stdClass\":3:{s:6:\"result\";O:8:\"stdClass\":1:{s:8:\"payments\";a:0:{}}s:7:\"created\";i:1601998391;s:9:\"timestamp\";i:1602084791;}s:55:\"get:/v1/users/3755235.json?plugin_id=374&fields=is_beta\";O:8:\"stdClass\":3:{s:6:\"result\";O:8:\"stdClass\":2:{s:2:\"id\";s:7:\"3755235\";s:7:\"is_beta\";b:0;}s:7:\"created\";i:1608120577;s:9:\"timestamp\";i:1608206977;}s:64:\"get:/v1/users/3755235/plugins/374/licenses.json?is_enriched=true\";O:8:\"stdClass\":3:{s:6:\"result\";O:8:\"stdClass\":1:{s:8:\"licenses\";a:0:{}}s:7:\"created\";i:1608120577;s:9:\"timestamp\";i:1608206977;}}', 'no'),
