\";s:26:\"WordPress 5.6 Simone\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://en-gb.wordpress.org/2020/12/09/wordpress-5-6-simone/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://en-gb.wordpress.org/2020/12/09/wordpress-5-6-simone/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 09 Dec 2020 00:01:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://en-gb.wordpress.org/?p=1309\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:338:\"Meet Simone, our latest and greatest WordPress release. Named in honour of the legendary performer Nina Simone, who is known for tunes like Feeling Good, Young, Gifted and Black, and Four Women. Fire up a playlist with her best work and read on to discover what we have in store for you. Welcome to WordPress [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Mark Robson\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:61064:\"\n<p>Meet Simone, our latest and greatest WordPress release. Named in honour of the legendary performer Nina Simone, who is known for tunes like Feeling Good, Young, Gifted and Black, and Four Women. Fire up a playlist with her best work and read on to discover what we have in store for you.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i2.wp.com/wordpress.org/news/files/2020/12/wordpress-5-6_cover-a11y.jpg?resize=632%2C633&amp;ssl=1\" alt=\"WordPress 5.6 Simone with a photo of Nina Simone\" class=\"wp-image-9416\" /></figure>\n\n\n\n<p>Welcome to WordPress 5.6</p>\n\n\n\n<h3>Sharing your stories has never been easier.</h3>\n\n\n\n<p>WordPress 5.6 brings you countless ways to set your ideas free and bring them to life. With a brand-new default theme as your canvas, it supports an ever-growing collection of blocks as your brushes. Paint with words. Pictures. Sound. Or rich embedded media.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i0.wp.com/wordpress.org/news/files/2020/12/WordPress5-6-1.jpeg?resize=632%2C234&amp;ssl=1\" alt=\"colored circles\" class=\"wp-image-9346\" /></figure>\n\n\n\n<h3>Greater layout flexibility</h3>\n\n\n\n<p>Bring your stories to life with more tools that let you edit your layout with or without code. Single column blocks, designs using mixed widths and columns, full-width headers, and gradients in your cover block  make small changes or big statements with equal ease!</p>\n\n\n\n<h3>More block patterns</h3>\n\n\n\n<p>In some themes, preconfigured block patterns make setting up standard pages on your site a breeze. Let the power of patterns streamline your workflow and save you clicks. Plus, share these features with clients, editors, and more.</p>\n\n\n\n<h3>Better video captioning</h3>\n\n\n\n<p>To help you add subtitles or captions to your videos, you can now upload them within your post or page. This makes it easier than ever to make your videos accessible for anyone who needs or prefers to use subtitles.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i2.wp.com/wordpress.org/news/files/2020/12/WordPress5-6-2.jpeg?resize=632%2C120&amp;ssl=1\" alt=\"black vertical line\" class=\"wp-image-9347\" /></figure>\n\n\n\n<h2>Twenty Twenty-One is here!</h2>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://i0.wp.com/wordpress.org/news/files/2020/12/TT1-Screenshots-Compressed.png?ssl=1\"><img src=\"https://i0.wp.com/wordpress.org/news/files/2020/12/TT1-Screenshots-Compressed.png?resize=632%2C714&amp;ssl=1\" alt=\"Examples of block patterns available in Twenty Twenty-One.\" class=\"wp-image-9426\" /></a></figure>\n\n\n\n<p>Twenty Twenty-One is a blank canvas for your ideas, and the block editor is the best brush. It is built for the block editor and packed with brand-new block patterns you can only get in the default themes. Try different layouts in a matter of seconds, and let the themes eye-catching, yet timeless design make your work shine.&nbsp;</p>\n\n\n\n<p>Whats more, this default theme puts accessibility at the heart of your website. It conforms to the&nbsp;<a href=\"https://make.wordpress.org/themes/handbook/review/accessibility/\">WordPress accessibility-ready guidelines</a>&nbsp;and addresses several more specialised standards from the&nbsp;<a href=\"https://www.w3.org/WAI/WCAG2AAA-Conformance\">Web Content Accessibility Guidelines (WCAG) 2.1 at level AAA</a>. It will help you meet the highest level of international accessibility standards when you create accessible content and choose plugins which are accessible too!</p>\n\n\n\n<h3>A rainbow of soft pastels</h3>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://i2.wp.com/wordpress.org/news/files/2020/12/Rainbow-Compressed.png?ssl=1\"><img src=\"https://i2.wp.com/wordpress.org/news/files/2020/12/Rainbow-Compressed.png?resize=632%2C167&amp;ssl=1\" alt=\"A mobile screenshot of each included color palette in Twenty Twenty-One, going in ROYGBIV order.\" class=\"wp-image-9424\" /></a></figure>\n\n\n\n<p>Perfect for a new year, Twenty Twenty-One gives you a range of pre-selected colour palettes in pastel, all of which conform to AAA standards for contrast. You can also choose your own background colour for the theme, and the theme chooses accessibility-conscious text colours for you  automatically!</p>\n\n\n\n<p>Need more flexibility than that? You can also choose your own colour palette from the colour picker.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i0.wp.com/wordpress.org/news/files/2020/12/WordPress5-6-3.jpeg?resize=632%2C151&amp;ssl=1\" alt=\"colored circles\" class=\"wp-image-9351\" /></figure>\n\n\n\n<h2>Improvements for everyone</h2>\n\n\n\n<h3>Expanding auto-updates</h3>\n\n\n\n<p>For years, only developers have been able to update WordPress automatically. But now you have that option, right in your dashboard. If this is your first site, you have auto-updates ready to go, right now! Upgrading an existing site? No problem! Everything is the same as it was before.</p>\n\n\n\n<h3>Accessibility Statement&nbsp;</h3>\n\n\n\n<p>Even if youre not an expert, you can start letting others know about your sites commitment to accessibility! The new&nbsp;<a href=\"https://github.com/10degrees/accessibility-statement-plugin\">feature plugin</a>&nbsp;includes template copy for you to edit and publish, and its written to support different contexts and jurisdictions.&nbsp;&nbsp;</p>\n\n\n\n<h3>Built-in Patterns</h3>\n\n\n\n<p>If youve not had the chance to play with block patterns yet, all default themes now feature a range of block patterns that let you master complex layouts with minimal effort. Customise the patterns to your liking with the copy, images, and colours that fit your story or brand.&nbsp;</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i0.wp.com/wordpress.org/news/files/2020/12/WordPress-5-6-4.jpeg?resize=632%2C185&amp;ssl=1\" alt=\"colored and textured rectangles\" class=\"wp-image-9352\" /></figure>\n\n\n\n<h2>For developers</h2>\n\n\n\n<h3>REST API authentication with Application Passwords</h3>\n\n\n\n<p>Thanks to the APIs new Application Passwords authorisation feature, third-party apps can connect to your site seamlessly and securely. This new REST API feature lets you see what apps are connecting to your site and control what they do.&nbsp;</p>\n\n\n\n<h3>More PHP 8 support</h3>\n\n\n\n<p>5.6 marks the first steps toward WordPress Core support for PHP 8. Now is a great time to start planning how your WordPress products, services, and sites can support the latest PHP version. For more information about what to expect next,&nbsp;<a href=\"https://make.wordpress.org/core/2020/11/23/wordpress-and-php-8-0/\">read the PHP 8 developer note</a>.</p>\n\n\n\n<h3>jQuery</h3>\n\n\n\n<p>Updates to jQuery in WordPress take place across three releases 5.5, 5.6, and 5.7. As we reach the mid-point of this process,&nbsp;<a href=\"https://wordpress.org/plugins/wp-jquery-update-test/\">run the update test plugin to check your sites for errors</a>&nbsp;ahead of time.&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n\n\n<p>If you find issues with the way your site looks (eg a slider doesnt work, a button is stuck  that sort of thing), install&nbsp;<a href=\"https://wordpress.org/plugins/enable-jquery-migrate-helper/\">the jQuery Migrate plugin</a>.</p>\n\n\n\n<h3>Check out the Field Guide</h3>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/2020/11/20/wordpress-5-6-field-guide/\">Read about the latest version of WordPress in this guide</a>. It highlights developer notes for each change in the release.&nbsp;</p>\n\n\n\n<p>Its a new day, its a new life for me.and Im feeling good.</p>\n\n\n\n<h3>~Nina Simone</h3>\n\n\n\n<h2>The Squad</h2>\n\n\n\n<p>The WordPress 5.6 release comes to you from an all-women release squad:&nbsp;&nbsp;</p>\n\n\n\n<ul><li><strong>Release Lead:</strong>&nbsp;Josepha Haden (<a href=\"https://profiles.wordpress.org/chanthaboune/\">@chanthaboune</a>).&nbsp; Cohort: Chlo Bringmann (<a href=\"https://profiles.wordpress.org/cbringmann/\">@cbringmann</a>) and Angela Jin (<a href=\"https://profiles.wordpress.org/angelasjin/\">@angelasjin</a>).</li><li><strong>Release Coordinator:</strong>&nbsp;Dee Teal (<a href=\"https://profiles.wordpress.org/thewebprincess/\">@thewebprincess</a>).&nbsp; Cohort: Thelma Mutete (<a href=\"https://profiles.wordpress.org/thelmachido/\">@thelmachido</a>) and Laura Nelson (<a href=\"https://profiles.wordpress.org/laurora/\">@laurora</a>).</li><li><strong>Triage Lead:</strong>&nbsp;Tonya Mork (<a href=\"https://profiles.wordpress.org/hellofromtonya/\">@hellofromtonya</a>).&nbsp;</li><li><strong>Core Tech Lead:</strong>&nbsp;Helen Hou-Sand (<a href=\"https://profiles.wordpress.org/helen/\">@helen</a>).&nbsp; Cohort: Amy Kamala (<a href=\"https://profiles.wordpress.org/amykamala/\">@amykamala</a>) and Ebonie Butler (<a href=\"https://profiles.wordpress.org/metalandcoffee/\">@metalandcoffee</a>).</li><li><strong>Editor Tech Lead:</strong>&nbsp;Isabel Brison (<a href=\"https://profiles.wordpress.org/isabel_brison/\">@isabel_brison</a>).&nbsp; Cohort: Chandrika Guntur (<a href=\"https://profiles.wordpress.org/cguntur/\">@cguntur</a>), Anchen le Roux (<a href=\"https://profiles.wordpress.org/anchenlr/\">@anchenlr</a>), and Rebecca Hum (<a href=\"https://profiles.wordpress.org/rebasaurus/\">@rebasaurus</a>).</li><li><strong>Design Leads:</strong>&nbsp;Ellen Bauer (<a href=\"https://profiles.wordpress.org/elmastudio/\">@elmastudio</a>) and Tammie Lister (<a href=\"https://profiles.wordpress.org/karmatosed/\">@karmatosed</a>).&nbsp; Cohort: Anyssa Ferreira (<a href=\"https://profiles.wordpress.org/anyssa/\">@anyssa</a>), Estela Rueda (<a href=\"https://profiles.wordpress.org/estelaris/\">@estelaris</a>), Tracy Apps (<a href=\"https://profiles.wordpress.org/tray/\">@tray</a>), and Sophia DeRosia (<a href=\"https://profiles.wordpress.org/eringoblog/\">@eringoblog</a>).</li><li><strong>Design Tech Lead:</strong>&nbsp;Shital Marakana (<a href=\"https://profiles.wordpress.org/shital-patel/\">@shital-patel</a>).</li><li><strong>Accessibility Lead:</strong>&nbsp;Sarah Ricker (<a href=\"https://profiles.wordpress.org/sarahricker/\">@sarahricke<strong>r</strong></a>).&nbsp;Cohort: Hauwa Abashiya (<a href=\"https://profiles.wordpress.org/azhiyadev/\">@azhiyadev</a>).</li><li><strong>Marketing &amp; Communications Leads:</strong>&nbsp;Abha Thakor (<a href=\"https://profiles.wordpress.org/webcommsat/\">@webcommsat</a>) and Yvette Sonneveld (<a href=\"https://profiles.wordpress.org/yvettesonneveld/\">@yvettesonneveld</a>).&nbsp;Cohort: Nalini Thakor (<a href=\"https://profiles.wordpress.org/nalininonstopnewsuk/\">@nalininonstopnewsuk</a>), Meher Bala (<a href=\"https://profiles.wordpress.org/meher/\">@meher</a>), Olga Gleckler (<a href=\"https://profiles.wordpress.org/oglekler/\">@ogleckler</a>), Larissa Murrillo (<a href=\"https://profiles.wordpress.org/lmurillom/\">@lmurillom</a>), Michelle Frechette (<a href=\"https://profiles.wordpress.org/michelleames/\">@michelleames</a>), Breann McDede (<a href=\"https://profiles.wordpress.org/bmcdede/\">@bmcdede</a>), and Afshana Diya (<a href=\"https://profiles.wordpress.org/afshanadiya/\">@afshanadiya</a>).</li><li><strong>Documentation Lead:&nbsp;</strong>Shawntelle Coker (<a href=\"https://profiles.wordpress.org/sncoker/\">@sncoker</a>). Cohort: Daisy Olsen (<a href=\"https://wordpress.slack.com/team/U8D7JFA3X\">@DaisyO</a>), Meher Bala (<a href=\"https://profiles.wordpress.org/meher/\">@meher</a>), Winstina Hughes (<a href=\"https://profiles.wordpress.org/planningwrite/\">@planningwrite</a>).</li><li><strong>Documentation Review Lead:</strong>&nbsp;Michele Butcher-Jones (<a href=\"https://profiles.wordpress.org/m_butcher/\">@m_butcher</a>).&nbsp; Cohort: Nidhi Jain (<a href=\"https://profiles.wordpress.org/jainnidhi/\">@jainnidhi</a>), Laura Byrne Cristiano (<a href=\"https://wordpress.org/support/users/newyorkerlaura/\">@newyorkerlaura</a>).</li><li><strong>Default Theme Design Lead:</strong>&nbsp;Mel Choyce-Dwan (<a href=\"https://profiles.wordpress.org/melchoyce/\">@melchoyce</a>).&nbsp; Cohort: Ellen Bauer (<a href=\"https://profiles.wordpress.org/elmastudio/\">@elmastudio</a>).</li><li><strong>Default Theme Development Lead:</strong>&nbsp;Carolina Nymark (<a href=\"https://profiles.wordpress.org/poena/\">@poena</a>).&nbsp; Cohort: Kelly Choyce-Dwan (<a href=\"https://profiles.wordpress.org/ryelle/\">@ryelle</a>) and Jessica Lyschik (<a href=\"https://profiles.wordpress.org/luminuu/\">@luminuu</a>).</li><li><strong>Default Theme Wrangler:</strong>&nbsp;Jessica Lyschik (<a href=\"https://profiles.wordpress.org/luminuu/\">@luminuu</a>).</li><li><strong>Test Lead:</strong>&nbsp;Monika Rao (<a href=\"https://profiles.wordpress.org/monikarao/\">@monikarao</a>).&nbsp; Cohort: Allie Nimmons (<a href=\"https://profiles.wordpress.org/alliennimmons/\">@alliennimmons</a>).</li><li><strong>Support Lead:</strong>&nbsp;Bet Hannon (<a href=\"https://profiles.wordpress.org/bethannon1/\">@bethannon1</a>).</li></ul>\n\n\n\n<p>As always, this release reflects the hard work of 605 generous volunteer contributors. They collaborated on nearly 350 tickets on Trac and over 1,000 pull requests on GitHub. <a href=\"https://profiles.wordpress.org/zgrkaralar/\">zgr KARALAR</a>,&nbsp;<a href=\"https://profiles.wordpress.org/1naveengiri/\">1naveengiri</a>,&nbsp;<a href=\"https://profiles.wordpress.org/a5hleyrich/\">A5hleyRich</a>,&nbsp;<a href=\"https://profiles.wordpress.org/aaroncampbell/\">Aaron D. Campbell</a>,&nbsp;<a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a>,&nbsp;<a href=\"https://profiles.wordpress.org/aaronrobertshaw/\">aaronrobertshaw</a>,&nbsp;<a href=\"https://profiles.wordpress.org/abderrahman/\">abderrahman</a>,&nbsp;<a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a>,&nbsp;<a href=\"https://profiles.wordpress.org/abhijitrakas/\">Abhijit Rakas</a>,&nbsp;<a href=\"https://profiles.word