l_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1215:\"\n<figure class=\"wp-block-image\"><img src=\"https://lh3.googleusercontent.com/YkeeKj7HAtuHuJs4jlLLzBgR8UXVdFsW7O-PUddOGrY1W8yXlZgsykykVYxGxmSDILkwvTQe0s_vqzHCrux--TEeDYsCnqXmHBi6oySNpN4QQHK3BSj087y9NS7aURHw6w\" alt=\"\" /></figure>\n\n\n\n<p>The global Polyglots team is conducting research among translation contributors to learn more about their experience.</p>\n\n\n\n<p>The questionnaire includes about 15 questions for individual translators or locale managers and editors. Our goal is to learn more about how contributors join Polyglots, why they contribute, and how to make their contributor experience better.</p>\n\n\n\n<p>The results of this research will be used to inform future discussions about team priorities, including documentation, tools, and other ideas, especially as we plan for 2021. Hearing from both experienced contributors, and newcomers, will be extremely helpful  the more voices, the better!</p>\n\n\n\n<p>The form is open from 9 November 2020 to 8 December 2020.</p>\n\n\n\n<p><a href=\"https://wordpressdotorg.survey.fm/polyglots-translator-research\">Click here to share your translation experience</a>.</p>\n\n\n\n<p>Thank you so much for your contribution, and for being part of the Polyglots community.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://en-gb.wordpress.org/2020/11/09/help-improve-wordpress-translation/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"x