(552, 195, '_wp_attachment_metadata', 'a:5:{s:5:\"width\";i:1539;s:6:\"height\";i:1039;s:4:\"file\";s:38:\"2020/12/cropped-logo-u3a-guildford.png\";s:5:\"sizes\";a:6:{s:6:\"medium\";a:4:{s:4:\"file\";s:38:\"cropped-logo-u3a-guildford-300x203.png\";s:5:\"width\";i:300;s:6:\"height\";i:203;s:9:\"mime-type\";s:9:\"image/png\";}s:5:\"large\";a:4:{s:4:\"file\";s:39:\"cropped-logo-u3a-guildford-1024x691.png\";s:5:\"width\";i:1024;s:6:\"height\";i:691;s:9:\"mime-type\";s:9:\"image/png\";}s:9:\"thumbnail\";a:4:{s:4:\"file\";s:38:\"cropped-logo-u3a-guildford-150x150.png\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:9:\"image/png\";}s:12:\"medium_large\";a:4:{s:4:\"file\";s:38:\"cropped-logo-u3a-guildford-768x518.png\";s:5:\"width\";i:768;s:6:\"height\";i:518;s:9:\"mime-type\";s:9:\"image/png\";}s:9:\"1536x1536\";a:4:{s:4:\"file\";s:40:\"cropped-logo-u3a-guildford-1536x1037.png\";s:5:\"width\";i:1536;s:6:\"height\";i:1037;s:9:\"mime-type\";s:9:\"image/png\";}s:14:\"post-thumbnail\";a:4:{s:4:\"file\";s:39:\"cropped-logo-u3a-guildford-1200x810.png\";s:5:\"width\";i:1200;s:6:\"height\";i:810;s:9:\"mime-type\";s:9:\"image/png\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),
