(129, 1, '2020-10-06 16:00:21', '2020-10-06 15:00:21', '<!-- wp:paragraph -->\n<p>The Group</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Forty or so of us meet in Guildford every month. Beginners and experts, we use every sort of camera from compact to DSLR.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are part of Guildford U3A (University of the Third Age) </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Open our <a href=\"https://u3aguildfordphoto.org.uk/visintro/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_members&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">members gallery slideshow</a> and see what we do!<br>Click any button to stop the slideshow</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Want to see more?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Follow a link in one of the menus for the following topics:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"http://localhost:81/u3aphotogroup/using-the-photo-gallery/\" data-type=\"page\" data-id=\"53\">using the gallery</a></li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/\" data-type=\"page\" data-id=\"67\">camera tips</a></li><li><a href=\"https://u3aguildfordphoto.org.uk/visintro/main.pl?edit_intro\">introduction to digital editing</a></li></ul>\n<!-- /wp:list -->', 'About Us', '', 'inherit', 'closed', 'closed', '', '44-revision-v1', '', '', '2020-10-06 16:00:21', '2020-10-06 15:00:21', '', 44, 'http://localhost:81/u3aphotogroup/2020/10/06/44-revision-v1/', 0, 'revision', '', 0),
(131, 1, '2020-10-06 16:19:42', '2020-10-06 15:19:42', '<!-- wp:paragraph -->\n<p>Our aim: <strong>To inspire you to create better photos</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Welcome! Here are the most important topics to help you get started with digital photography and the way the group works.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>The Group</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Forty or so of us meet in Guildford every month to share photos and to learn. Beginners and experts, we use every sort of camera from compact to DSLR.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Open our <a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_members&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">members gallery slideshow</a> and see what we do!<br>Click any button to stop the slideshow</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As a window on the wider world, we regularly exchange photos with Rotorua U3A in New Zealand.<br><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_rotorua&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">Rotorua gallery slideshow</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Want to see more?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Click a link in one of the menus for:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?programme_2019\">2019-2020 programme</a></li><li><a href=\"http://localhost:81/u3aphotogroup/using-the-photo-gallery\" data-type=\"URL\" data-id=\"http://localhost:81/u3aphotogroup/using-the-photo-gallery\">using the gallery</a> </li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/\" data-type=\"page\" data-id=\"67\">camera tips</a></li><li><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?tech_intro\">technical introduction</a></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Join us</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you live in the Guildford area and would like to explore joining the group, please email our <a href=\"mailto:members@u3aguildfordphoto.org.uk\">membership secretary</a>. You also need to be a member of <a href=\"http://www.guildfordu3a.org.uk\" target=\"_blank\" rel=\"noreferrer noopener\">Guildford U3A</a> [new window].</p>\n<!-- /wp:paragraph -->', 'Getting Started', '', 'inherit', 'closed', 'closed', '', '60-revision-v1', '', '', '2020-10-06 16:19:42', '2020-10-06 15:19:42', '', 60, 'http://localhost:81/u3aphotogroup/2020/10/06/60-revision-v1/', 0, 'revision', '', 0),
(130, 1, '2020-10-06 16:04:33', '2020-10-06 15:04:33', '<!-- wp:paragraph -->\n<p>The Group</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Forty or so of us meet in Guildford every month. Beginners and experts, we use every sort of camera from compact to DSLR.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are part of Guildford U3A (University of the Third Age) so you need to join this organisation before you can apply to our group. There is no additional charge to join any of the U3A\'s many interest groups.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The University of the Third Age is an educational self-help organization for the retired or semi-retired. It draws on the wealth of knowledge and experience of its members to set up study groups and common interest groups and to organize recreational activities.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Open our <a href=\"https://u3aguildfordphoto.org.uk/visintro/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_members&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">members gallery slideshow</a> and see what we do!<br>Click any button to stop the slideshow</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Want to see more?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Follow a link in one of the menus for the following topics:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"http://localhost:81/u3aphotogroup/using-the-photo-gallery/\" data-type=\"page\" data-id=\"53\">using the gallery</a></li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/\" data-type=\"page\" data-id=\"67\">camera tips</a></li><li><a href=\"https://u3aguildfordphoto.org.uk/visintro/main.pl?edit_intro\">introduction to digital editing</a></li></ul>\n<!-- /wp:list -->', 'About Us', '', 'inherit', 'closed', 'closed', '', '44-revision-v1', '', '', '2020-10-06 16:04:33', '2020-10-06 15:04:33', '', 44, 'http://localhost:81/u3aphotogroup/2020/10/06/44-revision-v1/', 0, 'revision', '', 0),
(132, 1, '2020-10-06 16:25:13', '2020-10-06 15:25:13', '', 'BestPics', '', 'publish', 'closed', 'closed', '', 'bestpics', '', '', '2020-12-02 11:30:53', '2020-12-02 11:30:53', '', 0, 'http://localhost:81/u3aphotogroup/?post_type=foogallery&#038;p=132', 0, 'foogallery', '', 0),
(133, 1, '2020-10-06 16:28:33', '2020-10-06 15:28:33', '<h2>The Group</h2>\n<p>Forty or so of us meet in Guildford every month to share photos and to learn. Beginners and experts, we use every sort of camera from compact cameras and smart phones to DSLR.</p>\n<p>It\'s easy to make a good picture into a great one. We can show you how. How best to use your camera, how to compose the shot and how to edit it afterwards.</p>\n<p>Open our <a href=\"https://u3aguildfordphoto.org.uk/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_members&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">members gallery slideshow</a> and see what we do!<br>\nClick any button to stop the slideshow</p>\n<p>As a window on the wider world, we exchange photos annually with Rotorua U3A in New Zealand.<br>\n<a href=\"https://u3aguildfordphoto.org.uk/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_rotorua&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">Rotorua gallery slideshow</a></p>\n\n<!-- wp:heading -->\n<h2>Our Member\'s Work</h2>\n<!-- /wp:heading -->\n\n<!-- wp:fooplugins/foogallery {\"id\":132} /-->', 'Welcome to the Guildford U3A Photography Group', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2020-10-06 16:28:33', '2020-10-06 15:28:33', '', 35, 'http://localhost:81/u3aphotogroup/2020/10/06/35-revision-v1/', 0, 'revision', '', 0),
(134, 1, '2020-10-06 17:04:53', '2020-10-06 16:04:53', '<!-- wp:heading {\"level\":3} -->\n<h3>Who we are</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Guildford U3A Photography Group (GUPG) is one of the Guildford U3A groups. We are run entirely by volunteers.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>email address for correspondence:<br>&nbsp; &nbsp; <a href=\"mailto:members@u3aguildfordphoto.org.uk\">members@u3aguildfordphoto.org.uk</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our overall approach to GDPR is set out in our <a href=\"https://u3aguildfordphoto.org.uk/main.pl?gdpr_general\">General GDPR Documentation</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What this Privacy Notice applies to</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We take great care to protect your Personal Information and to give you the opportunity to manage how it is used.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This notice applies to all Personal Information processed by GUPG. Our recording and processing of your Personal Information is on the basis of Legitimate Interest based on the services we provide to you, which is principally to arrange a programme of monthly meetings and photoshoots.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We maintain a Mailing List and certain other information, described below. We use our Mailing List to send you news about the group, to inform you about our events, to invite your feedback and for administration. We may also advise you about photographic events and technical information likely to be of interest to members. Your Personal Information is never used to send messages on behalf of third parties nor revealed to others except in the very unlikely case of legal necessity.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If anything in this Privacy Notice is not acceptable to you, you may join GUPG but we will be unable to keep you informed about our activities and you will not be able to use our online applications, for example to upload photos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>GUPG Core Group</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Any member can volunteer to join a Core Group which manages our activities.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Our records</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Mailing List</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>When you join the group your name, email address, telephone number, year of joining GUPG and U3A membership number are recorded offline in a spreadsheet to form our Mailing List.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A copy of the Mailing List is maintained online, also controlling which applications you can use. All registered members are authorised to upload photos. After training authorised members are in addition able to access the contact information of group members.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You remain on the Mailing List while you are an active member. When you leave the group, your Personal Information is deleted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Images</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Images uploaded by or on behalf of members to our public website always include your name, which is visible to website visitors. Images uploaded more than two years previously are deleted in July each year. We do not automatically delete photos when you leave the group. If at any time you wish us to delete some or all of your photos, please contact our <a href=\"mailto:webmaster@u3aguildfordphoto.org.uk\">webmaster@u3aguildfordphoto.org.uk</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We may use images for instructional purposes at GUPG meetings.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Images may be used without notice for publicity purposes on behalf of GUPG providing the photographer and the group are mentioned.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As images are uploaded you are asked to warrant that you hold the full copyright (or that you have the copyright holder\'s explicit permission if submitting on behalf of someone else).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Image copyright remains with the photographer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Online data</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Encrypted passwords are held in small text files created and updated by our applications. The only Personal Information in password files is your email address. Password files more than 12 months old are deleted in July each year, whether or not you remain a member of the group.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We may occasionally ask you to complete an online questionnaire. Answers are held in small text files which include your name and email address. These files can be displayed individually or analysed together by authorised members using one of our applications. They are deleted not later than the second July following the questionnaire. The questionnaire application is also used for commenting on images, in particular the annual Rotorua photo exchange.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our online data cannot be accessed directly. It can be accessed though one of our applications which, with the exception of comments on images, are protected by one or more passwords.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our website applications (eg the questionnaire) write an activity log to a secure area used mainly for problem solving on behalf of users, but also available for audit purposes. Individual users can be identified. The log never includes user passwords. This log has nothing to do with cookies and does not write any information to your computer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Data Security</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Your information can be seen and processed by authorised members on a need-to-know basis. These members are required to confirm in writing that they will comply with the letter and the spirit of this Privacy Notice and with our <a href=\"https://u3aguildfordphoto.org.uk/main.pl?data_protection\">Data Protection Policy</a>, which includes a commitment to maintaining effective data security. Those members using our online information are given appropriate training.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Your rights</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>You have the right at any time to ask for your Personal Information to be deleted. You may remain a member of the group but we will be unable to keep you informed about our activities and you will not be able to use our online applications, for example to upload photos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you wish to know what Personal Information we hold about you or you believe the information we hold on you may be incorrect you can request to see this information and have it corrected or deleted. If you wish to raise a complaint on how we have used your Personal Information, we will investigate. For all of these, please email <a href=\"mailto:members@u3aguildfordphoto.org.uk\">members@u3aguildfordphoto.org.uk</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are not satisfied with our response and continue to be unhappy about our processing of your Personal Information you can complain to the Information Commissioners Office (ICO). The information for doing this can be found at <a href=\"https://ico.org.uk/concerns/\">https://ico.org.uk/concerns/ ICO: Report a concern</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Winding up</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Should the group be wound up we will delete all our records. No Personal Information will be transferred elsewhere.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Changes to Privacy Notice</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We keep this Privacy Notice under constant review, so for the latest version please return here.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will not make significant changes to this Privacy Notice without advising you. If you do not agree to the revised conditions you can ask to have your Personal Information deleted from our records by contacting <a href=\"mailto:members@u3aguildfordphoto.org.uk\">members@u3aguildfordphoto.org.uk</a>, in which case you can if you wish remain a member of the group but we will be unable to keep you informed about our activities and you will not be able to use our online applications, for example to upload photos.</p>\n<!-- /wp:paragraph -->', 'Privacy', '', 'publish', 'closed', 'closed', '', 'privacy', '', '', '2020-10-06 17:04:54', '2020-10-06 16:04:54', '', 0, 'http://localhost:81/u3aphotogroup/?page_id=134', 0, 'page', '', 0),
