uch/half press shutter release button to focus]</li><li>compose photo [keep shutter release button half down to maintain focus and other settings, don\'t alter zoom]</li><li>take photo [fully press shutter release button]</li></ul>\n<!-- /wp:list -->', 'Camera Tips', '', 'inherit', 'closed', 'closed', '', '67-revision-v1', '', '', '2020-11-13 15:37:26', '2020-11-13 15:37:26', '', 67, 'http://localhost:81/u3aphotogroup/2020/11/13/67-revision-v1/', 0, 'revision', '', 0),
