(35, 1, '2020-09-22 11:46:44', '2020-09-22 10:46:44', '<h2>The Group</h2>\n<p>Forty or so of us meet in Guildford every month to share photos and to learn. Beginners and experts, we use every sort of camera from compact cameras and smart phones to DSLR.</p>\n<p>It\'s easy to make a good picture into a great one. We can show you how. How best to use your camera, how to compose the shot and how to edit it afterwards.</p>\n<p>Open our <a href=\"https://u3aguildfordphoto.org.uk/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_members&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">members gallery slideshow</a> and see what we do!<br>\nClick any button to stop the slideshow</p>\n<p>As a window on the wider world, we exchange photos annually with Rotorua U3A in New Zealand.<br>\n<a href=\"https://u3aguildfordphoto.org.uk/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_rotorua&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">Rotorua gallery slideshow</a></p>\n\n<!-- wp:heading -->\n<h2>Our Member\'s Work</h2>\n<!-- /wp:heading -->\n\n<!-- wp:fooplugins/foogallery {\"id\":132} /-->', 'Welcome to the Guildford U3A Photography Group', '', 'publish', 'closed', 'closed', '', 'welcome-to-the-guildford-u3a-photography-group', '', '', '2020-10-06 16:28:34', '2020-10-06 15:28:34', '', 0, 'http://localhost:81/u3aphotogroup/?page_id=35', 0, 'page', '', 0),
(36, 1, '2020-09-22 11:46:44', '2020-09-22 10:46:44', '<h2>The Group</h2>\n40 or so of us meet in Guildford every month to share photos and to learn. Beginners and experts, we use every sort of camera from compact to DSLR.\n\nIt\'s easy to make a good picture into a great one. We can show you how. How best to use your camera, how to compose the shot and how to edit it afterwards.\n\nOpen our members gallery slideshow and see what we do!\nClick any button to stop the slideshow\n\nAs a window on the wider world, we exchange photos annually with Rotorua U3A in New Zealand.\nRotorua gallery slideshow', 'Welcome to the Guildford U3A Photography Group', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2020-09-22 11:46:44', '2020-09-22 10:46:44', '', 35, 'http://localhost:81/u3aphotogroup/2020/09/22/35-revision-v1/', 0, 'revision', '', 0),
