(119, 1, '2020-09-23 18:22:03', '2020-09-23 17:22:03', '<!-- wp:paragraph -->\n<p>Hello everybody our next meeting is 14th October with photo submissions due on 7th October please.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On the agenda we have an optional item after the break of \'know your camera\'. To assist plan this please will you let me know by return e-mail</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1) your camera type if you wish to join this session</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2) If you can \'step up\' and do a breakout room for either Olympus or Lumix/Panasonic (we have Canon and Nikon \'covered\')</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Below is an interesting link that John Clark forwarded me, that you may find of interest.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://www.youtube.com/watch?v=F-TyPfYMDK8&amp;feature=share&amp;fbclid=IwAR0msqF8Q8BSPUbKKW2q07NLW2UEOjXeoXR2Igmx-MqZuyprhEhLyhOzoQo\">THE LAB: DECOY | 6 Photographers 1 Man - A Portrait Photography Session With A Twist</a></p>\n<!-- /wp:paragraph -->', 'Our Next Meeting', '', 'publish', 'closed', 'closed', '', 'our-next-meeting', '', '', '2020-10-07 15:46:06', '2020-10-07 14:46:06', '', 0, 'http://localhost:81/u3aphotogroup/?p=119', 0, 'post', '', 0),
(43, 1, '2020-09-22 12:22:22', '2020-09-22 11:22:22', '<h2>The Group</h2>\nForty or so of us meet in Guildford every month to share photos and to learn. Beginners and experts, we use every sort of camera from compact cameras and smart phones to DSLR.\n\nIt\'s easy to make a good picture into a great one. We can show you how. How best to use your camera, how to compose the shot and how to edit it afterwards.\n\nOpen our <a href=\"https://u3aguildfordphoto.org.uk/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_members&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">members gallery slideshow</a> and see what we do!\nClick any button to stop the slideshow\n\nAs a window on the wider world, we exchange photos annually with Rotorua U3A in New Zealand.\n<a href=\"https://u3aguildfordphoto.org.uk/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_rotorua&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">Rotorua gallery slideshow</a>', 'Welcome to the Guildford U3A Photography Group', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2020-09-22 12:22:22', '2020-09-22 11:22:22', '', 35, 'http://localhost:81/u3aphotogroup/2020/09/22/35-revision-v1/', 0, 'revision', '', 0),
(44, 1, '2020-09-22 12:41:17', '2020-09-22 11:41:17', '<!-- wp:paragraph -->\n<p>The Group</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Forty or so of us meet in Guildford every month. Beginners and experts, we use every sort of camera from compact to DSLR.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are part of Guildford U3A (University of the Third Age) so you need to join this organisation before you can apply to our group. There is no additional charge to join any of the U3A\'s many interest groups.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The University of the Third Age is an educational self-help organization for the retired or semi-retired. It draws on the wealth of knowledge and experience of its members to set up study groups and common interest groups and to organize recreational activities.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Open our <a href=\"https://u3aguildfordphoto.org.uk/visintro/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_members&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">members gallery slideshow</a> and see what we do!<br>Click any button to stop the slideshow</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Want to see more?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Follow a link in one of the menus for the following topics:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"http://localhost:81/u3aphotogroup/using-the-photo-gallery/\" data-type=\"page\" data-id=\"53\">using the gallery</a></li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/\" data-type=\"page\" data-id=\"67\">camera tips</a></li><li><a href=\"https://u3aguildfordphoto.org.uk/visintro/main.pl?edit_intro\">introduction to digital editing</a></li></ul>\n<!-- /wp:list -->', 'About Us', '', 'publish', 'closed', 'closed', '', 'visitors-introduction', '', '', '2020-10-06 16:13:46', '2020-10-06 15:13:46', '', 0, 'http://localhost:81/u3aphotogroup/?page_id=44', 0, 'page', '', 0),
(114, 1, '2020-09-22 15:15:40', '2020-09-22 14:15:40', '<!-- wp:paragraph -->\n<p>Welcome! The website is aimed primarily at group members, but this section has a few introductory pages for visitors.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>The Group</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Forty or so of us meet in Guildford every month. Beginners and experts, we use every sort of camera from compact to DSLR.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Open our <a href=\"https://u3aguildfordphoto.org.uk/visintro/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_members&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">members gallery slideshow</a> and see what we do!<br>Click any button to stop the slideshow</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Want to see more?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Follow a link in one of the menus for the following topics:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"http://localhost:81/u3aphotogroup/using-the-photo-gallery/\" data-type=\"page\" data-id=\"53\">using the gallery</a></li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/\" data-type=\"page\" data-id=\"67\">camera tips</a></li><li><a href=\"https://u3aguildfordphoto.org.uk/visintro/main.pl?edit_intro\">introduction to digital editing</a></li></ul>\n<!-- /wp:list -->', 'Visitors Introduction', '', 'inherit', 'closed', 'closed', '', '44-revision-v1', '', '', '2020-09-22 15:15:40', '2020-09-22 14:15:40', '', 44, 'http://localhost:81/u3aphotogroup/2020/09/22/44-revision-v1/', 0, 'revision', '', 0),
