(147, 1, '2020-11-13 14:46:26', '2020-11-13 14:46:26', '<!-- wp:paragraph -->\n<p>Hello everybody, I hope you enjoyed the Zoom meeting on Wednesday and the two very interesting presentations.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are 4 videos available in the Downloads section of our website https://u3aguildfordphoto.org.uk/main.pl?home - select \'downloads\' from the menu at the top left of the screen then look under Zoom meetings. You will then find a video for each of the Photoshoot Gallery, Members Gallery, Macro Photography presentation &amp; assignment and the presentation on composition.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Below is the you tube link to the video that includes the section that Gachou tried to run at the meeting.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://youtu.be/Z8J3kn06Ddw\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://youtu.be/Z8J3kn06Ddw\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p>As a reminder, there is no November photoshoot but we have an assignment topic of \'old doors\' for submissions to the photoshoot gallery for December\'s meeting - Gachou has set an extra challenge for us to try and experiment with \'composition\' with these photographs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Michael\'s macro assignment is due for submission for the January meeting should you wish to take part.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Any question on the above please just \'ping\' me an e-mail.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Take care and please stay safe.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Regards</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Jonathan</p>\n<!-- /wp:paragraph -->', 'Meeting recording', '', 'inherit', 'closed', 'closed', '', '146-revision-v1', '', '', '2020-11-13 14:46:26', '2020-11-13 14:46:26', '', 146, 'http://localhost:81/u3aphotogroup/2020/11/13/146-revision-v1/', 0, 'revision', '', 0),
(145, 1, '2020-11-12 16:05:19', '2020-11-12 16:05:19', '<!-- wp:paragraph -->\n<p>Hello everybody, just a reminder that submissions for our 11th November meeting for the members gallery and the photoshoot gallery should be submitted by this Wednesday please.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you did not manage to get up to the University to take some photo\'s for the photoshoot gallery please feel free so submit into the photoshoot gallery architectural images with an accent on lines and angles.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Also as we are going to be locked down for a good amount of the period up to the December meeting the theme for the December Phoroshoot gallery will be \'Old doors\', so if you are out and about on your \'permitted\' exercise and come across an old door or two you might like to take some shots.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Take care, see you on the 11th - log in details to follow.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Regards</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Jonathan</p>\n<!-- /wp:paragraph -->', 'November Zoom Meeting', '', 'inherit', 'closed', 'closed', '', '144-revision-v1', '', '', '2020-11-12 16:05:19', '2020-11-12 16:05:19', '', 144, 'http://localhost:81/u3aphotogroup/2020/11/12/144-revision-v1/', 0, 'revision', '', 0),
(146, 1, '2020-11-13 14:46:26', '2020-11-13 14:46:26', '<!-- wp:paragraph -->\n<p>Hello everybody, I hope you enjoyed the Zoom meeting on Wednesday and the two very interesting presentations.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are 4 videos available in the Downloads section of our website https://u3aguildfordphoto.org.uk/main.pl?home - select \'downloads\' from the menu at the top left of the screen then look under Zoom meetings. You will then find a video for each of the Photoshoot Gallery, Members Gallery, Macro Photography presentation &amp; assignment and the presentation on composition.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Below is the you tube link to the video that includes the section that Gachou tried to run at the meeting.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://youtu.be/Z8J3kn06Ddw\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://youtu.be/Z8J3kn06Ddw\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p>As a reminder, there is no November photoshoot but we have an assignment topic of \'old doors\' for submissions to the photoshoot gallery for December\'s meeting - Gachou has set an extra challenge for us to try and experiment with \'composition\' with these photographs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Michael\'s macro assignment is due for submission for the January meeting should you wish to take part.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Any question on the above please just \'ping\' me an e-mail.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Take care and please stay safe.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Regards</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Jonathan</p>\n<!-- /wp:paragraph -->', 'November Video', '', 'publish', 'closed', 'closed', '', 'meeting-recording', '', '', '2020-11-13 15:21:31', '2020-11-13 15:21:31', '', 0, 'http://localhost:81/u3aphotogroup/?p=146', 0, 'post', '', 0),
(53, 1, '2020-09-22 12:52:37', '2020-09-22 11:52:37', '<!-- wp:paragraph -->\n<p>The gallery is an excellent resource and central to what the group does. This page will help you make the most of it.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Making Gallery Choices</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Choose which images to show in the gallery on the <a href=\"https://u3aguildfordphoto.org.uk/visintro/gallery.pl?&amp;ghelp=yes&amp;morehelp=yes\">gallery choices</a> page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On that page, pre-selected choices are a good starting point except:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>for \'image size\' the pre-selected default choice \'small/small\' is fine for a slow Internet connection. For a fast connection select \'large/small\' if you wish to see images at their best.</li><li>the \'image gallery\' drop down list lets you choose which gallery to open. \'members\' and \'rotorua\' are probably the most interesting.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>On gallery pages</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Menus</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The only menu is at the bottom of the page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Moving between images</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Moving between images on gallery pages is designed to be intuitive, with symbols on buttons similar to video players.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Hover over any button to see what the button does.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:table -->\n<figure class=\"wp-block-table\"><table><tbody><tr><td>Buttons (in this colour)</td><td></td></tr><tr><td>&nbsp;?&nbsp;</td><td>show/hide help</td></tr><tr><td>&nbsp;|&nbsp;</td><td>go to first image page</td></tr><tr><td>&nbsp;&nbsp;</td><td>go to previous image page</td></tr><tr><td>&nbsp;&nbsp;</td><td>stop (in automatic slideshow only)</td></tr><tr><td>&nbsp;&nbsp;</td><td>go to next image page to start automatic slideshow select interval and click &nbsp;&nbsp; to stop slideshow click any button</td></tr><tr><td>&nbsp;|&nbsp;</td><td>go to last image page</td></tr><tr><td>&nbsp;#&nbsp;</td><td>go to image page number typed in the box</td></tr><tr><td>&nbsp;make gallery choices&nbsp;</td><td>opens the gallery choices page to make a new selection of images</td></tr><tr><td>any gallery image</td><td>click on any image to toggle between multiple and single image pages</td></tr></tbody></table></figure>\n<!-- /wp:table -->', 'Using the Photo Gallery', '', 'publish', 'closed', 'closed', '', 'using-the-photo-gallery', '', '', '2020-09-22 12:53:14', '2020-09-22 11:53:14', '', 0, 'http://localhost:81/u3aphotogroup/?page_id=53', 0, 'page', '', 0),
