(60, 1, '2020-09-22 13:04:11', '2020-09-22 12:04:11', '<!-- wp:paragraph -->\n<p>Our aim: <strong>To inspire you to create better photos</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Welcome! Here are the most important topics to help you get started with digital photography and the way the group works.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>The Group</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Forty or so of us meet in Guildford every month to share photos and to learn. Beginners and experts, we use every sort of camera from compact to DSLR.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Open our <a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_members&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">members gallery slideshow</a> and see what we do!<br>Click any button to stop the slideshow</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As a window on the wider world, we regularly exchange photos with Rotorua U3A in New Zealand.<br><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_rotorua&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">Rotorua gallery slideshow</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Want to see more?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Click a link in one of the menus for:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?programme_2019\">2019-2020 programme</a></li><li><a href=\"http://localhost:81/u3aphotogroup/using-the-photo-gallery\" data-type=\"URL\" data-id=\"http://localhost:81/u3aphotogroup/using-the-photo-gallery\">using the gallery</a> </li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/\" data-type=\"page\" data-id=\"67\">camera tips</a></li><li><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?tech_intro\">technical introduction</a></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Join us</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you live in the Guildford area and would like to explore joining the group, please email our <a href=\"mailto:members@u3aguildfordphoto.org.uk\">membership secretary</a>. You also need to be a member of <a href=\"http://www.guildfordu3a.org.uk\" target=\"_blank\" rel=\"noreferrer noopener\">Guildford U3A</a> [new window].</p>\n<!-- /wp:paragraph -->', 'Getting Started', '', 'publish', 'closed', 'closed', '', 'getting-started-for-members', '', '', '2020-12-02 15:53:52', '2020-12-02 15:53:52', '', 0, 'http://localhost:81/u3aphotogroup/?page_id=60', 0, 'page', '', 0),
(61, 1, '2020-09-22 13:03:09', '2020-09-22 12:03:09', '<!-- wp:paragraph -->\n<p>Our aim: <strong>To inspire you to create better photos</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Welcome! Here are the most important topics to help you get started with digital photography and the way the group works.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>The Group</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Forty or so of us meet in Guildford every month to share photos and to learn. Beginners and experts, we use every sort of camera from compact to DSLR.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Open our <a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_members&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">members gallery slideshow</a> and see what we do!<br>Click any button to stop the slideshow</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As a window on the wider world, we regularly exchange photos with Rotorua U3A in New Zealand.<br><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?gallery&amp;start=0&amp;seconds=5&amp;max=28&amp;next=1&amp;sort=datetaken&amp;age_limit=9999&amp;full_screen=on&amp;folder=image_rotorua&amp;stem_default=yes&amp;detail=basic&amp;show_settings=none\">Rotorua gallery slideshow</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Want to see more?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Click a link in one of the menus for:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?programme_2019\">2019-2020 programme</a></li><li><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?gllry_tips\">using the gallery</a></li><li><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?camera_tips\">camera tips</a></li><li><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?tech_intro\">technical introduction</a></li><li>for more on any of the topics, please see the <a href=\"https://u3aguildfordphoto.org.uk/main.pl?home\">main website</a></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Join us</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you live in the Guildford area and would like to explore joining the group, please email our <a href=\"mailto:members@u3aguildfordphoto.org.uk\">membership secretary</a>. You also need to be a member of <a href=\"http://www.guildfordu3a.org.uk\" target=\"_blank\" rel=\"noreferrer noopener\">Guildford U3A</a> [new window].</p>\n<!-- /wp:paragraph -->', 'Getting Started for Members', '', 'inherit', 'closed', 'closed', '', '60-revision-v1', '', '', '2020-09-22 13:03:09', '2020-09-22 12:03:09', '', 60, 'http://localhost:81/u3aphotogroup/2020/09/22/60-revision-v1/', 0, 'revision', '', 0),
