(65, 1, '2020-09-22 13:08:25', '2020-09-22 12:08:25', '<!-- wp:paragraph -->\n<p>Whatever your camera, we will help you take better photographs by exploring the creative thinking process, practical techniques and reviewing the photographs we take. There will also be occasional outdoor photoshoots to practise new skills.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:table -->\n<figure class=\"wp-block-table\"><table><tbody><tr><td><strong>Leader</strong></td><td>Jonathan 01483 894230 <a href=\"https://u3asites.org.uk/guildford/mailing/c:43479\">Email7</a></td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<!-- wp:table -->\n<figure class=\"wp-block-table\"><table><tbody><tr><td><strong>Day &amp; Time</strong></td><td>2nd Wednesday of the month 14.00 to 16.00</td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<!-- wp:table -->\n<figure class=\"wp-block-table\"><table><tbody><tr><td><strong>Dates</strong></td><td>Sep 9 : Oct 14 : Nov 11 : Dec 9 : Jan 13 : Feb 10 : Mar 10 : Apr 14 : May 12</td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<!-- wp:table -->\n<figure class=\"wp-block-table\"><table><tbody><tr><td><strong>Venue</strong></td><td>Zoom meetings. Please contact the group leader for details.</td></tr></tbody></table></figure>\n<!-- /wp:table -->', 'Join Us', '', 'inherit', 'closed', 'closed', '', '14-revision-v1', '', '', '2020-09-22 13:08:25', '2020-09-22 12:08:25', '', 14, 'http://localhost:81/u3aphotogroup/2020/09/22/14-revision-v1/', 0, 'revision', '', 0),
