(86, 1, '2020-09-22 14:39:09', '2020-09-22 13:39:09', '<!-- wp:paragraph -->\n<p>The full automatic setting of modern digital cameras usually gives excellent results. However, if things go wrong, or to get a particular effect, eg to put the background out of focus or to blur motion, you need to know how to set your camera controls.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This section has checklists for the main camera types and tips on composition:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?photo_compact\">basic compact checklist</a></li><li><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?photo_slr\">basic SLR/Bridge checklist</a></li><li><a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?comp_hints\">composition hints</a></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Exercises</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>focus</li><li>exposure</li><li>flash</li><li>other settings</li></ul>\n<!-- /wp:list -->', 'Camera Tips', '', 'inherit', 'closed', 'closed', '', '67-revision-v1', '', '', '2020-09-22 14:39:09', '2020-09-22 13:39:09', '', 67, 'http://localhost:81/u3aphotogroup/2020/09/22/67-revision-v1/', 0, 'revision', '', 0),
