(112, 1, '2020-09-22 15:09:04', '2020-09-22 14:09:04', '<!-- wp:paragraph -->\n<p>Whatever your camera, we will help you take better photographs by exploring the creative thinking process, practical techniques and reviewing the photographs we take. There will also be occasional outdoor photoshoots to practise new skills.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Note you will need to be a member if Guildford U3A to join the group.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Leader</strong>  email   <a href=\"mailto:members@u3aguildfordphoto.org.uk\">membership secretary</a>.  Or call Jonathan 01483 894230</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Day &amp; Time</strong> 2nd Wednesday of the month 14.00 to 16.00</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Dates</strong> Sep 9 : Oct 14 : Nov 11 : Dec 9 : Jan 13 : Feb 10 : Mar 10 : Apr 14 : May 12</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Venue</strong> Zoom meetings. Please contact the group leader for details.</p>\n<!-- /wp:paragraph -->', 'Join Us', '', 'inherit', 'closed', 'closed', '', '14-revision-v1', '', '', '2020-09-22 15:09:04', '2020-09-22 14:09:04', '', 14, 'http://localhost:81/u3aphotogroup/2020/09/22/14-revision-v1/', 0, 'revision', '', 0),
(115, 1, '2020-09-22 15:17:39', '2020-09-22 14:17:39', '<!-- wp:paragraph -->\n<p>The full automatic setting of modern digital cameras usually gives excellent results. However, if things go wrong, or to get a particular effect, eg to put the background out of focus or to blur motion, you need to know how to set your camera controls.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This section has checklists for the main camera types and tips on composition:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/basic-compact-checklist/\" data-type=\"page\" data-id=\"69\">basic compact checklist</a></li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/basic-dslr-bridge-checklist/\" data-type=\"page\" data-id=\"74\">basic SLR/Bridge checklist</a></li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/composition-hints/\" data-type=\"page\" data-id=\"76\">composition hints</a></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Exercises</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>focus</li><li>exposure</li><li>flash</li><li>other settings</li></ul>\n<!-- /wp:list -->', 'Camera Tips', '', 'inherit', 'closed', 'closed', '', '67-revision-v1', '', '', '2020-09-22 15:17:39', '2020-09-22 14:17:39', '', 67, 'http://localhost:81/u3aphotogroup/2020/09/22/67-revision-v1/', 0, 'revision', '', 0),
(116, 1, '2020-09-22 15:18:29', '2020-09-22 14:18:29', '<!-- wp:paragraph -->\n<p>The full automatic setting of modern digital cameras usually gives excellent results. However, if things go wrong, or to get a particular effect, eg to put the background out of focus or to blur motion, you need to know how to set your camera controls.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This section has checklists for the main camera types and tips on composition:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/basic-compact-checklist/\" data-type=\"page\" data-id=\"69\">basic compact checklist</a></li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/basic-dslr-bridge-checklist/\" data-type=\"page\" data-id=\"74\">basic SLR/Bridge checklist</a></li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/composition-hints/\" data-type=\"page\" data-id=\"76\">composition hints</a></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Exercises</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/focus-exercise/\" data-type=\"page\" data-id=\"90\">focus</a></li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/exposure-exercise/\" data-type=\"page\" data-id=\"94\">exposure</a></li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/flash-exercise/\" data-type=\"page\" data-id=\"99\">flash</a></li><li><a href=\"http://localhost:81/u3aphotogroup/camera-tips/other-settings-exercise/\" data-type=\"page\" data-id=\"101\">other settings</a></li></ul>\n<!-- /wp:list -->', 'Camera Tips', '', 'inherit', 'closed', 'closed', '', '67-revision-v1', '', '', '2020-09-22 15:18:29', '2020-09-22 14:18:29', '', 67, 'http://localhost:81/u3aphotogroup/2020/09/22/67-revision-v1/', 0, 'revision', '', 0),
(120, 1, '2020-09-23 18:22:03', '2020-09-23 17:22:03', '<!-- wp:paragraph -->\n<p>Hello everybody our next meeting is 14th October with photo submissions due on 7th October please.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On the agenda we have an optional item after the break of \'know your camera\'. To assist plan this please will you let me know by return e-mail</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1) your camera type if you wish to join this session</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2) If you can \'step up\' and do a breakout room for either Olympus or Lumix/Panasonic (we have Canon and Nikon \'covered\')</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Below is an interesting link that John Clark forwarded me, that you may find of interest.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://www.youtube.com/watch?v=F-TyPfYMDK8&amp;feature=share&amp;fbclid=IwAR0msqF8Q8BSPUbKKW2q07NLW2UEOjXeoXR2Igmx-MqZuyprhEhLyhOzoQo\">THE LAB: DECOY | 6 Photographers 1 Man - A Portrait Photography Session With A Twist</a></p>\n<!-- /wp:paragraph -->', 'Our Next Meeting', '', 'inherit', 'closed', 'closed', '', '119-revision-v1', '', '', '2020-09-23 18:22:03', '2020-09-23 17:22:03', '', 119, 'http://localhost:81/u3aphotogroup/2020/09/23/119-revision-v1/', 0, 'revision', '', 0),
(135, 1, '2020-10-06 17:04:36', '2020-10-06 16:04:36', '<!-- wp:heading {\"level\":3} -->\n<h3>Who we are</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Guildford U3A Photography Group (GUPG) is one of the Guildford U3A groups. We are run entirely by volunteers.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>email address for correspondence:<br>&nbsp; &nbsp; <a href=\"mailto:members@u3aguildfordphoto.org.uk\">members@u3aguildfordphoto.org.uk</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our overall approach to GDPR is set out in our <a href=\"https://u3aguildfordphoto.org.uk/main.pl?gdpr_general\">General GDPR Documentation</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What this Privacy Notice applies to</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We take great care to protect your Personal Information and to give you the opportunity to manage how it is used.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This notice applies to all Personal Information processed by GUPG. Our recording and processing of your Personal Information is on the basis of Legitimate Interest based on the services we provide to you, which is principally to arrange a programme of monthly meetings and photoshoots.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We maintain a Mailing List and certain other information, described below. We use our Mailing List to send you news about the group, to inform you about our events, to invite your feedback and for administration. We may also advise you about photographic events and technical information likely to be of interest to members. Your Personal Information is never used to send messages on behalf of third parties nor revealed to others except in the very unlikely case of legal necessity.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If anything in this Privacy Notice is not acceptable to you, you may join GUPG but we will be unable to keep you informed about our activities and you will not be able to use our online applications, for example to upload photos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>GUPG Core Group</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Any member can volunteer to join a Core Group which manages our activities.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Our records</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Mailing List</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>When you join the group your name, email address, telephone number, year of joining GUPG and U3A membership number are recorded offline in a spreadsheet to form our Mailing List.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A copy of the Mailing List is maintained online, also controlling which applications you can use. All registered members are authorised to upload photos. After training authorised members are in addition able to access the contact information of group members.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You remain on the Mailing List while you are an active member. When you leave the group, your Personal Information is deleted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Images</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Images uploaded by or on behalf of members to our public website always include your name, which is visible to website visitors. Images uploaded more than two years previously are deleted in July each year. We do not automatically delete photos when you leave the group. If at any time you wish us to delete some or all of your photos, please contact our <a href=\"mailto:webmaster@u3aguildfordphoto.org.uk\">webmaster@u3aguildfordphoto.org.uk</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We may use images for instructional purposes at GUPG meetings.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Images may be used without notice for publicity purposes on behalf of GUPG providing the photographer and the group are mentioned.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As images are uploaded you are asked to warrant that you hold the full copyright (or that you have the copyright holder\'s explicit permission if submitting on behalf of someone else).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Image copyright remains with the photographer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Online data</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Encrypted passwords are held in small text files created and updated by our applications. The only Personal Information in password files is your email address. Password files more than 12 months old are deleted in July each year, whether or not you remain a member of the group.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We may occasionally ask you to complete an online questionnaire. Answers are held in small text files which include your name and email address. These files can be displayed individually or analysed together by authorised members using one of our applications. They are deleted not later than the second July following the questionnaire. The questionnaire application is also used for commenting on images, in particular the annual Rotorua photo exchange.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our online data cannot be accessed directly. It can be accessed though one of our applications which, with the exception of comments on images, are protected by one or more passwords.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our website applications (eg the questionnaire) write an activity log to a secure area used mainly for problem solving on behalf of users, but also available for audit purposes. Individual users can be identified. The log never includes user passwords. This log has nothing to do with cookies and does not write any information to your computer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Data Security</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Your information can be seen and processed by authorised members on a need-to-know basis. These members are required to confirm in writing that they will comply with the letter and the spirit of this Privacy Notice and with our <a href=\"https://u3aguildfordphoto.org.uk/main.pl?data_protection\">Data Protection Policy</a>, which includes a commitment to maintaining effective data security. Those members using our online information are given appropriate training.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Your rights</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>You have the right at any time to ask for your Personal Information to be deleted. You may remain a member of the group but we will be unable to keep you informed about our activities and you will not be able to use our online applications, for example to upload photos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you wish to know what Personal Information we hold about you or you believe the information we hold on you may be incorrect you can request to see this information and have it corrected or deleted. If you wish to raise a complaint on how we have used your Personal Information, we will investigate. For all of these, please email <a href=\"mailto:members@u3aguildfordphoto.org.uk\">members@u3aguildfordphoto.org.uk</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are not satisfied with our response and continue to be unhappy about our processing of your Personal Information you can complain to the Information Commissioners Office (ICO). The information for doing this can be found at <a href=\"https://ico.org.uk/concerns/\">https://ico.org.uk/concerns/ ICO: Report a concern</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Winding up</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Should the group be wound up we will delete all our records. No Personal Information will be transferred elsewhere.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Changes to Privacy Notice</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We keep this Privacy Notice under constant review, so for the latest version please return here.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will not make significant changes to this Privacy Notice without advising you. If you do not agree to the revised conditions you can ask to have your Personal Information deleted from our records by contacting <a href=\"mailto:members@u3aguildfordphoto.org.uk\">members@u3aguildfordphoto.org.uk</a>, in which case you can if you wish remain a member of the group but we will be unable to keep you informed about our activities and you will not be able to use our online applications, for example to upload photos.</p>\n<!-- /wp:paragraph -->', 'Privacy', '', 'inherit', 'closed', 'closed', '', '134-revision-v1', '', '', '2020-10-06 17:04:36', '2020-10-06 16:04:36', '', 134, 'http://localhost:81/u3aphotogroup/2020/10/06/134-revision-v1/', 0, 'revision', '', 0),
