the parts of your camera manual on focusing and close-up (macro or flower setting)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>With  pressure on shutter release watch the camera autofocus. Does it beep when focused? Can you switch the beep off?</li><li>Find out where your cameras focuses (multi-spot/single centre spot?) Does it focus on the nearest part of the subject?</li><li>Find out if your camera has manual focus.</li><li>Compact camera users: Try out the macro (flower symbol) control. Cancel macro.</li><li>SLR Users: Find out how close you can focus. Does it vary with different lenses?</li><li>How does your camera tell you youre too close? (light/beep?)</li><li>Compact users: Use tele setting to get better out-of-focus background</li><li>SLR Users: Set a wide aperture and/or use a long lens</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Exercise *</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Take two hand-held photos, with and without macro (flower symbol) control as close up as possible for an in-focus image. What is the difference in the distances and in the depth of field?</li><li>Repeat the previous step with the camera on a tripod (or on a firm surface) so you can assess the effect of camera shake.</li><li>If your camera supports it, adjust the focus point and repeat one of the choices above (SLR users can do this. Compact users may not be able to.)</li><li>Compare the various images (PC). How do sharpness and depth of field vary? How can you use this knowledge?</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>*Write down your choices so you know which images correspond to each setting. Where (PC) is shown this part may have to be completed later.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#exercises\">Back to Exercises</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"exposureex\">Exposure Exercise</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Preparation</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>To understand how exposure is affected by aperture, shutter speed and ISO, see <a href=\"http://www.cambridgeincolour.com/tutorials/camera-exposure.htm\" target=\"_blank\" rel=\"noreferrer noopener\">camera exposure</a> [new window]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Read the part of your camera manual on exposure (Some compact cameras may have none of these  but dont worry!)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Check if you have got automatic and manual exposure control.</li><li>Check any different metering settings (evaluative/spot)</li><li>Have you got Full Auto (green) and Program (P) settings?</li><li>Have you got shutter priority (Tv) and aperture priority (Av)?</li><li>Read about ISO settings (sensitivity of the camera sensor)</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Exercise *</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Take several photos with a range of exposure settings.</li><li>Take several photos with a range of ISO settings.</li><li>Compare the images (PC) for sharpness, depth of field and digital noise. How can you use this knowledge to take better pictures?</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>*Write down your choices so you know which images correspond to each setting. Where (PC) is shown this part may have to be completed later.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#exercises\">Back to Exercises</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"flash\">Flash Exercise</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Preparation</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Read the part of your camera manual on flash.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Check how flash toggles between always on/off/auto/red eye.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Exercise*</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Take a couple of photos  one with flash and one without. Compare (PC) to see the differences. Which do you prefer? What might you do to get the best of both methods in a picture?</li><li>Take several pictures of the same object with and without flash at different distances (eg 1 meter, 3 metres, 10 metres, 30 metres  perhaps easier outside). Compare (PC) to see the differences. Are any parts overexposed or underexposed? What is the maximum distance for your flash to be useful? Is there a minimum distance?</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>*Write down your choices so you know which images correspond to each setting. Where (PC) is shown this part may have to be completed later.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#exercises\">Back to Exercises</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"settings\">Other Settings Exercise</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Preparation</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Read the parts of your camera manual on file size/quality settings/scene modes or creative modes</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Find out how to set your camera to the best file size/quality settings (Always aim for superfine quality and large file size.)</li><li>Change the settings if need be (or bring camera and manual and we will help)</li><li>Find out what scene/creative modes you have (eg landscape/portrait/snow/night)</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Exercise*</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Take the same photo for several file quality settings, if possible using a tripod. Compare (PC) the sharpness of each image by zooming in. Why do they differ?</li><li>Take the same photo using several scene/creative mode settings, if possible using a tripod. Compare (PC) depth of field and colour. How do they differ and how might you use what you have learnt?</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>*Write down your choices so you know which images correspond to each setting. Where (PC) is shown this part may have to be completed later.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#exercises\">Back to Exercises</a></p>\n<!-- /wp:paragraph -->', 'Camera Tips', '', 'inherit', 'closed', 'closed', '', '67-revision-v1', '', '', '2020-11-13 16:45:16', '2020-11-13 16:45:16', '', 67, 'http://localhost:81/u3aphotogroup/2020/11/13/67-revision-v1/', 0, 'revision', '', 0),
(169, 1, '2020-11-13 16:46:51', '2020-11-13 16:46:51', '<!-- wp:paragraph -->\n<p>The full automatic setting of modern digital cameras usually gives excellent results. However, if things go wrong, or to get a particular effect, eg to put the background out of focus or to blur motion, you need to know how to set your camera controls.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"camera\">Camera Checklists</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>This section has checklists for the main camera types and tips on composition:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul id=\"slrbridge\"><li><a href=\"#compact\">basic compact checklist</a></li><li><a href=\"#dslrbridge\">basic DSLR/Bridge checklist</a></li><li><a href=\"#composition\">composition hints</a></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2 id=\"exercises\">Exercises</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li><a href=\"#focusex\">focus</a></li><li><a href=\"#exposureex\">exposure</a></li><li><a href=\"#flashex\">flash</a></li><li><a href=\"#settingsex\">other settings</a></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2 id=\"compact\">Basic Compact Checklist</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Before you start</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Dials and other settings may not be as you expect so always spend a few seconds checking the basics:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>shooting mode set correctly? [change as necessary during a photo session]</li><li>image stabilisation set? [if available might be a button, in a menu or a shooting mode]</li><li>flash set correctly? [switch off for less harsh lighting]</li><li>macro (flower) setting correct? [on for closeup, off otherwise]</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>To take a photo</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>set zoom to suit subject</li><li>focus camera [point at main subject, touch/half press shutter release button to focus] respond if there are warnings eg if too close to a subject for proper focus</li><li>compose photo [keep shutter release button half down to maintain focus and other settings, don\'t alter zoom]</li><li>take photo [fully press shutter release button]</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#camera\">Back</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"dslrbridge\">Basic DSLR/Bridge Checklist</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Before you start</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Dials and other settings may not be as you expect so always spend a few seconds checking the basics:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>image stabiliser on? [if available, might be on lens or in a menu]</li><li>auto focus selected?</li><li>flash set correctly? [switch off for less harsh lighting]</li><li>shooting mode selected correctly? [see <a href=\"https://u3aguildfordphoto.org.uk/memintro/main.pl?photo_exposure\">exposure and shooting mode</a>]</li><li>ISO suitable? [generally as low as practical]</li><li>focus points suitable? [generally select just the central focus point]</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>To take a photo</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>set zoom (if available) to suit subject [wide angle - good depth of field; telephoto - narrower depth of field]</li><li>[Depth of field = distance between the nearest and farthest objects in sharp focus]</li><li>if shutter speed is 1/60 second or slower, find a way of steadying the camera [touch/half press shutter release button to check speed]</li><li>focus camera [point at main subject, touch/half press shutter release button to focus]</li><li>compose photo [keep shutter release button half down to maintain focus and other settings, don\'t alter zoom]</li><li>take photo [fully press shutter release button]</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#camera\">Back</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"composition\">Composition Hints</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Position key parts of your subject on the \"thirds\" of a picture.</li><li>A good picture should \"tell a story\" immediately.</li><li>Crop! Crop! Crop! What doesn\'t help hinders.</li><li>Get in close to your subject. Fill the frame (but remember cut-off by viewfinder and processors).</li><li>Watch out for distractions on the edge of the picture eg light patches, electric sockets, fire extinguishers etc.</li><li>Light: early morning or late evening often best. Don\'t be afraid of shooting against the light.</li><li>Advancing (warm) &amp; receding (cool) colours - use them to your advantage.</li><li>Try framing the picture with trees, arches, or other shapes.</li><li>Use differential focus - to \"lose\" backgrounds or foregrounds.</li><li>Use natural lines to \"lead the eye in\" to key parts of the picture.</li><li>Consider using portrait format, not always landscape.</li><li>You can \"lose\" a boring middle ground with a low viewpoint.</li><li>Pack couples or groups closely together in posed people pictures.</li><li>In landscapes, look for some foreground interest, eg perhaps a boulder or a person, to give depth to the picture.</li><li>Don\'t have skylines right in the middle of a picture. Keep them level!</li><li>If you have a boring plain sky, include only a bare minimum of it.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>Competition hint: A good big \'un always beats a good little \'un!</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#camera\">Back</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"focusex\">Focus Exercise</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Preparation</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Read the parts of your camera manual on focusing and close-up (macro or flower setting)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>With  pressure on shutter release watch the camera autofocus. Does it beep when focused? Can you switch the beep off?</li><li>Find out where your cameras focuses (multi-spot/single centre spot?) Does it focus on the nearest part of the subject?</li><li>Find out if your camera has manual focus.</li><li>Compact camera users: Try out the macro (flower symbol) control. Cancel macro.</li><li>SLR Users: Find out how close you can focus. Does it vary with different lenses?</li><li>How does your camera tell you youre too close? (light/beep?)</li><li>Compact users: Use tele setting to get better out-of-focus background</li><li>SLR Users: Set a wide aperture and/or use a long lens</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Exercise *</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Take two hand-held photos, with and without macro (flower symbol) control as close up as possible for an in-focus image. What is the difference in the distances and in the depth of field?</li><li>Repeat the previous step with the camera on a tripod (or on a firm surface) so you can assess the effect of camera shake.</li><li>If your camera supports it, adjust the focus point and repeat one of the choices above (SLR users can do this. Compact users may not be able to.)</li><li>Compare the various images (PC). How do sharpness and depth of field vary? How can you use this knowledge?</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>*Write down your choices so you know which images correspond to each setting. Where (PC) is shown this part may have to be completed later.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#exercises\">Back to Exercises</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"exposureex\">Exposure Exercise</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Preparation</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>To understand how exposure is affected by aperture, shutter speed and ISO, see <a href=\"http://www.cambridgeincolour.com/tutorials/camera-exposure.htm\" target=\"_blank\" rel=\"noreferrer noopener\">camera exposure</a> [new window]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Read the part of your camera manual on exposure (Some compact cameras may have none of these  but dont worry!)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Check if you have got automatic and manual exposure control.</li><li>Check any different metering settings (evaluative/spot)</li><li>Have you got Full Auto (green) and Program (P) settings?</li><li>Have you got shutter priority (Tv) and aperture priority (Av)?</li><li>Read about ISO settings (sensitivity of the camera sensor)</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Exercise *</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Take several photos with a range of exposure settings.</li><li>Take several photos with a range of ISO settings.</li><li>Compare the images (PC) for sharpness, depth of field and digital noise. How can you use this knowledge to take better pictures?</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>*Write down your choices so you know which images correspond to each setting. Where (PC) is shown this part may have to be completed later.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#exercises\">Back to Exercises</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"flashex\">Flash Exercise</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Preparation</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Read the part of your camera manual on flash.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Check how flash toggles between always on/off/auto/red eye.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Exercise*</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Take a couple of photos  one with flash and one without. Compare (PC) to see the differences. Which do you prefer? What might you do to get the best of both methods in a picture?</li><li>Take several pictures of the same object with and without flash at different distances (eg 1 meter, 3 metres, 10 metres, 30 metres  perhaps easier outside). Compare (PC) to see the differences. Are any parts overexposed or underexposed? What is the maximum distance for your flash to be useful? Is there a minimum distance?</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>*Write down your choices so you know which images correspond to each setting. Where (PC) is shown this part may have to be completed later.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#exercises\">Back to Exercises</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"settingsex\">Other Settings Exercise</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Preparation</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Read the parts of your camera manual on file size/quality settings/scene modes or creative modes</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Find out how to set your camera to the best file size/quality settings (Always aim for superfine quality and large file size.)</li><li>Change the settings if need be (or bring camera and manual and we will help)</li><li>Find out what scene/creative modes you have (eg landscape/portrait/snow/night)</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Exercise*</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Take the same photo for several file quality settings, if possible using a tripod. Compare (PC) the sharpness of each image by zooming in. Why do they differ?</li><li>Take the same photo using several scene/creative mode settings, if possible using a tripod. Compare (PC) depth of field and colour. How do they differ and how might you use what you have learnt?</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>*Write down your choices so you know which images correspond to each setting. Where (PC) is shown this part may have to be completed later.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#exercises\">Back to Exercises</a></p>\n<!-- /wp:paragraph -->', 'Camera Tips', '', 'inherit', 'closed', 'closed', '', '67-revision-v1', '', '', '2020-11-13 16:46:51', '2020-11-13 16:46:51', '', 67, 'http://localhost:81/u3aphotogroup/2020/11/13/67-revision-v1/', 0, 'revision', '', 0),
